(1,1,'Kitab Permulaan Wahyu ','Permulaan Turunnya Wahyu ','Dari Alqamah bin Waqqash al-Laitsi berkata, “Aku pernah mendengar Umar bin Khaththab diatas mimbar. Ia berkata; \'Aku mendengar Rasulullah shallallahu \'alaihi wasallam bersabda, \'Sesungguhnya amal-amal perbuatan itu hanyalah menurut niatnya, dan bagi setiap orang hanyalah sesuatu yang diniatkannya. Barangsiapa yang berhijrah karena dunia, maka ia akan memperolehnya. Atau, karema wanita yang ingin dinikahinya, maka hijrahnya kepada apa-apa yang karenanya ia melakukan hijrah.”',NULL,NULL),
(2,2,'Kitab Permulaan Wahyu ','Permulaan Turunnya Wahyu ','Dari Aisyah Ummul um Mu\'minin, bahwasanya Al-Harits bin Hisyam bertanya kepada Rasulullah shallallahu \'alaihi wasallam. Ia berkata, \'Wahai Rasulullah, bagaimana datangnya wahyu kepadamu? \'Maka Rasulullah shallallahu \'alaihi wasallam menjawab, \'Terkadang wahyu itu datang kepadaku seperti suara gemerincingnya bunyi lonceng, dan itu paling berat menurutku. Lalu terputus dariku dan aku sadar akan apa-apa yang dikatakannya. Kadang-kadang datang kepadaku malaikat yang berubah wujud sebagai seorang laki-laki, kemudian ia berbicara kepadaku, dan aku hafal apa yang dikatakannya\". Aisyah berkata: \"Sungguh aku telah melihat beliau sewaktu wahyu diturunkan pada hari yang sangat dingin sekali. Ketika wahyu itu selesai disampaikan, dahi beliau dipenuhi keringat.\"',NULL,NULL),
(3,3,'Kitab Permulaan Wahyu ','Permulaan Turunnya Wahyu ','Dari Aisyah Ummul Mukminin bahwasanya is berkata, “Wahyu yang pertama turun kepada Rasullullah shallallahu \'alaihi wasallam adalah mimpi yang benar di dalam tidurnya. Beliau tidak akan bermimpi melainkan mimpinya itu akan menjadi kenyataan seperti terang benderangnya cahaya shubuh. Kemudian beliau suka menyendiri. Beliau biasa menyendiri di Gua Hira. Beliau beribadah disana untuk beberapa malam sebelum beliau rindu kepada keluarganya dan mengambil bekal untuk itu. Kemudian beliau pulang kerumah Khadijah. Beliau mengambil bekal seperti biasanya sampai datanglah kepadanya kebenaran sewaktu beliau ada di Gua Hira. Telah datang kepadanya sesosok malaikat seraya berkata, \'Bacalah!’. Beliau menjawab, \'Sungguh aku tidak bisa membaca . \'Ia mengambil dan mendekapku sehingga aku merasa lemas. Kemudian ia melepaskanku, lalu berkata, \'Bacalah!’. Maka aku berkata, \'Sungguh aku tidak bisa membaca’. Lalu ia mengambil dan mendekapku untuk kedua kalinya, kemudian ia melepaskanku, lalu berkata, \'Bacalah!’. Maka aku berkata, \'Sungguh aku tidak dapat membaca’. Lalu ia mengambil dan mendekapku untuk ketiga kalinya, kemudian melepaskanku. Lalu ia membacakan, \'iqra’ bismirabbikalladzi khalaq. Khalaqal insaana min \'alaq. Iqra’ warabbukal akram, Alladzii \'allama bil qalam. \'Allamal insaana maa lam ya’lam’. (Bacalah dengan menyebut nama Tuhanmu yang menciptakan. Dia telah menciptakanmu dari segumpal darah. Bacalah, dan Tuhanmulah Yang Paling Pemurah. Yang mengajarkan kepada manusia apa yang tidak diketahuinya). <br>Kemudian Rasullullah shallallahu \'alaihi wa sallam pulang dengan membawa ayat-ayat itu dengan hati yang berdebar-debar. Lalu beliau masuk rumah menemui Khadijah binti Khuwailid, lantas beliau berkata, Selimutilah aku, selimutilah aku!’ Kemudia mereka menyelimuti beliau sehingga rasa takut beliau hilang. Beliau berkata dan menceritakan hal itu kepada Khadijah, \'Sungguh aku takut atas diriku’. Lalu Khadijah berkata kepada beliau, “Jangan takut! Demi Allah, Allah tidak akan menyusahkanmu selamanya karena sesungguhnya engkau suka menyambung tali persaudaraan, menanggung beban dan berusaha membantu orang yang tidak punya, memuliakan tamu dan menolong orang-orang yang menegakkan kebenaran.’<br><br>Kemudian Khadijah mengajak beliau pergi menemui Waraqah bin Naufal bin Asad bin Abdul Uzza, anak paman Khadijah. Dia adalah seseorang yang memeluk agama Nashrani pada zaman Jahiliyah. Ia bisa menulis tulisan Ibrani, dan menulis banyak sekali Injil dengan bahasa Ibrani. Ia seorang yang sudah sangat tua dan buta. Khadijah berkata kepadanya, \'Wahai pamanku, dengarkanlah cerita putra saudaramu ini!’ Lalu Waraqah berkata kepada beliau, Wahai putra saudaraku, apakah yang engkau lihat?’ Lantas Rasulullah shallallaahu \'alaihi wasallam menceritakan kepadanya tentang apa yang beliau lihat. Kemudian Waraqah berkata kepada beliau, \'Ini adalah wahyu yang diturunkan Allah kepada Musa! Aduhai, seandainya saja aku masih muda, seandainya aku masih hidupketika kaummu mengusirmu’. Lalu Rasulullah shallallahu \'alaihi wasallam bertanya, \'Apakah mereka akan mengusirku?’. Waraqah menjawab, \'Ya, belum pernah datang seseorangpun dengan apa yang seperti engkau bawa kecuali ia dimusuhi. Jika aku masih menjumpai masamu, maka aku akan menolongmu dengan pertolongan yang tangguh’. Tidak lama kemudian akhirnya Waraqah meninggal dan wahyu pun terputus untuk sementara waktu.” ',NULL,NULL),
(4,4,'Kitab Permulaan Wahyu ','Permulaan Turunnya Wahyu ','Dari Jabir bin Abdillah al-anshari berkata -ia menceritakan tentang wahyu yang turunnya berselang (terputus)-, \'Beliau shallallahu \'alaihi wasallam bersabda dalam sebuah haditsnya, \'Ketika aku sedang berjalan, tiba-tiba aku mendengar suara dari langit. Maka aku angkat pandanganku keatas. Ternyata ada malaikat yang pernah mendatangiku sewaktu di gua Hira. Ia sedang duduk di atas sebuah kursi yang terletak di antara langit dna bumi. Aku menjadi ketakutan. Lantas aku pulang dan berkata, \'Selimutilah aku, selimutilah aku!’. Maka Allah menurunkan ayat ; “Yaa ayyuhal muddatstsir, qum fa andzir,” sampai kepada ayat “Warrujza fahjur” (Hai orang-orang yang berselimut, bangunlah lalu berilah peringatan”. Sampai ayat : “Dan perbuatan dosa tinggalkanlah.” (QS. Al-Muddatstsir 1-5). Maka wahyu itu telah menenangkannya dan terus berlangsung.”',NULL,NULL),
(5,5,'Kitab Permulaan Wahyu ','Permulaan Turunnya Wahyu ','Dari Ibnu Abbas tentang firman Allah Ta\'ala: “(Janganlah kamu gerakkan lidahmu karena ingin cepat menghafal isi wahyu).” (QS. Al-Qiyamah : 16). Ia berkata, \'Rasulullah mengalami kondi yang berat setelah menerima wahyu tersebut, -dan beliau menggerak-gerakkan kedua bibirnya-, Ibnu Abbas berkata, \'Maka aku menggerak-gerakkan keduanya di hadapan kalian sebagaimana Rasulullah shalallahu \'alaihi wasallam menggerak-gerakkannya’. Said berkata, \'Aku menggerak-gerakkan keduanya sebagaimana aku melihat Ibnu Abbas menggerak-gerakkannya. Lantas ia menggerak-gerakkannya kedua bibirnya-, maka Allah menurunkan ayat: “Laa tuharrik bihi lisaanaka lita’jala bih. Inna \'alainaa jam’ahu wa qur’aanahu (Jangan kamu menggerakkan lidahmu karena ingin cepat menghafal isi wahyu: Sesungguhnya menjadi tanggungan Kamilah mengumpulkannya (didadamu) dan (membuat pandai) membacanya).” (QS al-Qiyamah: 16-17). Ia berkata, \'Mengumpulkannya untukmu di dalam dadamu, dan kamu membacanya : “Fa idzaa qara’naahu fattabi’ qur’aanahu (Maka apabila kamu membacakannya (wahyu) maka ikutilah bacaannya itu.)” (QS al-Qiyamah: 18). Ia berkata, \'Maka dengarlah baik-baik dan diamlah, “Tsumma inna \'alainaa bayaanahu (Kemudian sesungguhnya atas tanggungan Kamilah penjelasannya.)” (QS al-Qiyamah: 19). Kemudian kepada Kamilah kamu membacanya’. Maka Rasullulah shalallahu \'alaihi wasallam setelah itu, apabila Jibril mendatanginya ia mendengarkannya. Dan setelah Jibril pergi, nabi shallallahu \'alaihi wasallam membacakannya sebagaimana Jibril membacakannya.” ',NULL,NULL),
(6,6,'Kitab Permulaan Wahyu ','Permulaan Turunnya Wahyu ','Dari Ibnu Abbas, ia berkata, \'Rasululllah shalallhu \'alaihi wasallam adalah orang yang paling dermawan, dan beliau menjadi lebih dermawan pada bulan Ramadhan ketika Jibril menemuinya. Ia menemui beliau pada setiap malam dari bulan Ramadhan. Lalu Jibril bertadarus al-Qur’an bersama beliau. Rasulullah shalallahu \'alaihi wasallam adalah orang yang paling dermawan dalam hal kebaikan lebih daripada angin yang berhembus. ',NULL,NULL),
(7,7,'Kitab Permulaan Wahyu ','Permulaan Turunnya Wahyu ','Telah menceritakan kepada kami Abu Al Yaman Al Hakam bin Nafi\' dia berkata, telah mengabarkan kepada kami Syu\'aib dari Az Zuhri telah mengabarkan kepadaku Ubaidullah bin Abdullah bin \'Utbah bin Mas\'ud bahwa Abdullah bin \'Abbas telah mengabarkan kepadanya bahwa Abu Sufyan bin Harb telah mengabarkan kepadanya; bahwa Heraclius menerima rombongan dagang Quraisy, yang sedang mengadakan ekspedisi dagang ke Negeri Syam pada saat berlakunya perjanjian antara Nabi shallallahu \'alaihi wasallam dengan Abu Sufyan dan orang-orang kafir Quraisy. Saat singgah di Iliya\' mereka menemui Heraclius atas undangan Heraclius untuk di diajak dialog di majelisnya, yang saat itu Heraclius bersama dengan para pembesar-pembesar Negeri Romawi. Heraclius berbicara dengan mereka melalui penerjemah. Heraclius berkata; \"Siapa diantara kalian yang paling dekat hubungan keluarganya dengan orang yang mengaku sebagai Nabi itu?.\" Abu Sufyan berkata; maka aku menjawab; \"Akulah yang paling dekat hubungan kekeluargaannya dengan dia\". Heraclius berkata; \"Dekatkanlah dia denganku dan juga sahabat sahabatnya.\" Maka mereka meletakkan orang-orang Quraisy berada di belakang Abu Sufyan. Lalu Heraclius berkata melalui penerjemahnya: \"Katakan kepadanya, bahwa aku bertanya kepadanya tentang lelaki yang mengaku sebagai Nabi. Jika ia berdusta kepadaku maka kalian harus mendustakannya.\"Demi Allah, kalau bukan rasa malu akibat tudingan pendusta yang akan mereka lontarkan kepadaku niscaya aku berdusta kepadanya.\" Abu Sufyan berkata; Maka yang pertama ditanyakannya kepadaku tentangnya (Nabi shallallahu \'alaihi wasallam) adalah: \"bagaimana kedudukan nasabnya ditengah tengah kalian?\" Aku jawab: \"Dia adalah dari keturunan baik baik (bangsawan) \". Tanyanya lagi: \"Apakah ada orang lain yang pernah mengatakannya sebelum dia?\" Aku jawab: \"Tidak ada\". Tanyanya lagi: \"Apakah bapaknya seorang raja?\" Jawabku: \"Bukan\". Apakah yang mengikuti dia orang-orang yang terpandang atau orang-orang yang rendah?\" Jawabku: \"Bahkan yang mengikutinya adalah orang-orang yang rendah\". Dia bertanya lagi: \"Apakah bertambah pengikutnya atau berkurang?\" Aku jawab: \"Bertambah\". Dia bertanya lagi: \"Apakah ada yang murtad disebabkan dongkolterhadap agamanya?\" Aku jawab: \"Tidak ada\". Dia bertanya lagi: \"Apakah kalian pernah mendapatkannya dia berdusta sebelum dia menyampaikan apa yang dikatakannya itu?\" Aku jawab: \"Tidak pernah\". Dia bertanya lagi: \"Apakah dia pernah berlaku curang?\" Aku jawab: \"Tidak pernah. Ketika kami bergaul dengannya, dia tidak pernah melakukan itu\". <br><br>Berkata Abu Sufyan: \"Aku tidak mungkin menyampaikan selain ucapan seperti ini\". Dia bertanya lagi: \"Apakah kalian memeranginya?\" Aku jawab: \"Iya\". Dia bertanya lagi: \"Bagaimana kesudahan perang tersebut?\" Aku jawab: \"Perang antara kami dan dia sangat banyak. Terkadang dia mengalahkan kami terkadang kami yang mengalahkan dia\". Dia bertanya lagi: \"Apa yang diperintahkannya kepada kalian?\" Aku jawab: \"Dia menyuruh kami; \'Sembahlah Allah dengan tidak menyekutukannya dengan sesuatu apapun, dan tinggalkan apa yang dikatakan oleh nenek moyang kalian. \' Dia juga memerintahkan kami untuk menegakkan shalat, menunaikan zakat, berkata jujur, saling memaafkan dan menyambung silaturrahim\". <br><br>Maka Heraclius berkata kepada penerjemahnya: \"Katakan kepadanya, bahwa aku telah bertanya kepadamu tentang keturunan orang itu, kamu ceritakan bahwa orang itu dari keturunan bangsawan. Begitu juga laki-laki itu dibangkitkan di tengah keturunan kaumnya. Dan aku tanya kepadamu apakah pernah ada orang sebelumnya yang mengatakan seperti yang dikatakannya, kamu jawab tidak. Seandainya dikatakan ada orang sebelumnya yangmengatakannya tentu kuanggap orang ini meniru orang sebelumnya yang pernahmengatakan hal serupa. Aku tanyakan juga kepadamu apakah bapaknya ada yang dari keturunan raja, maka kamu jawab tidak. Aku katakan seandainya bapaknya dari keturunan raja, tentu orang ini sedang menuntut kerajaan bapaknya. Dan aku tanyakan juga kepadamu apakah kalian pernah mendapatkan dia berdusta sebelum dia menyampaikan apa yang dikatakannya, kamu menjawabnya tidak. Sungguh aku memahami, kalau kepada manusia saja dia tidak berani berdusta apalagi berdusta kepada Allah. Dan aku juga telah bertanya kepadamu, apakah yang mengikuti dia orang-orang yang terpandang atau orang orang yang rendah?\" Kamu menjawab orang-orang yang rendah yang mengikutinya. Memang mereka itulah yang menjadi para pengikut Rasul. Aku juga sudah bertanya kepadamu apakah bertambah pengikutnya atau berkurang, kamu menjawabnya bertambah. Dan memang begitulah perkara iman hingga menjadi sempurna. Aku juga sudah bertanya kepadamu apakah ada yang murtad disebabkan marah terhadap agamanya. Kamu menjawab tidak ada. Dan memang begitulah iman bila telah masuk tumbuh bersemi di dalam hati. Aku juga sudah bertanya kepadamu apakah dia pernah berlaku curang, kamu jawab tidak pernah. Dan memang begitulah para Rasul tidak mungkin curang. Dan aku juga sudah bertanya kepadamu apa yang diperintahkannya kepada kalian, kamu jawab dia memerintahkan kalian untuk menyembah Allah dengan tidak menyekutukannya dengan sesuatu apapun, dan melarang kalian menyembah berhala, dia juga memerintahkan kalian untuk menegakkan shalat, menunaikan zakat, berkata jujur, saling memaafkan dan menyambung silaturrahim. Seandainya semua apa yang kamu katakan ini benar, pasti dia akan menguasai kerajaan yang ada di bawah kakiku ini. Sungguh aku telah menduga bahwa dia tidak ada diantara kalian sekarang ini, seandainya aku tahu jalan untuk bisa menemuinya, tentu aku akan berusaha keras menemuinya hingga bila aku sudah berada di sisinya pasti aku akan basuh kedua kakinya. Kemudian Heraclius meminta surat Rasulullah shallallahu \'alaihi wasallam yang dibawa oleh Dihyah untuk para Penguasa Negeri Bashrah, Maka diberikannya surat itu kepada Heraclius, maka dibacanya dan isinya berbunyi: <br><br>\"Bismillahir rahmanir rahim. <br>Dari Muhammad, hamba Allah dan Rasul-Nya <br>Kepada Heraclius. Penguasa Romawi<br>Kesejahteraan bagi siapa yang mengikuti petunjuk. <br>\'Ammaba’du <br><br>Kemudian dari pada itu, aku mengajakmu dengan seruan Islam; masuk Islamlah kamu, maka kamu akan selamat, Allah akan memberi pahala kepadamu dua kali. Namun jika kamu berpaling, maka kamu menanggung dosa rakyat kamu, dan: Hai ahli kitab, marilah (berpegang) kepada suatu kalimat (ketetapan) yang tidak ada perselisihan antara kami dan kamu, bahwa tidak kita sembah kecuali Allah dan tidak kita persekutukan dia dengan sesuatupun dan tidak (pula) sebagian kita menjadikan sebagian yang lain sebagai Rabb selain Allah\". Jika mereka berpaling, maka katakanlah kepada mereka: \"Saksikanlah, bahwa kami adalah orang-orang yang berserah diri (kepada Allah).\"<br><br>Abu Sufyan menuturkan: \"Setelah Heraclius menyampaikan apa yang dikatakannya dan selesai membaca surat tersebut, terjadilah hiruk pikuk dan suara-suara ribut, sehingga mengusir kami. Aku berkata kepada teman-temanku setelah kami diusir keluar; \"sungguh dia telah diajak kepada urusan Anak Abu Kabsyah. Heraclius mengkhawatirkan kerajaan Romawi.\"Pada masa itupun aku juga khawatir bahwa Muhammad akan berjaya, sampai akhirnya (perasaan itu hilang setelah) Allah memasukkan aku ke dalam Islam. Dan adalah Ibnu An Nazhur, seorang Pembesar Iliya\' dan Heraclius adalah seorang uskup agama<br>Nashrani, dia menceritakan bahwa pada suatu hari ketika Heraclius mengunjungi Iliya\' dia sangat gelisah, berkata sebagian komandan perangnya: \"Sungguh kami mengingkari keadaanmu. <br><br>Selanjutnya kata Ibnu Nazhhur, \"Heraclius adalah seorang ahli nujum yang selalu memperhatikan perjalanan bintang-bintang. Dia pernah menjawab pertanyaan para pendeta yang bertanya kepadanya; \"Pada suatu malam ketika saya mengamati perjalanan bintang-bintang, saya melihat raja Khitan telah lahir, siapakah di antara ummat ini yang di khitan?\" Jawab para pendeta; \"Yang berkhitan hanyalah orang-orang Yahudi, janganlah anda risau karena orang-orang Yahudi itu. Perintahkan saja keseluruh negeri dalam kerajaan anda, supaya orang-orang Yahudi di negeri tersebut di bunuh.\" <br><br>Ketika itu di hadapakan kepada Heraclius seorang utusan raja Bani Ghasssan untuk menceritakan perihal Rasulullah shallallahu \'alaihi wasallam, setelah orang itu selesai bercerita, lalu Heraclius memerintahkan agar dia diperiksa, apakah dia berkhitan ataukah tidak. Seusai di periksa, ternyata memang dia berkhitam. Lalu di beritahukan orang kepada Heraclius. Heraclius bertanya kepada orang tersebut tentang orang-orang Arab yang lainnya, di khitankah mereka ataukah tidak?\" Dia menjawab; \"Orang Arab itu di khitan semuanya.\" Heraclius berkata; \'inilah raja ummat, sesungguhnya dia telah terlahir.\" Kemudian heraclisu berkirim surat kepada seorang sahabatnya di Roma yang ilmunya setaraf dengan Heraclisu (untuk menceritakan perihal kelahiran Nabi Muhammad shallallahu \'alaihi wasallam). Sementara itu, ia meneruskan perjalanannya ke negeri Himsha, tetapi sebelum tiba di Himsha, balasan surat dari sahabatnya itu telah tiba terlebih dahulu. Sahabatnya itu menyetujui pendapat Heraclius bahwa Muhammad telah lahir dan bahwa beliau memang seorang Nabi. Heraclius lalu mengundang para pembesar Roma supaya datang ke tempatnya di Himsha, setelah semuanya hadir dalam majlisnya, Heraclius memerintahkan supaya mengunci semua pintu. Kemudian dia berkata; \'Wahai bangsa rum, maukah anda semua beroleh kemenangan dan kemajuan yang gilang gemilang, sedangkan kerajaan tetap utuh di tangan kita? Kalau mau, akuilah Muhammad sebagai Nabi!.\" <br><br>Mendengar ucapan itu, mereka lari bagaikan keledai liar, padahal semua pintu telah terkunci. Melihat keadaan yang demikian, Heraclius jadi putus harapan yang mereka akan beriman (percaya kepada kenabian Muhammad). Lalu di perintahkannya semuanya untuk kembali ke tempatnya masing-masing seraya berkata; \"Sesungguhnya saya mengucapkan perkataan saya tadi hanyalah sekedar menguji keteguhan hati anda semua. Kini saya telah melihat keteguhan itu.\" Lalu mereka sujud di hadapan Heraclius dan mereka senang kepadanya. Demikianlah akhir kisah Heraclius. Telah di riwayatkan oleh Shalih bin Kaisan dan Yunus dan Ma\'mar dari Az Zuhri.”',NULL,NULL),
(8,8,'Kitab Iman ','Sabda Nabi shallallahu ‘alaihi wasallam : “Islam itu didirikan atas Lima Perkara.”','Dari Ibnu Umar rhadiyallahu \'anhu, ia berkata, \'Rasulullah shallallahu \'alaihi wasallam bersabda, \'Islam itu didirikan atas lima perkara; bersaksi baha tiada Tuhan selain Allah dan Muhammad adalah utusan Allah, mendirikan shalat, menunaikan zakat menunaikan ibadah haji, dan berpuasa di bulan Ramadhan. ',NULL,NULL),
(9,9,'Kitab Iman ','Perkara-Perkara Iman','Dari Abu Hurairah rhadiyallahu \'anhu dari Nabi shallahu \'alaihi wasallam berabda, \'Iman itu ada enam puluh cabangnya, dan malu adalah salah satu cabang dari iman.”',NULL,NULL),
(10,10,'Kitab Iman ','Orang Islam adalah Orang yang Oranf Islam Lainnya Selamat dari Lisan dan Tangannya.  ','Dari Abdullah bin Amr rhadiyallahu \'anhu, dari Nabi shallahu \'alaihi wasallam berabda, “Orang Islam itu adalah orang yang orang-orang Islam lainnya selamat dari ucapan lidah dan perbuatan tangannya, dan seorang muhajir adalah orang yang berhijrah  meninggalkan apa yang dilarang oleh Allah.”',NULL,NULL),
(11,11,'Kitab Iman ','Islam Seperti Apakah yang Paling Utama   ','Dari Abu Musa rhadiyallahu \'anhu, ia berkata, “Mereka (para sahabat) bertanya, \'Wahai Rasulullah, Islam seperti apakah yang lebih utama?’ Beliau menjawab, \'Yaitu orang yang yang orang-orang Islam lainnya selamat dari ucapan lidah dan perbuatan tangannya.”',NULL,NULL),
(12,12,'Kitab Iman ','Memberi Makan Orang Lain Termasuk Ajaran Islam ','Dari Abdullah bin Amr rhadiyallahu \'anhu bahwasanya ada seorang laki-laki bertanya Rasulullah shallallahu \'alaihi wasallam bersabda, “Islam seperti apakah yang lebih baik? Beliau menjawab, “Yaitu memberikan makanan kepada orang lain dan mengucapkan salam baik kepada orang yang kamu kenal maupun yang tidak kamu kenal.”',NULL,NULL),
(13,13,'Kitab Iman ','Termasuk Iman; Apabila Seseorang Mencintai Saudaranya Sebagaimana Ia Mencintai dirinya sendiri ','Dari Anas dari Nabi shallallahu \'alaihi wasallam, beliau bersabda, “Tidaklah sempurna keimanan seseorang di antara kamu sehingga ia mencintai saudaranya sebagaimana ia mencintai dirinya sendiri.”',NULL,NULL),
(14,14,'Kitab Iman ','Mencintai Rasulullah adalah Bafian dari Iman ','Dari Abu Hurairah rhadiyallhu \'anhu bahwasanya Rasulullah shallallahu \'alaihi wasallam bersabda, “Demi Dzat yang jiwaku berada dalam genggamannya, tidaklah beriman seseorang diantara kamu sehingga aku lebih ia cintai daripada orang tua dan anaknya.”',NULL,NULL),
(15,15,'Kitab Iman ','Mencintai Rasulullah adalah Bafian dari Iman ','Dari Anas, ia berkata, “Nabi shallallahu \'alaihi wasallam pernah bersabda, “ Tidaklah beriman seseorang di antara kamu sehingga aku lebih dicintainya dari pada orang tuanya, anaknya, dan seluruh manusia. ',NULL,NULL),
(16,16,'Kitab Iman ','Manisnya Iman','Dari Anas bin Malik rhadiyallahu \'anhu, dari Nabi shallallahu \'alaihi wasallam Beliau bersabda, “Ada tiga hal  apabila ada pada diri seseorang, ia akan mendapatkan manisnya iman, yaitu hendaknya Allah dan Rasul-Nya lebih dicintainya dari pada selain keduanya. Jika ia mencintai seseorang, dia tidak mencintainya kecuali karena Allah. Dan dia benci kembali kepada kekufuran seperti dia benci bila dilempar ke neraka\"',NULL,NULL),
(17,17,'Kitab Iman ','Mencintai Kaum Anshar Merupakan Salah Satu Tanda Keimanan ','Dari Abdullah bin Abdullah bin Jabr, ia berkata; Aku mendengar Anas dari Nabi shallallahu \'alaihi wasallam, beliau bersabda: \"Tanda keimanan adalah mencintai (kaum) Anshar, dan tanda munafik adalah membenci (kaum) Anshar\".',NULL,NULL),
(18,18,'Kitab Iman ','Mencintai Kaum Anshar Merupakan Salah Satu Tanda Keimanan ','Dari Ubadah bin ash-Shamit rhadiyallahu \'anhu adalah sahabat yang ikut perang Badar dan juga salah seorang yang ikut bersumpah pada malam Aqobah, dia berkata; bahwa Rasulullah shallallahu \'alaihi wasallam bersabda ketika berada ditengah-tengah sebagian sahabat: \"Berbai\'atlah kalian kepadaku untuk tidak menyekutukan Allah dengan sesuatu apapun. Janganlah kamu mencuri, janganlah kamu berzina, dan janganlah kamu membunuh anak-anakmu, dan jangan kamu bawa kebohongan yang kamu buat-buat  antara tangan dan kakimu, dan janganlah kalian durhaka dalam hal kebaikan. Barangsiapa diantara kalian yang menepatinya maka pahalanya akan diberikan oleh Allah. Dan barangsiapa yang melanggar sesuatu dari semua itu kemudian Allah menutupinya (tidak menghukumnya di dunia) maka itu terserah kepada Allah. Jika Dia menghendaki, maka Dia akan mema’afkannya. Dan jika Dia menghendaki pula, maka Dia akan menghukumnya.” Maka kami berbaiat kepadanya atas hal-hal itu.  ',NULL,NULL),
(19,19,'Kitab Iman ','Termasuk dari Ajaran Agama adalah Menghindarkan Diri dari Fitnag ','Dari Abu Sa\'id al-Khudri rhadiyallahu \'anhu bahwasanya ia berkata, Rasulullah shallallahu \'alaihi wasallam bersabda: \"Akan datang suatu masa, dimana  sebaik-baik harta seorang muslim adalah kambing yang digembalakannya di puncak-puncak bukit dan di lembah-lembah. Ia menyendiri untuk menjaga agamanya dari bencana fitnah.”',NULL,NULL),
(20,20,'Kitab Iman ','Sabda Nabi, Aku Orang yang Paling Tahu Di antara Kalian Tentang Allah,” dan Bahwa Ma’rifat adalah Perbuatan Hati ','Dari Aisyah, ia berkata: \"Rasulullah shallallahu \'alaihi wasallam bila memerintahkan kepada para sahabat, Beliau memerintahkan untuk melakukan amalan yang mampu mereka kerjakan, kemudian para sahabat berkata; \"Kami tidaklah seperti engkau, ya Rasulullah, karena engkau sudah diampuni dosa-dosa yang lalu dan yang akan datang\". Maka Beliau shallallahu \'alaihi wasallam menjadi marah yang dapat terlihat dari wajahnya, kemudian bersabda: \"Sesungguhnya yang paling taqwa dan paling mengerti tentang Allah diantara kalian adalah aku\".',NULL,NULL),
(21,21,'Kitab Iman ','Termasuk dari Iman Orang yang Tidak Mau Kembali kepada Kekufuran Sebagaimana Ia Tidak Mau Dilemparkan ke Dalam Api Neraka ','Dari Anas bin Malik rhadiyallahu \'anhu dari Nabi shallallahu \'alaihi wasallam, beliau bersabda: \"Ada tiga hal yang apabila ada pada diri seseorang, ia akan mendapatkan manisnya iman; yaitu orang yang menjadikan Allah dan Rasul-Nya lebih dicintai olehnya daripada selain keduanya, orang yang mencintai seseorang hamba hanya karena Allah semata, dan orang yang tidak mau untuk kembali lagi kepada kekafiran setelah Alllah memberikan hidayah kepadanya, sebagaimana ia tidak mau dilemparkan kedalam api neraka.”',NULL,NULL),
(22,22,'Kitab Iman ','Keutamaan Orang yang Memiliki Keimanan dalam Hal Amal Perbuatan','Dari Abu Sa\'id Al Khudri rhadiyallahu \'anhu dari Nabi shallallahu \'alaihi wasallam, beliau bersabda: \"Penghuni surga akan masuk surga, dan penghuni neraka akan masuk neraka. Kemudian Allah Ta\'ala berfirman: \"Keluarkan dari neraka orang yang didalam hatinya terdapat iman seberat biji sawi\". Lalu mereka dikeluarkan dari neraka dalam kondisi hitam (hangus), kemudian mereka dilemparkan kedalam sungai kehidupan. Setelah itu mereka tumbuh kembali sebagaimana tumbuhnya biji yang selalu disiram dengan air, bukankah biji itu tumbuh keluar dengan warna kuning berlipat-lipat.” Wuhaib berkata, “Telah bercerita kepada kami Amr, \'Al-hayah (kehidupan).” Dan ia berkata, “Kebaikan seberat biji sawi.”',NULL,NULL),
(23,23,'Kitab Iman ','Keutamaan Orang yang Memiliki Keimanan dalam Hal Amal Perbuatan','Dari Abu Umamah bin Sahal bin Hunaif bahwasanya dia mendengar Abu Said Al Khudri berkata, Rasulullah shallallahu \'alaihi wasallam bersabda: \"Ketika aku tidur, aku bermimpi melihat orang-orang dihadapkan kepadaku. Mereka mengenakan baju, diantaranya ada yang sampai dada dan ada yang dibawahnya. Umar bin Khaththab diperlihatkan juga kepadaku dalam keadaan ia memakai baju yang ditariknya. Para sahabat bertanya: \"Apa maksudnya hal demikian menurut engkau, ya Rasulullah?\" Beliau shallallahu \'alaihi wasallam menjawab: \"Agama \".',NULL,NULL),
(24,24,'Kitab Iman ','Malu Merupakan Bagian dari Iman ','Dari Salim bin Abdullah dari ayahnya bahwa Rasulullah shallallahu \'alaihi wasallam lewat di hadapan seorang laki-laki dari kalangan Anshar yang saat itu sedang menasehati saudaranya dari sifat malu. Maka Rasulullah shallallahu \'alaihi wasallam berkata: “Biarkanlah dia, karena sesungguhnya malu adalah sebagian dari iman.”',NULL,NULL),
(25,25,'Kitab Iman ','Firman Allah, “Jika Mereka Bertaubat dan Mendirikan Shalat Serta Menunaikan Zakat, Maka Berilah Kebebasan Kepada Mereka untuk Berjalan.  ','Dari Ibnu Umar, bahwa Rasulullah shallallahu \'alaihi wasallam telah bersabda: \"Aku diperintahkan untuk memerangi manusia hingga mereka bersaksi;tiada Tuhan selain Allah dan bahwa Muhammad adalah utusan Allah, mendirikan shalat, menunaikan zakat. Jika mereka lakukan itu semua,  maka terpeliharalah dari padaku darah dan harta-harta mereka kecuali dengan hak Islam dan hisab mereka diserahkan kepada Allah.”',NULL,NULL),
(26,26,'Kitab Iman ','Orang yang Mengatakan Bahwa Keimanan adalah Amal Perbuatan ','Dari Abu Hurairah  rhadiyallahu \'anhu, bahwa Rasulullah  shallallahu \'alaihi wasallam ditanya, “Amal apakah yang paling utama? Beliau menjawab: \"Iman kepada Allah dan Rasul-Nya\". Beliau ditanya lagi: \"Kemudian apa lagi?\" Beliau menjawab: \"Jihad di jalan Allah.” Beliau ditanya lagi: \"Kemudian apa lagi?\" Beliau menjawab : “Haji yang mambrur”.',NULL,NULL),
(27,27,'Kitab Iman ','Jika Masuk Islam Tidak Sebenar-benarnya, Melainkan Hanya Karena Ingin Selamat atau Takut Dibunuh. ','Dari Sa’ad (bin Abi Waqqash)  rhadiyallahu \'anhu bahwa Rasulullah shallallahu \'alaihi wasallam memberikan sesuatu kepada sekelompok orang, Sa\'ad ketika itu sedang duduk. Kemudian Rasulullah shallallahu \'alaihi wasallam tidak memberi makanan tersebut kepada seorang laki-laki, padahal orang tersebut yang paling berhak diberi menurutku. Maka aku bertanya : \"Wahai Rasulullah, ada apakah antara dirimu dengan si fulan? Demi Allah aku melihat dia sebagai seorang mu\'min.\" Beliau menjawab, “Bahkan ia seorang muslim”. Kemudian apa yang aku ketahui dari beliau itu mengalahkanku. Lalu Nabi shallallahu \'alaihi wasallam mengulangi kembali ucapannya kemudian beliau berkata, \"Wahai Sa\'ad, sesungguhnya aku juga akan memberikan kepada orang itu, namun orang lain lebih aku suka dari padanya, karena aku khawatir ia akan dicampakkan oleh Allah ke dalam api neraka.\"',NULL,NULL),
(28,28,'Kitab Iman ','Menyebarkan Salam adalah Bagian dari Islam ','Dari Abdullah bin \'Amr bahwasanya seorang laki-laki bertanya kepada Rasulullah shallallahu \'alaihi wasallam; \"Islam yang bagaimanakah yang paling baik?\" Beliau menjawab: \"Kamu memberi makan orang lain, mengucapkan  salam kepada orang yang kamu kenal maupun orang yang tidak kamu kenal\".',NULL,NULL),
(29,29,'Kitab Iman ','Ingkar Terhadap Suami dan Kekufuran di Bawah Kekufuran ','Dari Ibnu \'Abbas ia berkata, Nabi shallallahu \'alaihi wasallam bersabda: \"Aku telah diperlihatkan neraka, ternyata kebanyakan penghuninya adalah wanita, disebabkan karena mereka ingkar. \'Dikatakan: \"Apakah mereka ingkar kepada  Allah?\" Beliau bersabda: \"Mereka ingkarterhadap suami, dan ingkar terhadap kebaikan. Jika kamu berbuat kebaikan terhadap seseorang dari mereka sepanjang masa, lalu dia melihat satu saja kejelekan darimu maka dia akan berkata: \'aku belum pernah melihat kebaikan sedikitpun darimu\".',NULL,NULL),
(30,30,'Kitab Iman ','Kemaksiatan-Kemaksiatan Adalah Perkara Jahiliyah ','Dari  Ma\'rur ia berkata: “Aku bertemu Abu Dzar di Rabadzah. Ia dan budaknya memakai pakaian yang serupa. Maka bertanya kepadanya tentang hal itu (kenapa mereka memakai pakaian yang serupa?’. Ia menjawab, \'Aku pernah memaki seseorang dengan mencela ibunya. Maka kemudian Nabi shallallahu \'alaihi wasallam bersabda, Wahai Abu Dzar apakah kamu menghina ibunya? Sesungguhnya kamu berpikiran seperti orang-orang jahiliyyah. Budakmu itu adalah saudaramu, atau pamanmu, yang dititipkan Allah dalam tanggung jawabmu. Maka barangsiapa yang mempunyai saudara yang menjadi tanggung jawabny, maka hendaklah ia memberinya makan seperti yang dimakannya, dan memberi pakaian seperti apa yang dipakainya. Dan janganlah membebani mereka dengan pekerjaan diluar batas kemampuan mereka. Namun, jika mereka terpaksa harus mengerjakannya juga, maka bantulah mereka.”',NULL,NULL),
(31,31,'Kitab Iman ','Firman Allah : Apabila Dua Golongan dari Kaum Mukminin Saling Berperang, Maka Damaikanlaj Antara Keduanya itu. ','Dari Ahnaf bin Qais ia berkata, “Aku pergi untuk menolong orang ini. Kemudian aku bertemu Abu Bakrah, lau ia bertanya: \'Mau kemana kamu?’ Aku menjawab, \'Aku mau menolong orang ini”. Ia berkata: \'Kembalilah! Sesungguhnya aku  mendengar Rasulullah shallallahu \'alaihi wasallam bersabda: \"Jika dua orang muslim saling bertemu dengan kedua belah pedangnya, maka orang yang membunuh dan yang terbunuh kedua-duanya akan masuk neraka\". Lalu aku pun bertany kepada Rasullullah shallalllahu \'alaihi wasalmmam: \'Wahai Rasulullah, benar kalau orang yang membunuh, lalu kenapa orang yang dibunuh juga?’ Beliau menjawab: \'Karena sesungguhnya ia berkeinginan untuk membunuh sahabatnya itu’.”',NULL,NULL),
(32,32,'Kitab Iman ','Kezhaliman dibawah kezhaliman ','Dari Abdullah bin Mas’ud, ia berkata: “Ketika turun ayat: \'Orang-orang beriman dan tidak mencampur adukkan iman mereka dengan kezhaliman’. (QS al-An’aam : 82). Para sahabat Rasulullah shallallahu \'alaihi wasallam berkata: \"Siapakah diantara kami yang tidak menzhalimi dirinya benar-benar kezhaliman yang besar.” (QS. Luqman: 13)',NULL,NULL),
(33,33,'Kitab Iman ','Tanda-Tanda Orang Munafik ','Dari Abu Hurairah  rhadiyallahu \'anhu dari Nabi shallallahu \'alaihi wasallam, beliau bersabda: \"Tanda-tanda orang yang munafik itu ada tiga; apabila berkata ia dusta, apabila berjanji ia mengingkarinya, dan apabila dipercaya ia berkhianat\".',NULL,NULL),
(34,34,'Kitab Iman ','Tanda-Tanda Orang Munafik ','Dari Abdullah bin \'Amr bahwasanya Nabi shallallahu \'alaihi wasallam bersabda: \"Ada empat sifat apabila keempatnya ada pada diri seseorang maka dia adalah seorang munafik sejati. Dan apabila terdapat pada dirinya hanya salah satu dari sifat-sifat itu maka pada dirinya itu ada salah satu sifat munafik, sampai ia bisa meninggalkannya. Yaitu, jika dipercaya ia berkhianat, jika berkata ia berdusta, jika berjanji ia menipu, dan jika bertengkar ia berbuat curang\".',NULL,NULL),
(35,35,'Kitab Iman ','Mendirikan Shalat Malam pada Malam Lailatul Qadar Merupakan Sebagian dari Iman ','Dari Abu Hurairah rhadiyallahu \'anhu ia berkata, “Rasulullah shallallahu \'alaihi wasallam bersabda: \'Barangsiapa yang mendirikan shalat malam pada malam Lailatul Qadar dengan penuh keimanan dan mengharap pahala, maka diampuni dosa-dosanya yang telah lalu\".',NULL,NULL),
(36,36,'Kitab Iman ','Berjihad Adalah Sebagian dari Iman ','(Dari) Abu Zur\'ah bin \'Amr bin Jarir, dia berkata: \'Aku mendengar Abu Hurairah dari Nabi shallallahu \'alaihi wasallam, beliau bersabda: \"Allah menjamin orang yang pergi untuk berjihad dijalanNya,  yang tidak ada sesuatupun yang membuatnya pergi kecuali karena iman kepada-Ku (Allah) dan membenarkan para rasul-rasulKu. Aku memulangkannya dengan pahala atau harta rampasan (ghonimah), atau Aku memasukkannya ke dalam surga. Seandainya saja aku (Rasulullah) tidak memberatkan umatku, tentu aku tidak akan duduk tinggal diam di belakang sariyyah (pasukan khusus). Padahal aku sungguh ingin sekali terbunuh di jalan Allah, kemudian aku dihidupkan lagi, kemudian terbunuh lagi, kemudian aku dihidupkanlagi, lalu terbunuh lagi\"',NULL,NULL),
(37,37,'Kitab Iman ','Mengerjakan Shalat Sunnah Malam pada Bulan Ramadhan adalah Merupakan Bagian dari Iman ','Dari Abu Hurairah rhadiyallahu \'anhu bahwasanya Rasulullah shallallahu \'alaihi wasallam bersabda: \"Barangsiapa yang mengerjakan shalat malam pada Bulan Ramadlan karena iman dan mengharap pahala, maka diampuni dosa-dosanya yang telah lalu\".',NULL,NULL),
(38,38,'Kitab Iman ','Berpuasa pada Bulan Ramadhan Karena Mengharap Keridhoan Allah Merupakan Bagian dari Iman ','Dari Abu Hurairah rhadiyallahu \'anhu ia berkata; Rasulullah shallallahu \'alaihi wasallam bersabda: \"Barangsiapa yang berpuasa pada Bulan Ramadhan dengan penuh keimanan dan mengharap pahala, maka diampuni dosa-dosanya yang telah lalu\".',NULL,NULL),
(39,39,'Kitab Iman ','Agama Itu adalah Mudah ','Dari Abu Hurairah  rhadiyallahu \'anhu dari Nabi shallallahu \'alaihi wasallam beliau bersabda: \"Sesungguhnya agama itu mudah, dan tidak akan ada seseorang memberat-beratkan diri dalam beragama kecuali ia akan mengalahkannya (semakin berat dan sulit). Maka berlaku benar dan bersahajalah, sampaikan kabar gembira, mintalah pertolongan di pagi dan sore hari, serta sesaat ketika menjelang shubuh (di akhir malam).”',NULL,NULL),
(40,40,'Kitab Iman ','Mengerjakan Shalat Merupakan Bagian dari Iman ','Dari Al Barra` bin \'Azib bahwasanya Nabi shallallahu \'alaihi wasallam saat pertama kali datang di Madinah, singgah pada kakek-kakeknya atau paman-pamannya dari Kaum Anshar, dan saat itu Beliau shallallahu \'alaihi wasallam shalat menghadap Baitul Maqdis selama enam belas bulan atau tujuh belas bulan, dan Beliau sangat senang sekali kalau shalat menghadap Baitullah (Ka\'bah). Shalat yang dilakukan Beliau shallallahu \'alaihi wasallam pertama kali (menghadap Ka\'bah) itu adalah shalat \'ashar dan orang-orang juga ikut shalat bersama Beliau. Pada suatu hari sahabat yang ikut shalat bersama Nabi shallallahu \'alaihi wasallam pergi melewati orang-orang di Masjid lain saat mereka sedang ruku\', maka dia berkata: \"Aku bersaksi kepada Allah bahwa aku ikut shalat bersama Rasulullah shallallahu \'alaihi wasallam menghadap Makkah, maka orang-orang yang sedang (ruku\') tersebut berputar menghadap Baitullah dan orang-orang Yahudi dan Ahlul Kitab menjadi heran, sebab sebelumnya Nabi<br>shallallahu \'alaihi wasallam shalat menghadap Baitul Maqdis. Ketika melihat Nabi shallallahu \'alaihi wasallam menghadapkan wajahnya ke Baitullah mereka mengingkari hal ini. Berkata Zuhair Telah menceritakan kepada kami Abu Ishaq dari Al Barro`, dalam haditsnya ini menerangkan tentang (hukum) seseorang yang meninggal dunia pada saat arah qiblat belum dialihkan dan juga banyak orang-orang yang terbunuh pada masa itu?, kami tidak tahu apa yang harus kami sikapi tentang mereka hingga akhirnya Allah Ta\'ala menurunkan firman- Nya: \"Dan Allah tidaklah akan menyia-nyiakan iman kalian\". (QS. Al-Baqarah: 143)',NULL,NULL),
(41,41,'Kitab Iman ','Sebaik-baiknya Keislaman Seseorang','Dari Malik berkata, “Telah mengabarkan kepadaku Zaid bin Aslam bahwa Atha’ bin Yasar memberitahunya dari Abu Sa’id al-Khudri bahwa ia mendengar Rasulullah shallallahi \'alaihi wasallam bersabda, “Apabila seorang hamba masuk Islam lalu baik keislamannya, maka Allah akan menghapuskan darinya segala keburukan yang telah diperbuatnya pada masa lalu. Setelah itu baru akan diberlakukan hukum pembalasan (qishash), yaitu satu kebaikan dibalas dengan sepuluh kebaiakan yang setimpal hingga tujuh ratus kali lipat, sedangkan satu keburukan hanya dibalas dengan yang setimpal dengan keburukan itu, kecuali Allah menghapusnya.”',NULL,NULL),
(42,42,'Kitab Iman ','Sebaik-baiknya Keislaman Seseorang','Dari Abu Hurairah, ia berkata, Rasulullah shallallahu \'alaihi wasallam bersabda: \"Apabila seorang dari kalian baik keIslamannya maka setiap kebaikan akan ditulis baginya sepuluh (kebaikan) yang serupa hingga tujuh ratus kali lipat, dan setiap keburukan yang diperbuatnya maka akan dicatat sama dengan keburukan itu (satu kali saja).”',NULL,NULL),
(43,43,'Kitab Iman ','Amalan Agama yang Paling Dicintai Allah ','Dari Aisyah bahwa Nabi shallallahu \'alaihi wasallam mendatanginya dan bersamanya ada seorang wanita lain, lalu Nabi shallallahu \'alaihi wasallam bertanya: \"siapa ini?\" Aisyah menjawab: \"si fulanah\", Lalu diceritakan tentang shalatnya. Maka Nabi shallallahu \'alaihi wasallam bersabda: \"Cukup lakukan kebaikan sesuai dengan kemampuan kalian. Demi Allah, Allah tidak akan bosan hingga kalian sendiri yang menjadi bosan. Dan amalan yang paling disukai olehNya adalah apa yang senantiasa dikerjakan secara terus menerus oleh pelakunya\".',NULL,NULL),
(44,44,'Kitab Iman ','Bertambah dan Berkurangnya Keimanan Seseorang ','Dari  Anas dari Nabi shallallahu \'alaihi wasallam, beliau bersabda: \"Akan dikeluarkan dari neraka siapa yang mengatakan tidak ada Ilah kecuali Allah dan dalam hatinya ada kebaikan sebesar jemawut. Dan akan dikeluarkan dari neraka siapa yang mengatakan tidak ada ilah kecuali Allah dan dalam hatinya ada kebaikan sebesar biji gandum. Dan akan dikeluarkan dari neraka siapa yang mengatakan tidak ada ilah kecuali Allah dan dalam hatinya ada kebaikan sebesar biji sawi.”',NULL,NULL),
(45,45,'Kitab Iman ','Bertambah dan Berkurangnya Keimanan Seseorang ','Dari Umar bin Khaththab bahwasanya seorang laki-laki Yahudi berkata kepadanya: \"Wahai Amirul Mu\'minin, ada satu ayat dalam kitab kalian yang kalian baca, seandainya ayat itu diturunkan kepada kami Kaum Yahudi, tentulah kami jadikan (hari diturunkannya ayat itu) sebagai hari raya (\'ied). Maka Umar bin Khaththab berkata: \"Ayat apakah itu?\" (Orang Yahudi itu) berkata: \"Pada hari ini telah Kusempurnakan untuk kalian agama kalian, dan telah Ku-cukupkan kepada kalian nikmat-Ku, dan telah Kuridhai Islam itu jadi agama bagi kalian\". (QS. Al Maidah ayat 3). Maka Umar bin Khaththab menjawab: \"Kami tahu hari tersebut dan dimana tempat diturunkannya ayat tersebut kepada Nabi shallallahu \'alaihi wasallam, yaitu pada hari Jum\'at ketika Beliau shallallahu \'alaihi wasallam berada di \'Arafah.',NULL,NULL),
(46,46,'Kitab Iman ','Membayar Zakat Merupakan Bagian dari Islam ','Dari Thalhah bin \'Ubaidullah berkata: Telah datang kepada Rasulullah shallallahu \'alaihi wasallam seorang dari penduduk Najed dalam keadaan kepalanya penuh debu dengan suaranya yang keras terdengar, namun tidak dapat dimengerti apa maksud yang diucapkannya, hingga mendekat (kepada Nabi shallallahu \'alaihi wasallam) kemudian dia bertanya tentang Islam, maka Rasulullah shallallahu \'alaihi wasallam menjawab: \"Shalat lima kali dalam sehari semalam\". Kata orang itu: \"apakah ada lagi selainnya buatku\". Nabi shallallahu \'alaihi wasallam menjawab: \"Tidak ada kecuali yang thathawu\' (sunnat) \". Rasulullah shallallahu \'alaihi wasallam berkata: \"Dan puasa Ramadlan\". Orang itu bertanya lagi: \"Apakah ada lagi selainnya buatku\". Rasulullah shallallahu \'alaihi wasallam menjawab: \"Tidak ada kecuali yang thathawu\' (sunnat) \". Lalu Rasulullah shallallahu \'alaihi wasallam menyebut: \"Zakat\": Kata orang itu: \"apakah ada lagi selainnya buatku\". Rasulullah shallallahu \'alaihi wasallam menjawab: \"Tidak ada kecuali yang thathawu\' (sunnat) \". Thalhah bin \'Ubaidullah berkata: Lalu orang itu pergi sambil berkata: \"Demi Allah, aku tidak akan menambah atau menguranginya\". Maka Rasulullah shallallahu \'alaihi wasallam bersabda: \"Dia akan beruntung jika jujur menepatinya\".',NULL,NULL),
(47,47,'Kitab Iman ','Mengiringi Jenazah adalah Merupakan Bagian dari Iman  ','Dari Abu Hurairah, bahwa Rasulullah shallallahu \'alaihi wasallam telah bersabda: \"Barangsiapa mengiringi jenazah muslim, karena iman dan mengharapkan balasan dan dia selalu bersama jenazah tersebut sampai dishalatkan dan selesai dari penguburannya, maka dia pulang dengan membawa dua qiroth, setiap qiroth setara dengan gunung Uhud. Dan barangsiapa menyolatkannya dan pulang sebelum dikuburkan maka dia pulang membawa satu qiroth\".',NULL,NULL),
(48,48,'Kitab Iman ','Kekhawatiran Seorang Mukmin Jika Tanpa Disadari Amalnya Terputus. ','Dari Zubaid ia  berkata: Aku bertanya kepada Abu Wail tentang golongan Murji`ah, maka ia berkata: Abdullah telah menceritakan kepadaku bahwa Nabi shallallahu \'alaihi wasallam bersabda: \"Mencaci maki orang muslim adalah fasik dan memeranginya adalah kafir\".',NULL,NULL),
(49,49,'Kitab Iman ','Kekhawatiran Seorang Mukmin Jika Tanpa Disadari Amalnya Terputus. ','Dari Humaid, Telah menceritakan kepadaku Anas bin Malik berkata, telah mengabarkan kepadaku \'Ubadah bin Ash Shamit, bahwa Rasulullah shallallahu \'alaihi wasallam keluar untuk menjelaskan tentang Lailatul Qodar, lalu ada dua orang muslimin saling berdebat. Maka Nabi shallallahu \'alaihi wasallam bersabda: \"Aku datang untuk menjelaskan Lailatul Qodar kepada kalian, namun aku melihat si fulan dan si fulan sedang berbantah-bantahan, sehingga aku menjadi lupa. Namun, mudah-mudahan kelupaan itu dapat menjadi kebaikan untuk kalian. Carilah malam Lailatul Qadar itu pada malam ketujuh, kesembilan dan malam kelima. ',NULL,NULL),
(50,50,'Kitab Iman ','Pertanyaan Malaikat Jibril kepada Nabi tentang Iman, Islam dan Ihsan ','Dari Abu Hurairah berkata; bahwa Nabi shallallahu \'alaihi wasallam pada suatu hari muncul kepada para sahabat, lalu datang Malaikat Jibril \'Alaihis Salam yang kemudian bertanya: \"Apakah iman itu?\" Nabi shallallahu \'alaihi wasallam menjawab: \"Iman adalah kamu beriman kepada Allah, malaikat-malaikat-Nya, kitab-kitab-Nya, pertemuan dengan-Nya, Rasul-Rasul- Nya, dan kamu beriman kepada hari berbangkit\". (Jibril \'Alaihis salam) berkata: \"Apakah Islam itu?\" Jawab Nabi shallallahu \'alaihi wasallam: \"Islam adalah kamu menyembah Allah dan tidak menyekutukannya dengan suatu apapun, kamu dirikan shalat, kamu tunaikan zakat yang diwajibkan, dan berpuasa di bulan Ramadlan\". (Jibril \'Alaihis salam) berkata: \"Apakah ihsan itu?\" Nabi shallallahu \'alaihi wasallam menjawab: \"Kamu menyembah Allah seolah-olah melihat-Nya dan bila kamu tidak melihat-Nya sesungguhnya Dia melihatmu\". (Jibril \'Alaihis salam) berkata lagi: \"Kapan terjadinya hari kiamat?\" Nabi shallallahu \'alaihi wasallam menjawab: \"Yang ditanya tentang itu tidak lebih tahu dari yang bertanya. Tapi aku akan terangkan tanda-tandanya; (yaitu); jika seorang budak telah melahirkan tuannya, jika para penggembala unta yang berkulit hitam berlomba-lomba membangun gedung-gedung selama lima masa, yang tidak diketahui lamanya kecuali oleh Allah\". Kemudian Nabi shallallahu \'alaihi wasallam membaca: \"Sesungguhnya hanya pada Allah pengetahuan tentang hari kiamat\" (QS. Luqman: 34). Setelah itu Jibril \'Alaihis salam pergi, kemudian Nabi shallallahu \'alaihi wasallam berkata; \"hadapkan dia ke sini.\" Tetapi para sahabat tidak melihat sesuatupun, maka Nabi bersabda; \"Dia adalah Malaikat Jibril datang kepada manusia untuk mengajarkan agama mereka.\" Abu Abdullah berkata: \"Semua hal yang diterangkan Beliau shallallahu \'alaihi wasallam dijadikan sebagai iman.',NULL,NULL),
(51,51,'Kitab Iman ','Pertanyaan Malaikat Jibril kepada Nabi tentang Iman, Islam dan Ihsan ','Dari Abdullah bin \'Abbas mengabarkan kepadanya, bahwa dia berkata; telah mengabarkan kepadaku Abu Sufyan bahwa Heraklius berkata kepadanya: \"Aku sudah bertanya kepadamu, apakah jumlah mereka bertambah atau berkurang? Maka kamu bertutur bahwa mereka bertambah, dan memang begitulah iman akan terus berkembang hingga sempurna. Dan aku bertanya kepadamu, apakah ada orang yang murtad karena dongkol pada agamanya? Kemudian kamu bertutur; tidak ada, maka begitu juga iman bila sudah tumbuh bersemi dalam hati tidak akan ada seorang pun yang membencinya.”',NULL,NULL),
(52,52,'Kitab Iman ','Keutamaan Orang yang Mensucikan Agamanya','Dari \'Amir berkata; aku mendengar An Nu\'man bin Basyir berkata; aku mendengar Rasulullah shallallahu \'alaihi wasallam bersabda: \"Yang halal sudah jelas dan yang haram juga sudah jelas. Namun diantara keduanya ada perkara syubhat (samar) yang tidak diketahui oleh banyak orang. Maka barangsiapa yang menjauhi diri dari yang syubhat berarti telah memelihara agamanya dan kehormatannya. Dan barangsiapa yang sampai jatuh (mengerjakan) pada perkara-perkara syubhat, sungguh dia seperti seorang penggembala yang menggembalakan ternaknya di pinggir jurang yang dikhawatirkan akan jatuh ke dalamnya. Ketahuilah bahwa setiap raja memiliki batasan, dan ketahuilah bahwa batasan larangan Allah di bumi-Nya adalah apa-apa yang diharamkan-Nya. Dan ketahuilah pada setiap tubuh ada segumpal darah yang apabila baik maka baiklah tubuh tersebut dan apabila rusak maka rusaklah tubuh tersebut. Ketahuilah, dia itu adalah hati\".',NULL,NULL),
(53,53,'Kitab Iman ','Membagikan Seperlima dari (Harta Rampasan Perang) Merupakan Bagian dari Iman \n\n\n\n\n\n\n\n\n\n\n\n\n\n','Dari Abu Jamrah ia berkata: aku pernah duduk bersama Ibnu \'Abbas saat dia mempersilahkan aku duduk di permadaninya lalu berkata: \"Tinggallah bersamaku hingga aku memberimu bagian dari hartaku\". Maka aku tinggal mendampingi dia selama dua bulan, lalu berkata: Ketika utusan Abu Qais datang menemui Nabi shallallahu \'alaihi wasallam, Beliau bertanya kepada mereka: \"Kaum manakah ini atau utusan siapakah ini? Mereka menjawab: \"Rabi\'ah!\" Beliau shallallahu \'alaihi wasallam bersabda: \"selamat datang wahai para utusan dengan sukarela dan tanpa menyesal\". para utusan itu berkata: \"ya Rasulullah, kami tidak dapat mendatangimu kecuali di bulan suci, karena antara kami dan engkau ada suku Mudlor yang kafir. Oleh karena itu ajarkanlah kami dengan satu pelajaran yang jelas yang dapat kami amalkan dan dapat kami ajarkan kepada orang-orang di kampung kami, yang dengan begitu kami dapat masuk surga.\" kemudian mereka bertanya kepada Nabi shallallahu \'alaihi wasallam tentang minuman, maka Nabi shallallahu \'alaihi wasallam memerintahkan mereka dengan empat hal dan melarang dari empat hal, memerintahkan mereka untuk beriman kepada Allah satu-satunya, kemudian bertanya: \"Tahukah kalian apa arti beriman kepada Allah satu-satunya?\" Mereka menjawab: \"Allah dan Rasul-Nya yang lebih mengetahui.\" Nabi shallallahu \'alaihi wasallam menjelaskan: Persaksian tidak ada ilah kecuali Allah dan bahwa Muhammad adalah utusan Allah, menegakkan shalat, menunaikan zakat, berpuasa pada bulan Ramadlan dan mengeluarkan seperlima dari harta rampasan perang\". Dan Nabi shallallahu \'alaihi wasallam melarang mereka dari empat perkara, yaitu janganlah kalian meminum sesuatu dari hantam, dubba’`, naqier dan muqayyar. Atau Beliau shallallahu \'alaihi wasallam menyebut muzaffat. Lalu beliau melanjutkan: \"Hapalkan dan beritahukanlah kepada orang-orang di belakang kalian\".',NULL,NULL),
(54,54,'Kitab Iman ','Penjelaan Hadits yang Menyatakan Bahwa Amal Perbuatan itu Tergantung dengan Niat ','Dari Umar, bahwa Rasulullah shallallahu \'alaihi wasallam bersabda: \"Amal perbuatan tergantung niatnya, dan setiap orang tergantung dari apa uyang diniatkannya. Barangsiapa berhijrah kepada Allah dan Rasul-Nya, maka hijrahnya itu kepada Allah dan Rasul-Nya. Namun, barangsiapa berhijrah untuk mendapatkan dunia atau untuk seorang wanita yang dinikahinya, maka hijrahnya itu sesuai dengan yang diniatkannya.\"',NULL,NULL),
(55,55,'Kitab Iman ','Penjelaan Hadits yang Menyatakan Bahwa Amal Perbuatan itu Tergantung dengan Niat ','Dari Abu Mas\'ud dari Nabi shallallahu \'alaihi wasallam, beliau bersabda: \"Jika seorang laki-laki memberi nafkah untuk keluarganya dengan niat mengharap ridha Allah, maka baginya sedekah\".',NULL,NULL),
(56,56,'Kitab Iman ','Penjelaan Hadits yang Menyatakan Bahwa Amal Perbuatan itu Tergantung dengan Niat ','Dari Az Zuhri ia berkata: \'Amir bin Sa\'d telah menceritakan kepadaku dari Sa\'d bin Abu Waqqash bahwasanya dia mengabarkan, bahwa Rasulullah shallallahu \'alaihi wasallam bersabda: \"Sesungguhnya, tidaklah kamu memberikan nafkah dengan  mengharap ridha Allah, melainkan kamu akan diberi pahala karenanya,  meskipun nafkah itu berupa memberi mkaan-minum kepada isterimu\".',NULL,NULL),
(57,57,'Kitab Iman ','Sabda Nabi :”Agama itu adalah Nasehat (Berlaku Ikhlas) kepada Allah dan RasulNya.','Dari Jarir bin Abdullah berkata: \"Aku telah membai\'at Rasulullah untuk menegakkan shalat, menunaikan zakat dan menasehati kepada setiap muslim\".',NULL,NULL),
(58,58,'Kitab Iman ','Sabda Nabi :”Agama itu adalah Nasehat (Berlaku Ikhlas) kepada Allah dan RasulNya.','Dari Ziyad bin \'Alaqah berkata; “Aku mendengar Jarir bin Abdullah berkata ketika Al Mughirah bin Syu\'bah meninggal, sambil berdiri dia memuji Allah dan mensucikan- Nya, berkata: \"Wajib atas kalian bertakwa kepada Allah satu-satunya dan tidak menyekutukannya, dan dengan penuh ketundukan dan ketenangan sampai datang pemimpin pengganti, dan sekarang datang penggantinya, \" kemudian dia berkata: \"Mintakanlah maaf kepada Allah Subhanahu wa Ta\'ala buat pemimpin kalian ini (Al Mughirah), karena dia suka memberi maaf.\" Lalu berkata: \"Amma ba\'du, sesungguhnya aku mendatangi Nabi shallallahu \'alaihi wasallam kemudian aku berkata: \"Aku membai\'at engkau untuk Islam\". Lalu Nabi shallallahu \'alaihi wasallam memberi syarat dan menasehati kepada setiap muslim, maka aku membai\'at Beliau untuk perkara itu, dan demi Pemilik Masjid ini, sungguh aku akan selalu memberi nasihat kepada kalian\" Kemudian dia beristighfar, lalu ia duduk.',NULL,NULL),
(59,59,'Kitab Ilmu','Seseorang yang Ditanya tentang Ilmu, Namun Ia Masih Sibuk Berbicara. ','Dari Abu Hurairah ia berkata: Ketika Nabi shallallahu \'alaihi wasallam berada dalam suatu majelis membicarakan suatu kaum, tiba-tiba datanglah seorang Arab Badui lalu bertanya: \"Kapan datangnya hari kiamat?\" Namun Nabi shallallahu \'alaihi wasallam tetap melanjutkan pembicaraannya. Sementara itu sebagian kaum ada yang berkata; \"beliau mendengar perkataannya akan tetapi beliau tidak menyukai apa yang dikatakannya itu, \" dan ada pula sebagian yang mengatakan; \"bahwa beliau tidak mendengar perkataannya.\" Hingga akhirnya Nabi shallallahu \'alaihi wasallam menyelesaikan pembicaraannya, seraya berkata: \"Mana orang yang bertanya tentang hari kiamat tadi?\" Orang itu berkata: \"saya wahai Rasulullah!\". Maka Nabi shallallahu \'alaihi wasallam bersabda: \"Apabila sudah hilang amanah maka tunggulah terjadinya kiamat\". Orang itu bertanya: \"Bagaimana hilangnya amanat itu?\" Nabi shallallahu \'alaihi wasallam menjawab: \"Jika urusan diserahkan bukan kepada ahlinya, maka tunggulah saat (kehancurannya)\".',NULL,NULL),
(60,60,'Kitab Ilmu','Orang yang Meninggikan Suaranya untuk Mengajarkan Ilmu. ','Dari Abdullah bin \'Amr berkata: Nabi shallallahu \'alaihi wasallam pernah tertinggal dari kami dalam suatu perjalanan yang kami lakukan hingga Beliau mendapatkan kami sementara waktu shalat sudah hampir habis, kami berwudhu\' dengan hanya mengusap kaki kami. Maka Nabi shallallahu \'alaihi wasallam berseru dengan suara yang keras: \"celakalah bagi tumit-tumit yang tidak basah akan masuk neraka.\" Beliau serukan hingga dua atau tiga kali.',NULL,NULL),
(61,61,'Kitab Ilmu','Orang yang Meninggikan Suaranya untuk Mengajarkan Ilmu. ','Dari Ibnu Umar berkata; Rasulullah shallallahu \'alaihi wasallam bersabda: \"Sesungguhnya diantara pohon ada suatu pohon yang tidak jatuh daunnya. Dan itu adalah perumpamaan bagi seorang muslim\". Nabi shallallahu \'alaihim wasallam bertanya: \"Katakanlah kepadaku, pohon apakah itu?\" Maka para sahabat beranggapan bahwa yang dimaksud adalah pohon yang berada di lembah. Abdullah berkata: \"Aku berpikir dalam hati pohon itu adalah pohon kurma, tapi aku malu mengungkapkannya. Kemudian para sahabat bertanya: \"Wahai Rasulullah, pohon apakah itu?\" Beliau shallallahu \'alaihi wasallam menjawab: \"Pohon kurma\".',NULL,NULL),
(62,62,'Kitab Ilmu','Seorang Imam Melemparkan Pertanyaan kepada Para Shahabatnya untuk Menguji Sejauh Mana Ilmu Mereka ','Dari Ibnu Umar berkata; Rasulullah shallallahu \'alaihi wasallam bersabda: \"Sesungguhnya diantara pohon ada suatu pohon yang tidak jatuh daunnya. Dan itu adalah perumpamaan bagi seorang muslim\". Nabi shallallahu \'alaihi wasallam bertanya: \"Katakanlah kepadaku, pohon apakah itu?\" Maka para sahabat beranggapan bahwa yang dimaksud adalah pohon yang berada di lembah. Abdullah berkata: \"Aku berpikir dalam hati pohon itu adalah pohon kurma, tapi aku malu mengungkapkannya. Kemudian para sahabat bertanya: \"Wahai Rasulullah, pohon apakah itu?\" Beliau shallallahu \'alaihi wasallam menjawab: \"Pohon kurma\".',NULL,NULL),
(63,63,'Kitab Ilmu','Hal-hal yang Bekaitan dengan Ilmu. Dan Firman Allah Ta’ala : “Dan Katakanlah, ‘Tuhanku, Tambahkanlah kepadaku Ilmu.” (QS. Thaha :114)','Dari Syarik bin Abdullah bin Abu Namir bahwa dia mendengar Anas bin Malik berkata: Ketika kami sedang duduk-duduk bersama Nabi shallallahu \'alaihi wasallam didalam Masjid, ada seorang yang menunggang unta datang lalu<br>menambatkannya di dekat Masjid lalu berkata kepada mereka (para sahabat): \"Siapa diantara kalian yang bernama Muhammad?\" Pada saat itu Nabi shallallahu \'alaihi wasallam bersandaran di tengah para sahabat, lalu kami menjawab: \"orang Ini, yang berkulit putih yang sedang bersandar\". Orang itu berkata kepada Beliau; \"Wahai putra Abdul Muththalib\" Nabi shallallahu \'alaihi wasallam menjawab: \"Ya, aku sudah menjawabmu\". Maka orang itu berkata kepada Nabi shallallahu \'alaihi wasallam: \"Aku bertanya kepadamu persoalan yang mungkin berat buatmu namun janganlah kamu merasakan sesuatu terhadapku.\" Maka Nabi shallallahu \'alaihi wasallam menjawab: \"Tanyalah apa yang menjadi persoalanmu\". Orang itu berkata: \"Aku bertanya kepadamu demi Rabbmu dan Rabb orang-orang sebelummu. Apakah Allah yang mengutusmu kepada manusia seluruhnya?\" Nabi shallallahu \'alaihi wasallam menjawab: \"Demi Allah, ya benar!\" Kata orang itu: \"Aku bersumpah kepadamu atas nama Allah, apakah Allah yang memerintahkanmu supaya kami shalat lima (waktu) dalam sehari semalam?\" Nabi shallallahu \'alaihi wasallam menjawab: \"Demi Allah, ya benar!\" Kata orang itu: \"Aku bersumpah kepadamu atas nama Allah, apakah Allah yang memerintahkanmu supaya kami puasa di bulan ini dalam satu tahun?\" Nabi shallallahu \'alaihi wasallam menjawab: \"Demi Allah, ya benar!\" Kata orang itu: \"Aku bersumpah kepadamu atas nama Allah, apakah Allah yang memerintahkanmu supaya mengambil sedekah dari orang-orang kaya di antara kami lalu membagikannya kepada orang-orang fakir diantara kami?\" Nabi shallallahu \'alaihi wasallam menjawab: \"Demi Allah, ya benar!\" Kata orang itu: \"Aku beriman dengan apa yang engkau bawa dan aku adalah utusan kaumku, aku Dlamam bin Tsa\'labah saudara dari Bani Sa\'d bin Bakr.\" Begitulah (kisah tadi) sebagaimana yang diriwayatkan oleh Musa bin Isma\'il dan Ali bin Abdul Hamid dari Sulaiman bin Al Mughirah dari Tsabit dari Anas dari Nabi shallallahu \'alaihi wasallam',NULL,NULL),
(64,64,'Kitab Ilmu','Penjelasan tentang Transfer Ilmu dan Surat-Surat Para Ulama ke Berbagai Negara ','Dari Ubaidullah bin Abdullah bin Utbah bin Mas\'ud bahwa Abdullah bin \'Abbas telah mengabarkannya, bahwa Nabi shallallahu \'alaihi wasallam telah mengutus seseorang dengan membawa untuk menyampaikan surat beliau kepada pembesar Bahrain. Kemudian para Bahrain itu mengirimkannya kepada Kaisar Kisra. Ketika ia selesai membacanya, ia merobeknya.  Aku yakin Ibnu Musayyib mengatakan, \'Maka Rasulullah shallallahu \'alaihi wasallam berdoa agar mereka dirobek-robek sehancur-hancurnya.',NULL,NULL),
(65,65,'Kitab Ilmu','Penjelasan tentang Transfer Ilmu dan Surat-Surat Para Ulama ke Berbagai Negara ','Dari Anas bin Malik berkata: Nabi shallallahu \'alaihi wasallam menulis surat atau<br>bermaksud menulis surat, lalu dikatakan kepada Beliau, bahwa mereka tidak akan membaca tulisan kecuali tertera stempel. Maka Nabi shallallahu \'alaihi wasallam membuat stempel yang terbuat dari perak yang bertanda; Muhammad Rasulullah. Seakan-akan aku melihat warna putih pada tangan Beliau shallallahu \'alaihi wasallam\". Lalu aku bertanya kepada Qotadah: \"Siapa yang membuat tanda Muhammad Rasulullah?\" Ia menjawab: \"Anas\".',NULL,NULL),
(66,66,'Kitab Ilmu','Orang yang Terakhir Duduk dalam Suatu Majelis dan Orang yang Melihat Sebuah Tempat Kosong dalam Suatu Pertemuan lalu Duduk di Sana ','Dari Abu Waqid Al Laitsi, bahwa Rasulullah shallallahu \'alaihi wasallam ketika sedang duduk bermajelis di Masjid bersama para sahabat datanglah tiga orang. Yang dua orang menghadap Nabi shallallahu \'alaihi wasallam dan yang seorang<br>lagi pergi, yang dua orang terus duduk bersama Nabi shallallahu \'alaihi wasallam dimana satu diantaranya nampak berbahagia bermajelis bersama Nabi shallallahu \'alaihi wasallam sedang yang kedua duduk di belakang mereka, sedang yang ketiga berbalik pergi, Setelah Rasulullah shallallahu \'alaihi wasallam selesai bermajelis, Beliau bersabda: \"Maukah kalian aku beritahu tentang ketiga orang tadi?\" Adapun seorang diantara mereka, dia meminta perlindungan kepada Allah, maka Allah lindungi dia. Yang kedua, dia malu kepada Allah, maka Allah pun malu kepadanya. Sedangkan yang ketiga berpaling dari Allah maka Allah pun berpaling darinya\".',NULL,NULL),
(67,67,'Kitab Ilmu','Sabda Nabi, Seringkali Orang yang Diberitahu Suatu Berita Lebih Dapat Mengingat daripada Orang yang Mendengarkannya ','Dari Abdurrahman bin Abu Bakrah dari ayahnya, dia menuturkan, bahwa Nabi shallallahu \'alaihi wasallam duduk diatas untanya sementara orang-orang memegangi tali kekang unta tersebut. Beliau shallallahu \'alaihi wasallam berkata: \"Hari apakah ini? \'. Kami semua terdiam dan menyangka bahwa Beliau akan menamakan nama lain selain nama hari yang sudah dikenal. Beliau shallallahu \'alaihi wasallam berkata: \"Bukankah hari ini hari Nahar?\" Kami menjawab: \"Benar\". Nabi shallallahu \'alaihi wasallam kembali bertanya: \"Bulan apakah ini? \'. Kami semua terdiam dan menyangka bahwa Beliau akan menamakan nama lain selain nama bulan yang sudah dikenal. Beliau shallallahu \'alaihi wasallam berkata: \"Bukankah ini bulan Dzul Hijjah?\" Kami menjawab: \"Benar\". Nabi shallallahu \'alaihi wasallam bersabda: \"Sesungguhnya darah kalian, harta kalian dan kehormatan kalian sesama kalian haram (suci) sebagaimana sucinya hari kalian ini, bulan kalian ini dan tanah kalian ini. (Maka) hendaklah yang hadir menyampaikan kepada yang tidak hadir, karena orang yang hadir semoga dapat menyampaikan kepada orang yang lebih paham darinya\".',NULL,NULL),
(68,68,'Kitab Ilmu','Rasulullah shallallahu ‘alaihi wasallam Memberikan Nasehat dan Mengajarkan Ilmu kepada Orang-orang Sesaat-sesaat, Supaya Mereka Tidak Lari Karena Mereka Bosan ','Dari Ibnu Mas\'ud berkata; bahwa Nabi shallallahu \'alaihi wasallam memperingatkan kami sesaat-ssaat pada beberapa hari karena beliau tidak mau merasa bosan.”',NULL,NULL),
(69,69,'Kitab Ilmu','Rasulullah shallallahu ‘alaihi wasallam Memberikan Nasehat dan Mengajarkan Ilmu kepada Orang-orang Sesaat-sesaat, Supaya Mereka Tidak Lari Karena Mereka Bosan ','Dari Anas bin Malik dari Nabi shallallahu \'alaihi wasallam, beliau bersabda: \"permudahlah dan jangan persulit. Berikanlah kabar gembira dan jangan membuat orang lari.\"',NULL,NULL),
(70,70,'Kitab Ilmu','Orang yang Mengkhususkan Hari-Hari Tertentu untuk Para Ahli Ilmu ','Dari Abu Wa\'il berkata; bahwa Abdullah memberi pelajaran kepada orang-orang setiap hari Kamis, kemudian seseorang berkata: \"Wahai Abu Abdurrahman, sungguh aku ingin kalau anda memberi pelajaran kepada kami setiap hari\" dia berkata: \"Sungguh aku enggan melakukannya, karena aku takut membuat kalian bosan, dan aku ingin memberi pelajaran kepada kalian sebagaimana Nabi shallallahu \'alaihi wasallam memberi pelajaran kepada kami karena khawatir kebosanan akan menimpa kami\".',NULL,NULL),
(71,71,'Kitab Ilmu','Barangsiapa Dikehendaki Kebaikan oleh Allah, Allah Akan Membuatnya Paham Tentang Agama  ','Humaid bin Abdurrahman berkata; aku mendengar Mu\'awiyyah memberi khutbah untuk kami, dia berkata; Aku mendengar Nabi shallallahu \'alaihi wasallam bersabda: \"Barangsiapa yang Allah kehendaki menjadi baik maka Allah faqihkan dia terhadap agama. Aku hanyalah yang membagi-bagikan sedang Allah yang memberi. Dan senantiasa ummat ini akan tegak diatas perintah Allah, mereka tidak akan celaka karena adanya orang-orang yang menyelisihi mereka hingga sampai datangnya perintah Allah\".',NULL,NULL),
(72,72,'Kitab Ilmu','Pemahaman dalam Hal Ilmu ','Dari Mujahid berkata; aku pernah menemani Ibnu Umar pergi ke Madinah, namun aku tidak mendengar dia membicarakan tentang Rasulullah shallallahu \'alaihi wasallam kecuali satu kejadian dimana dia berkata: Kami pernah bersama Nabi shallallahu \'alaihi wasallam lalu Beliau dipertemukan dengan jama\'ah. Kemudian Beliau bersabda: \"Sesungguhnya diantara pohon ada suatu pohon yang merupakan perumpamaan bagi seorang muslim\". Aku ingin mengatakan bahwa itu adalah pohon kurma namun karena aku yang termuda maka aku diam. Maka kemudian Nabi shallallahu \'alaihi wasallam bersabda: \"Itu adalah pohon kurma\".',NULL,NULL),
(73,73,'Kitab Ilmu','Bertekad Kuat untuk Menjadi Orang yang Berilmu dan Ahli Hikmah ','Dari Qais bin Abu Hazim berkata: “Aku mendengar Abdullah bin Mas\'ud berkata; Nabi shallallahu \'alaihi wasallam bersabda: \"Tidak boleh mendengki kecuali terhadap dua hal; (terhadap) seorang yang Allah berikan harta lalu dia pergunakan harta tersebut di jalan kebenaran dan seseorang yang Allah berikan hikmah, kemudian ia memutuskan perkara dengannya dn mengajarkannya.',NULL,NULL),
(74,74,'Kitab Ilmu','Hal-Hal yang Disebitkan tentang Perginya Nabi Musa ke Laut untuk Menemui Nabi Khidir ','Dari Ibnu \'Abbas, bahwasanya ia berselisih pendapat dengan Hurr bin Qais bin Hishin Al Fazari tentang teman Musa \'Alaihis salam, Ibnu \'Abbas berkata; dia adalah Khadhir \'Alaihis salam. Tiba-tiba lewat Ubay bin Ka\'b di depan keduanya, maka Ibnu \'Abbas memanggilnya dan berkata: \"Aku dan temanku ini berdebat tentang sahabat Musa, yang ditanya tentang jalan yang akhirnya mempertemukannya, apakah kamu pernah mendengar Nabi shallallahu \'alaihi wasallam menceritakan masalah ini?\" Ubay bin Ka\'ab menjawab: Ya, benar, aku pernah mendengar Rasulullah shallallahu \'alaihi wasallam bersabda: \"Ketika Musa di tengah pembesar Bani Israil, datang seseorang yang bertanya: apakah kamu mengetahui ada orang yang lebih pandai darimu?\" Berkata Musa: \"Tidak\". Maka Allah Ta\'ala mewahyukan kepada Musa \'Alaihis salam: \"Ada, yaitu hamba Kami bernama Khadir.\" Maka Musa meminta jalan untuk bertemu dengannya. Allah menjadikan ikan bagi Musa sebagai tanda dan dikatakan kepadanya; \"jika kamu kehilangan ikan tersebut kembalilah, nanti kamu akan berjumpa dengannya\". Maka Musa \'Alaihis Salam mengikuti jejak ikan di lautan. Berkatalah murid Musa \'Alaihis salam: \"Tahukah kamu tatkala kita mencari tempat berlindung di batu tadi? Sesungguhnya aku lupa (menceritakan tentang) ikan itu dan tidaklah yang melupakan aku untuk menceritakannya kecuali syetan\". Maka Musa berkata:.\"Itulah (tempat) yang kita cari\". Lalu keduanya kembali, mengikuti jejak mereka semula. Maka akhirnya keduanya bertemu dengan Khadir.\" Begitulah kisah keduanya sebagaimana Allah ceritakan dalam Kitab-Nya.',NULL,NULL),
(75,75,'Kitab Ilmu','Do’a Nabi shallallahu ‘alaihi wasallam, “Ya Allah Ajarkanlah kepadanya Al-Quran','Dari Ibnu \'Abbas ia berkata: “Rasulullah shallallahu \'alaihi wasallam mendekapku, lalu beliau bersabda: \"Ya Allah, ajarkanlah kepadanya al-Quran\".',NULL,NULL),
(76,76,'Kitab Ilmu','Kapankan Anak Kecil Dibolehkan Mendengarkan (Pengajian Agama)?','Dari Abdullah bin \'Abbas berkata: “Aku menemui orang yang datang dengan mengendarai keledai, yang saat itu aku hampir menginjak masa baligh, dan Rasulullah sedang shalat di Mina dengan tidak menghadap dinding. Maka aku lewat di depan sebagian shaf kemudian aku melepas keledai betina itu supaya mencari makan sesukanya. Lalu aku masuk kembali di tengah shaf dan tidak ada<br>orang yang menyalahkanku\".',NULL,NULL),
(77,77,'Kitab Ilmu','Kapankan Anak Kecil Dibolehkan Mendengarkan (Pengajian Agama)?','Dari Mahmud bin Ar Rabbi\' berkata: \"Aku mengingat dari Nabi, saat Beliau melumuri air ludah Beliau di wajahku, saat itu aku baru berumur lima tahun\".',NULL,NULL),
(78,78,'Kitab Ilmu','Pergi Untuk Menuntut Ilmu ','Dari Ibnu \'Abbas bahwasanya dia berselisih pendapat denga dan Hurr bin Qais bin Hishin Al Fazari berdebat tentang sahabat, Ibnu \'Abbas berkata; dia adalah Khadhir. Tiba-tiba lewat Ubay bin Ka\'ab di depan keduanya, maka Ibnu \'Abbas memanggilnya dan berkata: \"Aku dan temanku ini berdebat tentang sahabat Musa, yang ditanya tentang jalan yang akhirnya mempertemukannya, apakah kamu pernah mendengar Nabi shallallahu \'alaihi wasallam menceritakan masalah ini?\" Ubay bin Ka\'ab menjawab: Ya, benar, aku pernah mendengar Rasulullah shallallahu \'alaihi wasallam bersabda: \"Ketika Musa di tengah pembesar Bani Israil, datang seseorang yang bertanya: apakah kamu mengetahui ada orang yang lebih pandai darimu?\" Berkata Musa \': \"Tidak\". Maka Allah Ta\'ala mewahyukan kepada Musa: \"Ada, yaitu hamba Kami bernama Khadir.\" Maka Musa meminta jalan untuk bertemu dengannya. Allah menjadikan ikan bagi Musa sebagai tanda dan dikatakan kepadanya; \"jika kamu kehilangan ikan tersebut kembalilah, nanti kamu akan berjumpa dengannya\". Maka Musa mengikuti jejak ikan di lautan. Berkatalah murid Musa: \"Tahukah kamu tatkala kita mencari tempat berlindung di batu tadi? Sesungguhnya aku lupa (menceritakan tentang) ikan itu dan tidaklah yang melupakan aku untuk menceritakannya kecuali syetan\". Maka Musa: \"Itulah (tempat) yang kita cari\". Lalu keduanya kembali, mengikuti jejak mereka semula. Maka akhirnya keduanya bertemu dengan Khadir.\" Begitulah kisah keduanya sebagaimana Allah ceritakan dalam Kitab-Nya.',NULL,NULL),
(79,79,'Kitab Ilmu','Keutamaan Orang yang Berilmu dan Mengajarkannya ','Dari Abu Musa dari Nabi shallallahu \'alaihi wasallam, beliau bersabda: \"Perumpamaan petunjuk dan ilmu yang Allah mengutusku dengan membawanya adalah seperti hujan yang lebat yang turun mengenai tanah. Diantara tanah itu ada jenis yang dapat menyerap air sehingga dapat menumbuhkan tumbuh-tumbuhan dan rerumputan yang banyak. Dan di antaranya ada tanah yang keras lalu menahan air (tergenang) sehingga dapat diminum oleh manusia, memberi minum hewan ternak dan untuk menyiram tanaman. Dan yang lain ada permukaan tanah yang berbentuk lembah yang tidak dapat menahan air dan juga tidak dapat menumbuhkan tanaman. perumpamaan itu adalah seperti orang yang faham agama Allah dan dapat memanfa\'atkan apa yang aku diutus dengannya, dia mempelajarinya dan mengajarkannya, dan juga perumpamaan orang yang tidak dapat mengangkat derajat dan tidak menerima petunjuk Allah dengan apa yang aku diutus dengannya\". ',NULL,NULL),
(80,80,'Kitab Ilmu','Diangkatnya Ilmu dan Munculnya Kebodohan','Dari Anas bin Malik iaberkata, Rasul shallallahu \'alaihi wasallam bersabda: \"Sesungguhnya diantara tanda-tanda datangnya kiamat adalah diangkatnya ilmu dan merebaknya kebodohan dan diminumnya khamer serta praktek perzinahan.”',NULL,NULL),
(81,81,'Kitab Ilmu','Diangkatnya Ilmu dan Munculnya Kebodohan','Dari Anas bin Malik berkata: Rasulullah shallallahu \'alaihi wasallam bersabda: \"Sesungguhnya diantara tanda-tanda kiamat adalah sedikitnya ilmu dan merebaknya kebodohan, perzinahan secara terang-terangan, jumlah perempuan yang lebih banyak dan sedikitnya laki-laki, sampai-sampai (perbandingannya) lima puluh perempuan sama dengan hanya satu orang laki-laki.',NULL,NULL),
(82,82,'Kitab Ilmu','Keutamaan Ilmu ','Dari Hamzah bin Abdullah bin Umar, sesungungguhnya Umar berkata, “Aku mendengar Rasulullah shallallahu \'alaihi wasallam bersabda: \"Ketika aku tidur, aku bermimpi diberi segelas susu lalu aku meminumnya hingga aku melihat pemandangan yang bagus keluar dari kuku-kukuku, kemudian aku berikan sisanya kepada sahabat muliaku Umar bin Al Khaththab\". Orang-orang bertanya: \"Apa ta\'wilnya wahai Rasulullah?\" Beliau menjawab: \"Ilmu\".',NULL,NULL),
(83,83,'Kitab Ilmu','Memberikan Fatwa Ketika Berada Diatas Binatang Tunggangan, atau Di Atas Apa Saja ','Dari Abdullah bin \'Amr bin \'Ash; bahwasanya Rasulullah shallallahu \'alaihi wasallam wukuf pada haji wada\' memberi kesempatan kepada manusia untuk bertanya kepada beliau. Lalu datanglah seseorang dan berkata: \"Aku tidak menyadari, ternyata saat aku mencukur rambut aku belum menyembelih.\" Maka Nabi shallallahu \'alaihi wasallam bersabda: \"Sembelihlah, dan kamu tidak berdosa\" Kemudian datang laki-laki lain dan berkata: \"Aku tidak menyadari, ternyata ketika berkurban aku belum melempar (jumrah) \". Nabi shallallahu \'alaihi wasallam bersabda: \"Lemparlah jumrah dan kamu tidak berdosa\". Dan tidaklah Nabi shallallahu \'alaihi wasallam ditanya tentang sesuatu perkara sebelum dan sesudahnya kecuali beliau menjawab: \"Lakukanlah kamu tidak berdosa\".',NULL,NULL),
(84,84,'Kitab Ilmu','Orang yang Menjawab Fatwa dengan Isyarat Tangan dan Kepala ','Dari Ibnu \'Abbas; bahwasanya Nabi shallallahu \'alaihi wasallam ditanya seseorang pada wktu beliau sedang melakukan ibadah haji, orang itu berkata: \"Aku menyembelih hewan sebelum aku melempar jumrah\". Beliau memberi isyarat dengan tangannya bahwa hal itu tidak berdosa. Orang lain bertanya: “Aku telah mencukur sebelum menyembelih\". Maka beliau mengisyaratkan dengan tangannya bahwa hal itu tidak berdosa.”',NULL,NULL),
(85,85,'Kitab Ilmu','Orang yang Menjawab Fatwa dengan Isyarat Tangan dan Kepala ','Dari Abu Hurairah dari Nabi shallallahu \'alaihi wasallam, beliau bersabda: \"Ilmu akan diangkat dan akan tersebar kebodohan dan fitnah merajalela serta banyak timbul kekacauan\". Ditanyakan kepada Beliau shallallahu \'alaihi wasallam: \"Wahai Rasulullah, apa yang dimaksud dengan kekacauan?\" Maka Rasul shallallahu \'alaihi wasallam menjawab: \"Begini” dengan tangannya, seolah-olah yang beliau maksud adalah pembunuhan.”<br>',NULL,NULL),
(86,86,'Kitab Ilmu','Orang yang Menjawab Fatwa dengan Isyarat Tangan dan Kepala ','Dari Asma\' rhadiyallahu \'anhu ia berkata: Aku menemui Aisyah saat dia sedang shalat. Setelah itu aku tanyakan kepadanya: \"Apa yang sedang dilakukan orang-orang?\" Aisyah memberi isyarat ke langit. Ternyata orang-orang sedang melaksanakan shalat (gerhana matahari). Maka Aisyah berkata: \"Subhanallah! (Maha Suci Alla!)\". Aku tanyakan lagi: \"Satu tanda saja?\" Lalu dia memberi isyarat dengan kepalanya, maksudnya mengangguk tanda mengiyakan. Maka akupun ikut shalat namun timbul perasaan yang membingungkanku, hingga aku siram kepalaku dengan air. Dalam khutbahnya, Nabi shallallahu \'alaihi wasallam memuji Allah dan mensucikan-Nya, lalu bersabda: \"Tidak ada sesuatu yang belum diperlihatkan kepadaku, kecuali aku sudah melihatnya dari tempatku ini hingga surga dan neraka, lalu diwahyukan kepadaku: bahwa kalian akan terkena fitnah dalam kubur kalian seperti -atau hampir berupa- fitnah -yang aku sendiri tidak tahu apa yang diucapkan Asma\' diantaranya adalah fitnah Al Masihud dajjal-; \"akan ditanyakan kepada seseorang (didalam kuburnya); \"Apa yang kamu ketahui tentang laki-laki ini?\" Adapun orang beriman atau orang yang yakin, -Asma\' kurang pasti mana yang dimaksud diantara keduanya- akan menjawab: \'Dia adalah Muhammad Rasulullah telah datang kepada kami membawa penjelasan dan petunjuk. Maka kami sambut dan kami ikuti. Dia adalah Muhammad, \' diucapkannya tiga kali. Maka kepada orang itu dikatakan: \'Tidurla  dengan tenang, sungguh kami telah mengetahui bahwa kamu adalah orang yang yakin\'. Adapun orang Munafiq atau orang yang ragu, -Asma\' kurang pasti mana yang dimaksud diantara keduanya-, akan menjawab; \"aku tidak tahu siapa dia, aku mendengar manusia membicarakan sesuatu maka akupun mengatakannya\".',NULL,NULL),
(87,87,'Kitab Ilmu','Anjuran Nabi shallallahu ‘alaihi wasallam kepada Utusan Abdul Qais Agar Memelihara Keimanan dan Ilmu; Mengajarkannya kepada Orang yang Tidak Hadir ','Dari Abu Jamrah berkata aku pernah menjadi penerjemah antara Ibnu \'Abbas dan orang-orang, katanya; bahwasanya telah datang rombongan utusan Abdul Qais menemui Nabi shallallahu \'alaihi wasallam lalu Nabi shallallahu \'alaihi wasallam berkata: \"Utusan siapakah ini atau kaum manakah ini?\" Utusan itu menjawab: \"Rabi\'ah\". Lalu Nabi shallallahu \'alaihi wasallam berkata: \"Selamat datang kaum atau para utusan dengan sukarela dan tanpa menyesal\". Para utusan berkata: \"Wahai Rasulullah kami datang dari perjalanan yang jauh sementara diantara kampung kami dan engkau ada kampung kaum kafir (suku) Mudlor, dan kami tidak sanggup untuk mendatangi engkau kecuali di bulan suci. Ajarkanlah kami dengan satu perintah yang jelas, yang dapat kami amalkan dan kami ajarkan kepada orang-orang di kampung kami dan dengan begitu kami dapat masuk surga.\" Lalu mereka bertanya kepada Nabi shallallahu \'alaihi wasallam tentang minuman. Maka Nabi shallallahu \'alaihi wasallam memerintahkan mereka dengan empat hal dan melarang dari empat hal, memerintahkan mereka untuk beriman kepada Allah satu-satunya, beliau berkata: \"Tahukah kalian apa arti beriman kepada Allah satu-satunya?\" Mereka menjawab: \"Allah dan Rasul-Nya yang lebih mengetahui.\" Nabi shallallahu \'alaihi wasallam menjelaskan: \"Persaksian tidak ada ilah yang berhak disembah kecuali Allah dan bahwa Muhammad adalah utusan Allah, menegakkan shalat, menunaikan zakat, berpuasa di bulan Ramadlan dan kalian mengeluarkan seperlima dari harta rampasan perang\". Dan Nabi shallallahu \'alaihi wasallam melarang mereka dari empat perkara, yaitu dari meminum dari dari arak  Dhubaa`, arak Hatam. Syu\'bah berkata; terkadang beliau menyebutkan arak Naqier dan terkadang arak Muqoyyar. Kemudian Nabi shallallahu \'alaihi wasallam bersabda: \"Hafalkanlah dan beritahukanlah semua itu dan beritahukanlah kepada orang-orang di belakang kalian\".',NULL,NULL),
(88,88,'Kitab Ilmu','Melakukan untuk Mencari Jawaban Atas Sebuah Permasalahan yang Muncul dan Mengajarkannya kepada Keluarganya ','Dari \'Uqbah bin al-Harits; bahwasanya dia menikah dengan seorang perempuan putri Abu Ihab bin \'Aziz. Lalu datanglah seorang perempuan dan berkata: \"Aku pernah menyusui \'Uqbah dan wanita yang dinikahinya itu\". Maka \'Uqbah berkata kepada perempuan itu: \"Aku tidak tahu kalau kamu pernah menyusuiku dan kamu tidak memberitahu aku.\" Maka \'Uqbah mengendarai kendaraannya menemui Rasul shallallahu \'alaihi wasallam di Madinah dan menyampaikan masalahnya. Maka Rasul shallallahu \'alaihi wasallam bersabda: \"harus bagaimana lagi, sedangkan dia sudah mengatakannya\". Maka kemudian \'Uqbah menceraikannya dan menikah dengan wanita yang lain.',NULL,NULL),
(89,89,'Kitab Ilmu','Saling Bergiliran dalam Hal Menuntut Ilmu ','Dari Abdullah bin \'Abbas dari Umar berkata: Aku dan tetanggaku dari Anshar berada di desa Banu Umayyah bin Zaid dia termasuk orang kepercayaan di Madinah, kami saling bergantian menimba ilmu dari Rasul shallallahu \'alaihi wasallam, sehari aku yang menemui Beliau shallallahu \'alaihi wasallam dan hari lain dia yang menemui Beliau shallallahu \'alaihi wasallam, Jika giliranku tiba, aku menanyakan seputar wahyu yang turun hari itu dan perkara lainnya. Dan jika giliran tetanggaku tiba, ia pun melakukan hal yang sama. Ketika hari giliran tetanggaku tiba, dia datang kepadaku dengan mengetuk pintuku dengan sangat keras, seraya berkata: \"Apakah dia ada disana?\" Maka aku kaget dan keluar menemuinya. Dia berkata: \"Telah terjadi persoalan yang gawat!\". Umar berkata: \"Aku pergi menemui Hafshah, dan ternyata dia sedang menangis, aku bertanya kepadanya: \"Apakah Rasul shallallahu \'alaihi wasallam menceraikanmu?\" Hafshah menjawab: \"Aku tidak tahu\". Maka aku menemui Nabi shallallahu \'alaihi wasallam, sambil berdiri aku tanyakan: \"Apakah engkau menceraikan istri-istri engkau?\" Nabi shallallahu \'alaihi wasallam menjawab: \"Tidak\". Maka aku ucapkan: \"Allahuakbar\".<br>',NULL,NULL),
(90,90,'Kitab Ilmu','Marah pada Saat Memberikan Nasehat atau Pelajaran karema Melihat Sesuatu yang Tidak Disukai ','Dari Abu Al Mas\'ud Al Anshari berkata, seorang sahabat bertanya: \"Wahai Rasulullah, aku hampir tidak sanggup shalat yang dipimpin seseorang dengan bacaannya yang panjang.\" Maka aku belum pernah melihat Nabi shallallahu \'alaihi wasallam memberi peringatan dengan lebih marah dari yang disampaikannya hari itu seraya bersabda: \"Wahai manusia, kalian membuat orang lari menjauh. Maka barangsiapa shalat mengimami orang-orang ringankanlah. Karena diantara mereka ada orang sakit, orang lemah dan orang yang punya keperluan\".',NULL,NULL),
(91,91,'Kitab Ilmu','Marah pada Saat Memberikan Nasehat atau Pelajaran karema Melihat Sesuatu yang Tidak Disukai ','Dari Zaid bin Khalid Al Juhani bahwa Nabi shallallahu \'alaihi wasallam ditanya oleh seseorang tentang barang temuan, maka Nabi shallallahu \'alaihi wasallam bersabda: \"Kenalilah tali pengikatnya, atau Beliau berkata; kantong dan tutupnya, kemudian umumkan selama satu tahun, setelah itu pergunakanlah. Jika datang pemiliknya maka berikanlah kepadanya\". Orang itu bertanya: \"Bagaimana dengan orang yang menemukan unta?\" Maka Nabi shallallahu \'alaihi wasallam marah hingga nampak merah mukanya, lalu berkata: \"apa urusanmu dengan unta itu, sedang dia selalu membawa air di perutnya, bersepatu sehingga dapat hilir mudik mencari minum dan makan rerumputan, maka biarkanlah dia hingga pemiliknya datang mengambilnya\". Orang itu bertanya lagi tentang menemukan kambing, maka Beliau menjawab: \"Itu untuk kamu atau saudaramu atau serigala\".',NULL,NULL),
(92,92,'Kitab Ilmu','Marah pada Saat Memberikan Nasehat atau Pelajaran karema Melihat Sesuatu yang Tidak Disukai ','Dari Abu Musa berkata; Nabi shallallahu \'alaihi wasallam pernah ditanya tentang sesuatu yang Beliau tidak suka, ketika terus ditanya, Beliau marah lalu berkata kepada orang-orang: \"Bertanyalah kepadaku sesuka kalian\". Maka seseorang bertanya: \"Siapakah bapakku?\" Beliau shallallahu \'alaihi wasallam menjawab: \"Bapakmu adalah Hudzafah\". Yang lain bertanya: \"Siapakah bapakku wahai Rasulullah shallallahu \'alaihi wasallam?: \"Bapakmu Salim, sahaya Syaibah\" Ketika Umar melihat apa yang ada pada wajah Beliau, dia berkata: \"Wahai Rasulullah, kami bertaubat kepada Allah \'azza wajalla\".',NULL,NULL),
(93,93,'Kitab Ilmu','Orang yang Berjongkok dengan Kedua Lututnya di Hadapan Imam atau Orang yang Sedang Menyampaikan Berita ','Dari Az Zuhri ia berkata, telah mengabarkan kepadaku Anas bin Malik bahwa Rasulullah shallallahu \'alaihi wasallam keluar, lalu berdirilah Abdullah bin Hudzafah dan berkata: \"Siapakah ayahku?\" Beliau menjawab: \"Ayahmu adalah Hudzafah\". Kemudian beliau sering mengucapkan \'Tanyakanlah kepadaku’, Maka Umar berjongkok dengan kedua lututnya dan berkata: \"Kami ridla Allah sebagai Rabb kami, Islam sebagai agama kami dan Muhammad shallallahu \'alaihi wasallam sebagai Nabi Kami.\" Maka Abdullah bin Hudzafah terdiam.',NULL,NULL),
(94,94,'Kitab Ilmu','Orang yang Mengulangi Perkataanya Tiga Kali Agar Perkataannya Itu Dipahami ','Dari Anas rhadiyallahu \'anhu dari Nabi shallallahu \'alaihi wasallam, bahwa Nabi shallallahu \'alaihi wasallam apabila memberi salam, diucapkannya tiga kali dan bila berbicara dengan satu kalima, maka beliau mengulanginya tiga kali.',NULL,NULL),
(95,95,'Kitab Ilmu','Orang yang Mengulangi Perkataanya Tiga Kali Agar Perkataannya Itu Dipahami ','Dari Anas dari Nabi shallallahu \'alaihi wasallam, bahwa Nabi shallallahu \'alaihi wasallam bila berbicaradiulangnya tiga kali hingga dapat dipahami dan bila mendatangi kaum, Beliau memberi salam tiga kali kepada mereka ',NULL,NULL),
(96,96,'Kitab Ilmu','Orang yang Mengulangi Perkataanya Tiga Kali Agar Perkataannya Itu Dipahami ','Dari Abdullah bin \'Amr berkata, Nabi shallallahu \'alaihi wasallam pernah tertinggal dari kami dalam suatu perjalanan yang kami lakukan, hingga Beliau mendapatkan kami sementara waktu shalat sudah hampir habis, maka kami berwudlu\' dengan hanya mengusap kaki kami. Maka Nabi shallallahu \'alaihi wasallam berseru dengan suara yang keras: \"celakalah bagi tumit-tumit yang tidak basah akan masuk neraka.\" Diserukannya hingga dua atau tiga kali.',NULL,NULL),
(97,97,'Kitab Ilmu','Seorang Laki-Laki Mengajarkan Budak Perempuan dan Keluarganya. ','Amir Asy Sya\'bi; telah menceritakan kepadaku Abu Burdah dari ayahnya  berkata, telah bersabda Rasulullah shallallahu \'alaihi wasallam: \"Ada tiga orang yang akan mendapat pahala dua kali; seseorang dari Ahlul Kitab yang beriman kepada Nabinya dan beriman kepada Muhammad shallallahu \'alaihi wasallam, dan seorang hamba sahaya yang menunaikan hak Allah dan hak tuannya. Dan seseorang yang memiliki hamba sahaya wanita lalu dia memperlakukannya dengan baik, mendidiknya dengan baik, dan mengajarkan kepadanya dengan sebaik-baik pengajaran, kemudian membebaskannya dan menikahinya, maka baginya dua pahala\". Berkata \'Amir: \"Kami memberikan (ilmu tentang) tiga golongan itu kepadamu, tanpa imbalan sesuatu pun yang biasa orang bawa ke Madinah dengan tujuan lebih rendah dari itu (menunut ilmu). ','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(98,98,'Kitab Ilmu','Seorang Laki-Laki Mengajarkan Budak Perempuan dan Keluarganya. ','Dari Ayyub ia berkata; “Aku mendengar Atha\' mengatakan: aku mendengar Ibnu \'Abbas berkata: \'Aku bersaksi atas Nabi shallallahu \'alaihi wasallam atau Atha\', berkata; \'Aku bersaksi kepaa Ibnu \'Abbas bahwasanya Rasulullah shallallahu \'alaihi wasallam keluar bersama Bilal. Beliau merasa bahwa beliau belum mengajarkan kepada kaum wanita, maka beliau memberi nasehat kepada mereka  dan memerintahkan untuk bersedekah. Maka mereka memberikan kalung dan cincin mereka, sedang Bilal mengamnilnya dengan ujung pakaiannya. ','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(99,99,'Kitab Ilmu','Tekad yang Kuat Terhadap Hadits ','Dari Abu Hurairah, bahwa dia berkata: ditanyakan (kepada Rasulullah shallallahu \'alaihi wasallam: \"Wahai Rasulullah siapakah orang yang paling berbahagia dengan syafa\'atmu pada hari kiamat?\" Rasulullah shallallahu \'alaihi wasallam menjawab: \"Aku telah menduga wahai Abu Hurairah, bahwa tidak ada orang yang mendahuluimu dalam menanyakan masalah ini, karena aku lihat betapa perhatian dirimu terhadap hadits. Orang yang paling berbahagia dengan syafa\'atku pada hari kiamat adalah orang yang mengucapkan \'Laa ilaaha illallah (Tiada Tuhan selain Allah) dengan penuh  keikhlasan dari hati atau jiwanya\".','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(100,100,'Kitab Ilmu','Bagaimana Ilmu Dicabut? ','Dari Abdullah bin Amr bin \'Ash, ia berkata: “Aku mendengar Rasulullah shallallahu \'alaihi wasallam bersabda : \'Sesungguhnya Allah tidak akan mencabut ilmu dengan mencabutnya dari hamba-hambaNya, melainkan ilmu itu itu dicabut dengan wafatnya dari hamba-hambaNya, melainkan ilmu itu satu orang pun yang memiliki ilmu, maka orang-orang kan mengangkat orang-orang yang bodoh sebagai pemimpin, Kemudian ditanya, lalu mereka memberi fatwa tanpa ilmu. Mereka itu telah sesat dan menyesatkan.”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(101,101,'Kitab Ilmu','Apakah Perlu Hari Tertentu untuk Mengajarkan Ilmu Agama kepada Kaum Wanita  ','Dari Abu Sa\'id Al Khudri rhadiyallahu \'anhu, ia berkata; \'Kaum wanita berkata kepada Nabi shallallahu \'alaihi wasallam: \"kaum lelaki telah mengalahkan kami atas (pelajaran dari) engkau, maka berilah kami satu hari untuk mengajarkan kepada kami.’ Maka Nabi shallallahu \'alaihi wasallam menjajikan kepada mereka satu hari untuk bertemu dengan mereka, dan mengajarkan mereka sefta menyampaikan perintah-perintah Allah. Di antara pelajaran beliau untuk mereka kaum wanita adalah sabda beliau, \'Barangsiapa di antara kalian yang kematian tiga orang anaknya, maka mereka akan menhadi penghalang baginya dari api neraka.’ tiga orang dari anaknya kecuali akan menjadi tabir bagi dirinya dari neraka.’ Seorang wanita bertanya, \'Bagaimana kalau dua orang?\" Beliau menjawab: \'Ya, dua orang juga.’ ','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(102,102,'Kitab Ilmu','Apakah Perlu Hari Tertentu untuk Mengajarkan Ilmu Agama kepada Kaum Wanita  ','Dari Abu Hurairah rhadiyallahu \'anhu ia berkata : “Yaitu tiga orang anak yang belum akil baligh (belum dewasa).','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(103,103,'Kitab Ilmu','Orang yang Mendengar Sesuatu dan Dia Belum Paham, maka Dia Harus Bertanya Lagi Hingga Dia Paham ','Dari Nafi\' bin Umar berkata, telah menceritakan kepadaku Ibnu Abu Mulaikah bahwa Aisyah istri Nabi shallallahu \'alaihi wasallam tidaklah mendengar sesuatu yang tidak dia mengerti kecuali menanyakannya kepada Nabi shallallahu \'alaihi wasallam sampai dia mengerti, dan Nabi shallallahu \'alaihi wasallam pernah bersabda: \"Siapa yang dihisab berarti dia disiksa\" Aisyah berkata: maka aku bertanya kepada Nabi: \"Bukankah Allah Ta\'ala berfirman: \"Kelak dia akan dihisab dengan hisab yang ringan\" Aisyah berkata: Maka Nabi shallallahu \'alaihi wasallam bersabda: \"Sesungguhnya yang dimaksud itu adalah kelapangan. Namun, barangsiapa yang diteliti betul hisabnya, maka ia kan binasa\".','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(104,104,'Kitab Ilmu','Hendaklah Orang yang Hadir Menyampaikan Ilmu kepada Orang yang Tidak Hadir. ','Dari Abu Syuraih bahwa dia berkata kepada \'Amru bin Sa\'id saat dia mengutus<br>rombongan ke Makkah, \"Wahai amir, izinkan aku menyampaikan satu persoalan yang pernah Nabi shallallahu \'alaihi wasallam sampaikan dalam khutbahnya saat pembebasan Makkah. Kedua telingaku mendengar, hatiku merasakannya dan kedua mataku melihat, beliau memuji Allah dan mensucikan Allah seraya bersabda: \'Sesungguhnya Makkah, Allah telah mensucikannya dan orang-orang (Musyrikin Makkah) tidak mensucikannya. Maka tidak halal bagi setiap orang yang beriman kepada Allah dan Hari Akhir menumpahkan darah di dalamnya, dan tidak boleh mencabut pepohonan di dalamnya. Jika seseorang minta keringanan karena peperangan yang pernah dilakukan oleh Rasulullah shallallahu \'alaihi wasallam di dalamnya maka katakanlah \'sesungguhnya Allah Ta\'ala telah mengizinkan Rasul-Nya dan tidak mengizinkan kepada kalian.\' Sesungguhnya Allah Ta\'ala telah mengizinkanku pada satu saat pada siang hari kemudian dikembalikan kesuciannya hari ini sebagaimana disucikannya sebelumnya. Maka hendaklah yang hadir menyampaikan kepada yang tidak hadir.\" Maka dikatakan kepada Abu Syuraih, \"Apa yang dikatakan \'Amr?\" Dia berkata, \"Aku lebih mengetahui dari padamu wahai Abu Syuraih \"Beliau tidak akan melindungi orang yang bermaksiat, orang yang menumpahkan darah dan orang yang mencuri.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(105,105,'Kitab Ilmu','Hendaklah Orang yang Hadir Menyampaikan Ilmu kepada Orang yang Tidak Hadir. ','Dari Abu Bakrah, disebutkan bahwasanya Nabi shallallahu \'alaihi wasallam bersabda: \"Sesungguhnya darah kalian, harta kalian, Muhammad berkata; menurutku beliau mengatakan, \"dan kehormatan kalian adalah haram atas kalian sebagaimana haramnya hari kalian ini di bulan kalian ini. Hendaklah yang hadir menyampaikan kepada yang tidak hadir.\" Dan Muhammad berkata, \"Benarlah Rasulullah shallallahu \'alaihi wasallam seperti apa yang disabdakannya, \'Bukankah aku telah menyampaikannya? \' beliau mengucapkannya dua kali.”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(106,106,'Kitab Ilmu','Dosa Orang yang Berdusta Atas Nama Nabi Shallallahu ‘alaihi wasallam ','(Dari) Rib\'i bin Hirasy ia berkata: “Aku mendengar Ali mengatakan, \'Nabi shallallahu \'alaihi wasallam bersabda: \"Janganlah kalian berdusta atas namaku, karena barangsiapa berdusta atas namaku maka hendaklah ia masuk neraka.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(107,107,'Kitab Ilmu','Dosa Orang yang Berdusta Atas Nama Nabi Shallallahu ‘alaihi wasallam ','Dari Amir bin Abdullah bin az-Zubair dari Ayahnya ia berkata, \"Aku berkata kepada az-Zubair, \"Aku belum pernah mendengar kamu membicarakan sesuatu dari Rasulullah shallallahu \'alaihi wasallam sebagaimana si fulan dan si fulan menceritakannya\" Az Zubair menjawab, \"Ketahuilah bahwa sungguh aku tidak pernah berpisah dari beliau, tetapi aku pernah mendengar beliau bersabda: \"Barangsiapa yang berdusta atas namaku maka hendaklah ia menempati tempat duduknya di neraka.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(108,108,'Kitab Ilmu','Dosa Orang yang Berdusta Atas Nama Nabi Shallallahu ‘alaihi wasallam ','(Dari) Anas ia berkata, \"Sesungguhnya yang menghalangiku untuk menyampaikan hadits-hadits banyak kepada kalian karena Nabi shallallahu \'alaihi wasallam bersabda: \"Barangsiapa sengaja berdusta terhadapku (atas namaku), maka hendaklah ia menempati tempat duduknya di neraka.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(109,109,'Kitab Ilmu','Dosa Orang yang Berdusta Atas Nama Nabi Shallallahu ‘alaihi wasallam ','Dari Salamah berkata, \"Aku mendengar Nabi shallallahu \'alaihi wasallam bersabda: \"Barangsiapa berkata tentangku yang tidak pernah aku katakan, maka hendaklah ia persiapkan tempat duduknya di neraka.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(110,110,'Kitab Ilmu','Dosa Orang yang Berdusta Atas Nama Nabi Shallallahu ‘alaihi wasallam ','Dari Abu Hurairah ia berkata, \"Aku mendengar Nabi shallallahu \'alaihi wasallam bersabda: \"Berikanlah nama dengan namaku dan jangan dengan julukanku. Karena barangsiapa melihatku dalam mimpinya sungguh dia benar-benar telah melihatku, karena setan tidak sanggup menyerupai bentukku. Dan barangsiapa berdusta terhadapku, maka hendaklah ia persiapkan tempat duduknya dalam neraka.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(111,111,'Kitab Ilmu','Menulis Ilmu ','Dari Abu Juhaifah ia berkata, \"Aku bertanya kepada Ali, \'Apakah engkau punya tulisan?’ Ia menjawab, \"Tidak, kecuali Kitabullah, atau pemahaman yang diberikan kepada seorang muslim, atau apa yang ada dalam shahifah ini. \'Ia (Abu Juhaifah) berkata, \'Aku berkata, \'Lalu apa yang ada dalam shahifah ini? Ali menjawab, \'(Mengenai)diikat dan dilepaskannya tawanan oerang, dan seorang muslim tidaklah dibunuh sebeb membunuh orang kafir’”.','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(112,112,'Kitab Ilmu','Menulis Ilmu ','Dari Abu Hurairah rhadiyallahu \'anhu, bahwa suku Khuza\'ah telah membunuh seorang laki-laki dari Bani Laits saat hari pembebasan Makka disebabkan terbunuhnya seseorang dari mereka yang dibunuh oleh Bani Laits. Rasulullah shallallahu \'alaihi wasallam diberitahukan tentng hal itu. Maka beliau lalu naik kendaraannya dan berkhutbah. Beliau bersabda: \"Sesungguhnya Allah telah membebaskan Makkah dari terjadinya pembunuhan, atau dari serangan pasukan gajah.\" Abu Abdillah ragu-ragu dalam menyampaikan hadits ini (dari pembunuhan tentara gajah) dan Dia memberikan kekuasaan kepada Rasulullah shallallahu \'alaihi wasallam dan orang-orang mukmin . Ketahuilah Sesungguhnya ia tidak halal bagi orang-orang sebelumku dan tidak halal bagi orang-orang sesudahku. Ketahuilah, dan pada saatku itu  haram, duri-durinya tidak boleh dipotong, pohonnya tidak boleh ditebang, barang temuannya tidak boleh diambil kecuali bagi orang yang ingin mencari pemiliknya. Barangsiapa yang keluarganya terbunuh, maka ada dua pilihan yang terbaik; pembunuhnya diikat, atau di qishasholeh keluarganya yang terbunuh. Seorang laki-laki dari penduduk Yaman berkata, \'Tuliskan untukku, wahai Rasulullah!’. Beliau bersabda \'Tulisalah untuk Abu fulan’. Seorang laki-laki dari suku Quraisy berkata, \'Kecuali idzkhir (sejenis rumput), wahai Rasulullah, karena kami menaruhnya di rumah-rumah dan kuburan-kuburan kami.’ Kemudian Nabi shallallahu \'alaihi wasallam bersabda, \'Kecuali Idzkhir’”.<br><br>Abu Abdullah, berkata, “Dikatakan lafazh yuqaadu (diqishash) dengan huruf qaf.” Maka dikatakan kepada Abu Abdillah, “Apayang beliau tuliskan untuknya? Ia menjawab, “Beliau menuliskan untuknya khutbah ini.”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(113,113,'Kitab Ilmu','Menulis Ilmu ','Berkata (rawi), “ Wahb bin Munabbih mengabarkan kepadaku dari tiga saudaranya, ia berkata, \'Aku mendengar Abu Hurairah mengatakan, \'Tidak ada seorang pun dari shahabat Nabi shallallahu \'alaihi wasallam yang lebih banyak meriwayatkan hadits beliau dari padaku, kecuali yang didapat dari Abdullah bin Amr, karena ia mencatat hadits, sedangkan aku tidak mencatatnya. ','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(114,114,'Kitab Ilmu','Menulis Ilmu ','Dari Ibnu \'Abbas berkata, \"Ketika Nabi shallallahu \'alaihi wasallam bertambah parah sakitnya, beliau bersabda: \"Berikanlah kepadaku kertas lalu aku tuliskan sesuatu kitab yang kalian tidak akan sesat setelah membacanya.\" Umar berkata, \"Sesungguhnya Nabi shallallahu \'alaihi wasallam sakit keras, dan kami hanya memiliki Kitabullah, dan kami merasa cukup. Maka para shahabat berselisih pendpat dan semakin gaduh. Umar berkata: \"Bangunlah, tidak pantas terjadi perdebatan di hadapanku.\" Maka Ibnu \'Abbas keluar seraya berkata, \"Sesungguhnya musibah itu adalah musibah, musibah, dan tidak menghalangi antara  Nabi dengan Kitabullah.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(115,115,'Kitab Ilmu','Mengajarkan Ilmu dan Memberi Peringatan pada Waktu Malam Hari ','Dari Ummu Salamah ia berkata, \"Pada suatu malam Nabi Rasululah shallallahu \'alaihi wasallam terbangun dari tidurnya, lalu beliau bersabda: \"Subhaanallah (Maha suci Allah), cobaan apakah yang diturunkan pada malam ini? Dan pembendaharaan apakah yang dibuka? Bangunkanlah para penghuni kamar, karena banyak orang yang berpakaian di dunia namun telanjang di akhirat.”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(116,116,'Kitab Ilmu','Berbicara di Malam Hari Mengenai Ilmu ','Dari Salim dan Abu Bakar bin Sulaiman bin Abu Hatsmah bahwa Abdullah bin Umar berkata, \"Rasulullah shallallahu \'alaihi wasallam shalat Isya bersama kami di akhir hayatnya. Setelah selesai memberi salam beliau berdiri dan bersabda: \"Bagaimana pendapat kalian tentang malam ini?. Sesungguhnya pada awal abad yang akan datang tidak akan ada yang masih tinggal seorang pun yang masih hidup dari orang-orang yang di atas muka bumi sekarang ini.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(117,117,'Kitab Ilmu','Berbicara di Malam Hari Mengenai Ilmu ','Dari Ibnu \'Abbas berkata, \"Aku menginap di rumah bibiku Maimunah, Dan Nabi shallallahu \'alaihi wasallam pada malam itu sedang gilir dirumahnya. Maka Rasulullah shallallahu \'alaihi wasallam melaksanakan shalat isya` (di masjid), kemudian beliau pulang ke rumahnya dan shalat empat rakaat. Kemudian beliau tidur. Lalu beliau bangun, dan berkata, “Anak kecil itu telah tidur’, atau kalimat yang serupa dengannya.\" Lantas beliau berdiri maka aku datang dan berdiri disebelah kiri beliau. Tapi beliau memindahkanku ke sebelah kanannya.Lantas beliau shalat lima rakaat, kemudian shalat dua rakaat. Kemudian beliau tidur lagi sampai-sampai aku mendengar dengkurannya, kemudian beliau keluar lagi mengerjakan shalat (shubuh).\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(118,118,'Kitab Ilmu','Menghafal Ilmu ','Dari Abu Hurairah ia berkata, \"Orang-orang mengatakan bahwa yang paling banyak meriwayatkan hadits adalah Abu Hurairah. Tapi seandainya saja tidak ada dua ayat dalam Kitabullah, niscaya aku tidak akan meriwayatkan satu hadits pun.\" Kemudian dia membaca ayat itu: \'Sesungguhnya orang-orang yang menyembunyikan apa yang telah Kami turunkan berupa bukti yang nyata sampai kepada firmanNya- hingga akhir ayat. \'Allah Maha Penyayang\' (QS. Al-Baqarah: 159-160). Sesungguhnya saudara-saudara kita dari kalangan Muhajirin, mereka disibukkan dengan aktivitas di pasar-pasar, dan saudara-saudara kita dari kalangan Anshar, mereka disibukkan dengan pekerjaan mereka dalam mendapatkan harta benda. Sedangkan Abu Hurairah mempersembahkan dirinya untuk Rasulullah shallallahu \'alaihi wasallam. Ia hadir dalam pengajian yang tidak mereka ikuti, dan menghafal apa yeng tidak mereka hafal. ','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(119,119,'Kitab Ilmu','Menghafal Ilmu ','Dari Abu Hurairah rhadiyallahu \'anhu, ia berkata, “Aku berkata, \'Wahai Rasulullah, Aku mendengar banyak hadits darimu yang terlupakan olehku. \'Beliau bersabda, \'Bentangkanlah jubahmu!’ Maka aku membentangjannya, dan beliau memotongnya dengan kedua tangan beliau, lalu berkata, \'Ikatlah!’ Maka aku ikat, dan setelah itu aku tidak pernah lupa lagi.  ','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(120,120,'Kitab Ilmu','Menghafal Ilmu ','Dari Abu Hurairah berkata, \"Aku menyimpan ilmu (hadits) dari Rasulullah shallallahu \'alaihi wasallam pada dua bejana. Salah satunya aku sebarkan, sedangkan lainnya jika aku sebarkan, maka akan terputuslah tenggorokan ini.”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(121,121,'Kitab Ilmu','Diam Memperhatikan Penjelasan Para Ulama','Dari Jarir, bahwa Nabi shallallahu \'alaihi wasallam bersabda kepadanya ketika haji Wada\', \'Suruhlah orang-orang untuk diam!’ Lantas beliau bersabda \"Janganlah kalian kembali setelah kematianku menjadi kafir, dimana sebagian kamu memukul tengkuk sebagian yang lainnya (saling membunuh).\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(122,122,'Kitab Ilmu','Apa yang Disunnahkan dari Orang Berilmu Apabila Ia Ditanya, “Siapakah Orang yang Paling Alim,” Agar Ia Menyerahkan Masalah Ilmu Tersebut Kepada Allah.” ','(Dari) Sa\'id bin Jubair berkata: “Aku berkata kepada Ibnu \'Abbas, \'Sesungguhnya Nauf al-Bakali menganggap bahwa Musa bukanlah Musa Bani Isra\'il, tapi Musa yang lain.’ Ibnu Abbas lalu berkata, \'Musuh Allah itu berdusta, sungguh Ubay bin Ka\'ab telah menceritakan kepada kami dari Nabi shallallahu \'alaihi wasallam: \'Musa berdiri untuk berkhutbah di depan Bani Isra\'il lalu dia ditanya: \'Siapakah orang yang paling pandai?’ Musa menjawab: \'Aku adalah orang yang paling tahu.’ Maka Allah menegurnya bahwa ia tidak mengembalikan bahwa ilmu itu adalah peberianNya. Maka Allah mewahyukan kepadanya bahwa ada seorang hamba di antara hamba-Ku yang tinggal di pertemuan antara dua lautan lebih tahu dari padamu. Musa berkata, \'Wahai Tuhanku, bagaimana aku bisa bertemu dengannya?’ Lalu dikatakan padanya: \"Bawalah seekor ikan di dalam keranjang yang terbuat dari daun kurma. Jika ikan itu hilang, maka disitulah orang itu berada’. Maka Musa dan seorang muridnya yang bernama Yusya\' bin Nun pergi dengan membawa ikan dalam sebuah keranjang yang terbuat dari daun kurma. Ketika keduanya sampai di sebuah batu besar, keduanya merebahkan kepalanya. Lalu ikan itu keluar dari keranjang itu dan kabur ke lautan. Musa dan muridnya terkejut.<br><br>Kemudian keduanya meneruskan perjalanan di sisa hari dan malamnya. Ketika waktu shubuh telah tiba, Musa berkata kepada muridnya, \'Mari kita makan, karena sunguh kita telah merasa keletihan dalam perjalanan ini. Musa tidak merasakan keletihan sampai ia melewati temoat yang diperintahkan kepadanya.  Maka muridnya berkata kepadanya: \'Tahukah engkau ketika kita istirahat di batu besar tadi? Sesungguhnya aku kehilangan ikan itu. Dan tidaklah yang melupakan aku ini kecuali setan)’. Musa berkata: \'Tempat itulah tempat yang kita cari’. Ketika keduanya sampai di batu besar tadi, ternyata disana ada seorang laki-laki mengenakan pakaian. Maka Musa memberi salam kepadanya. Khadir berkata, \'Bukankah memang di bumimu ini penuh dengan keselamatan?’ Musa berkata \'Aku adalah Musa’. Khadir berkata, \'Musa dari Bani Isra\'il?’ Ia menjawab, \"Ya\". Musa berkata: \'Bolehkah aku mengikutimu agar engkau mengajarkan kepadaku apa yang telah diajarkan kepadamu yang berupa petunjuk? Ia menjawab: \'Sesungguhnya engkau tidak akan bisa sabar bersamaku. Hai Musa sesungguhnya aku memiliki suatu ilmu yang diajarkan Allah kepadaku dan tidak kamu ketahui. Dan engkau juga memiliki suatu ilmu yang diajarkanNya kepadamu dan tidak aku ketahui’. Musa berkata: \'Insya’allah kamu akan mendapati aku sebagai orang yang sabar, dan aku tidak melanggar perintahmu. <br><br>Maka keduanya berjalan kaki di tepi pantai sementara keduanya tidak memiliki perahu, lalu melintaslah sebuah perahu kapal. Mereka berbicara agar orang-orang yang ada di perahu itu mau membawa keduanya. Karena Khadlir telah dikenali maka mereka pun membawa keduanya dengan tanpa bayaran. Kemudian datang burung kecil hinggap di sisi perahu mematuk-matuk di air laut untuk minum dengan satu atau dua kali patukan. Khadir lalu berkata, \'Wahai Musa, ilmuku dan ilmumu bila dibandingkan dengan ilmu Allah tidaklah seberapa kecuali seperti patukan burung ini di air lautan.’ Kemudian Khadir sengaja mengambil papan perahu lalu merusaknya. Musa pun berkata, \'Mereka telah membawa kita dengan tanpa bayaran, tapi kenapa kamu merusaknya untuk menenggelamkan penumpangnya?’ Khidlir berkata: \'Bukankah aku telah berkata, sesungguhnya kamu sekalikali tidak akan sabar bersama dengan aku\'. Musa menjawab: \'Janganlah kamu menghukum aku karena kelupaanku dan janganlah kamu membebani aku dengan sesuatu kesulitan dalam urusanku\'. Kejadian pertama ini karena Musa terlupa. <br><br>Kemudian keduanya pergi hingga bertemu dengan anak kecil yang sedang bermain dengan dua temannya. Khadir lalu memegang kepala anak itu dari bagian atasnya lalu membunuhnya. Maka Musa pun bertanya: \'Mengapa kamu membunuh jiwa yang bersih, bukan karena dia membunuh orang lain \'. Khadir menjawab: \'Bukankah sudah kukatakan kepadamu, bahwa sesungguhnya kamu tidak akan dapat sabar bersamaku? \'. Ibnu \'Uyainah berkata, \"Ini lebih tegas lagi’,  Lalu keduanya berjalan hingga tatkala keduanya sampai kepada penduduk suatu negeri, mereka minta dijamu kepada penduduk negeri itu, tetapi penduduk negeri itu tidak mau menjamu mereka. Kemudian keduanya mendapatkan dalam negeri itu dinding rumah yang hampir roboh. Maka Khadir menegakkan dinding itu\'. Lalu Musa berkata kepadanya, Seandainya engkau mau, engkau bisa  mengambil upah darinya. Khadir menjawab, \'Inilah saat perpisahan antara aku dan kamu\' . Nabi shallallahu \'alaihi wasallam bersabda: \"Semoga Allah merahmati Musa. Seandainya saja ia sabar, maka akan terdapat kisah yang lebih dari keduanya.”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(123,123,'Kitab Ilmu','Orang yang Bertanya Sambil Berdiri, Sedang Orang yang Berilmu Duduk','Dari Abu Musa berkata, \"Seorang laki-laki datang kepada Nabi shallallahu \'alaihi wasallam dan berkata, \"Wahai Rasulullah, apakah berperang dijalan Allah itu? Karena sesungguhnya di antara kami ada yang berperang karena marah dan ada pula yang berperang karena menjaga gengsi. Maka beliau mengangkat kepalanya -Ia Abu Musa berkata, \'Dan tidaklah beliau mengangkat kepalanya melainkan karena laki-laki itu berdiri- lalu beliau bersabda: \"Barangsiapa berperang untuk meninggikan kalimat Allah, maka dialah orang yang berperang di jalan Allah \'azza wajalla.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(124,124,'Kitab Ilmu','Bertanya atau Memberi Fatwa Ketika Sedang Melempar Jumrah ','Dari Abdullah bin Amr berkata, \'Aku melihat Nabi shallallahu \'alaihi wasallam ditanya seseorang pada waktu beliau sedang melempar jumrah’. \'Wahai Rasulullah, aku telah menyembelih hewan sebelum melempar jumrah?’ Beliau lalu bersabda: \'Lemparlah jumrah, dan kamu tidaklah berdosa.’ Kemudian datang orang lain dan bertnya, \'Wahai Rasulullah, aku mencukur sebelum menyemblih kurban’. Beliau menjawab: \'Sembelihlah dan kamu tidak berdosa.\" Dan tidaklah beliau ditanya tentang sesuatu hal yang didahulukan dan diakhirkan melainkan beliau menjawabnya: \'Lakukanlah dan kamu tidak berdosa.’','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(125,125,'Kitab Ilmu','Firman Allah Ta’ala : “Dan Tidaklah Kamu Diberi Pengetahuan Melainkan Hanya Sedikit.” ','Dari \'Abdullah (bin Mas’ud) berkata, \'Ketika aku berjalan bersama Nabi shallallahu \'alaihi wasallam di reruntuhan di Madinah, sedang beliau membawa bersandar pada sebatang tongkat dari pelepah kurma yang dibawanya, maka lewatlah sekelompok orang Yahudi. Sebagian mereka berkata kepada sebagian lainnya, \'Tanyakanlah kepadanya tentang ruh!’ Sebagian yang lain berkata, \"Janganlah kalian bicara dengannya hingga ia akan mengatakan sesuatu yang kalian tidak menyukainya.\" Lalu sebagian yang lain berkata, \"Sungguh, kami benar-benar akan bertanya kepadanya.\" Maka berdirilah seorang laki-laki dari mereka seraya bertanya, \"Wahai Abul Qasim (Nabi shallallahu \'alaihi wasallam), apakah ruh itu?\" Beliau terdiam. Aku berkata, \"Sesungguhnya beliau sedang menerima wahyu.\" Kemudian aku berdiri ditempatku. Ketika wahyu itu telah jelas, beliau membaca, .’Dan mereka bertanya kepadamu tentang ruh. Katakanlah, \'Ruh itu adalah urusan Tuhanku’ (QS al-Israa’ : 85) Dan mereka (Yahudi) tidaklah diberi ilmu melainkan hanya sedikit. ','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(126,126,'Kitab Ilmu','Orang yang Meninggalkan Sebagian Ikhtiar Karena Takut Sebagian Orang Kurang Memahaminya Lalu Mereka Jatuh ke dalam Sesuatu yang Lebih Berat Darinya.','Dari al-Aswad ia berkata, \'Ibnu az-Zubair berkata kepadaku, \'Aisyah sering menyampaikan kabar rahasia kepadamu, maka apakah yang terjadi padamu di Ka\'bah?\" Aku menjawab, \'Aisyah berkata kepadaku, \'Rasulullah shallallahu \'alaihi wasallam bersabda, \'Hai Aisyah, jikalau tidaklah karena kaummu masih baru (memeluk agama Islam), niscaya kurombak Ka’bah. Akan kubuat dua pintu, satu pintu masuk dan satunya lagi pintu kelua’. Maka kemudian Ibnu az-Zubair melaksanakan hal itu (pada masa pemerintahannya).”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(127,127,'Kitab Ilmu','Orang yang Mengkhususkan Memberi Ilmu kepada Sekelompok Orang dan Tidak kepada Sekelompok Lainnya Karena Dikhawatirkan Kelompok Lain itu Tidak Mampu Memahaminya. ','Telah menceritakan kepada kami Ubaidullah bin Musa dari Ma\'ruf bin Kharrabudz dari Abu Ath Thufail dari Ali riwayat yang sama.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(128,128,'Kitab Ilmu','Orang yang Mengkhususkan Memberi Ilmu kepada Sekelompok Orang dan Tidak kepada Sekelompok Lainnya Karena Dikhawatirkan Kelompok Lain itu Tidak Mampu Memahaminya. ','Dari Qatadah ia berkata, \'Anas bin Malik menceritakan kepada kami, bahwasanya ketika Mu\'adz sedang membonceng Nabi shallallahu \'alaihi wasallam di atas kendaraan, beliau berkata: \'Wahai Mu\'adz bin Jabal!\". Ia menjawab, \'Ya Rasulullah, aku memenuhi panggilanmu.\" Dan kebahagiaan bagimu (ia mengucapkannya tiga kali). Beliau berkata lagi, \'Tidaklah seorang yang bersaksi bahwa tidak ada Tuhan yang berhak disembah selain Allah, dan Muhammad adalah utusan Allah dengan benar-benar jujur dari dalam hatinya, melainkan Allah akan mengharamkan neraka atasnya.’. Ia berkata, \'Wahai Rasulullah, haruskah aku memberitahukannya kepada orang-orang supaya mereka bergembira?’ Beliau menjawab, \'Kalau begitu, mereka akan menyerah (tidak berusaha apa-apa)’. Maka ia (Mu’adz) memberitahukannya ketika beiau hampir meninggal dunia karena takut berdosa. ','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(129,129,'Kitab Ilmu','Orang yang Mengkhususkan Memberi Ilmu kepada Sekelompok Orang dan Tidak kepada Sekelompok Lainnya Karena Dikhawatirkan Kelompok Lain itu Tidak Mampu Memahaminya. ','(Dari) Mu\'tamir berkata, \'Aku mendengar ayahnku berkata,’Aku mendengar Anas bin Malik berkata, \'Diiceritakan kepadaku bahwa Nabi shallallahu \'alaihi wasallam pernah kepada Mu’adz, \'Barangsiapa yang menemui Allah (meninggal) dalam keadaan tidak menyekutukan-Nya dengan sesuatu apapun, maka dia akan masuk surga.’ Mu\'adz berkata, \'Apakah hal ini mesti aku beritahukan kepada orang-orang?\" Beliau menjawab: \"Jangan, karena aku khawatir mereka akan bersandar pada hadit itu saja (tidak berusaha apa-apa ).\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(130,130,'Kitab Ilmu','Malu dalam Menuntut Ilmu ','Dari Ummu Salamah ia berkata, “Ummu Sulaim datang menemui Rasulullah shallallahu \'alaihi wasallam dan berkata, \"Wahai Rasulullah, sesungguhnya Allah tidak malu akan kebenaran. Apakah bagi wanita wajib mandi jika ia bermimpi?\" Nabi shallallahu \'alaihi wasallam menjawab: \"Ya, jika dia melihat air.\" Ummu Salamah lalu menutupi wajahnya seraya bertanya, \"Wahai Rasulullah, apakah seorang wanita itu bermimpi?\" Beliau menjawab: \"Ya. Kalau tidak, bagaimana anaknya bisa mirip dengannya?”.','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(131,131,'Kitab Ilmu','Malu dalam Menuntut Ilmu ','Dari Abdullah bin Umar, bahwasanya Rasulullah shallallahu \'alaihi wasallam bersabda: \'Sesungguhnya di antara pohon-pohon ada satu pohon yang tidak jatuh daunnya, dan itu adalah perumpamaan bagi seorang Muslim. Ceritakan kepadaku pohon apakah itu?\" Maka orang-orang menabak-nebak dari pepohonan yang ada di perkampungan. Sedang aku menebaknya dalam hati bahwa pohon itu adalah pohon kurma.Tapi aku malu untuk menyebutkannya. Lalu mereka berkata, \'Wahai Rasulullah, beritahukanlah kami tentang itu!’. Beliau menjawab: \'Yaitu pohon kurma.’ Abu Abdullah berkata, \"Lalu aku menceritakan kepada ayahku tantang yang aku tebak dalam hatiku. Maka ia menjawab, \'Jika saja kamu menguatakannya, maka itu lebih aku sukai daripada kamu hanya menceritakannya begini dan begini kepadaku. ','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(132,132,'Kitab Ilmu','Orang yang Malu Bertanya Kemudian Menyuruh Orang Lain untuk Menanyakannya','Dari Ali bin Abu Thalib berkata, \"Aku adalah seorang laki-laki yang mudah mengeluarkan madzi, lalu aku menyuruh Miqdad untuk menanyakannya kepada Rasulullah shallallahu \'alaihi wasallam. Maka Miqdad menanyakannya. Kemudian beliau menjawab: \"Padanya wajib  wudhu.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(133,133,'Kitab Ilmu','Memberikan Ilmu dan Fatwa di dalam Masjid ','Dari Abdullah bin Umar, bahwasanya seorang laki-laki berdiri di masjid lalu bertanya, \'Wahai Rasulullah, dari manakah engkau menyuruh kami memulai berihram?’. Maka Rasulullah shallallahu \'alaihi wasallam menjawab: \'Penduduk Madinah memulai berihram dari Dzul Hulaifah, penduduk Syam memulai dari Juhfah, dan penduduk memulai berihram dari Najd dari Qarn.’ Ibnu Umar berkata, \'Orang-orang mengira bahwa Rasulullah shallallahu \'alaihi wasallam bersabda, \'Penduduk Yaman berihram dari Yalamlam.\" Ibnu Umar juga mengatakan, \'Aku tidak tahu bahwa hal ini dari Rasulullah’.','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(134,134,'Kitab Ilmu','Orang yang Menjawab Si Penanya dengan Berlebihan dari Apa yang Ditanyakannya. ','Dari Ibnu \'Umar dari Nabi shallallahu \'alaihi wasallam, bahwa ada seorang laki-laki bertanya kepada beliau, \'Apakah yang dipakai oleh orang yang sedang berihram?\" Beliau menjawab: \"Dia tidak boleh memakai jubah, imamah (surban yang dililitkan pada kepala), celana, jubah yang mempunyai penutup kepala, dan kain yang dicelup wenter atau za\'faran. Jika dia tidak mempunyai sandal, maka hendaklah ia memotongnya hingga berada dibawah mata kaki.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(135,135,'Kitab Wudhu','Tidak Diterima Shalat Tanpa Bersuci  ','Dari Abu Hurairah ia berkata, \'Rasulullah shallallahu \'alaihi wasallam bersabda, \'Tidaklah diterima shalat seseorang yang berhadats hingga dia berwudhu.’ Seorang laki-laki dari Hadramaut berkata, \'Apa yang dimaksud dengan hadats wahai Abu Hurairah?’ Abu Hurairah menjawab, \'Kentut yang bunyi ataupun yang tidak bunyi.’','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(136,136,'Kitab Wudhu','Keutamaan Wudhu, san Orang-Orang yang Putih, Berseri Wajah, Tangan, dan Kakinya Karena Bekas Wudhu. ','Dari Nu\'aim bin Al Mujmir, ia berkata, \'Aku naik ke atas  masjid bersama Abu Hurairah, lalu dia berwudhu dan lalu berkata, \'Sesungguhnya aku mendengar Nabi shallallahu \'alaihi wasallam bersabda: \'Sesungguhnya umatku akan dipanggil pada hari kiamat nanti dalam keadaan putih berseri karena bekas wudhu. Maka barangsiapa yang sanggup untuk memperpanjang putihnya (dari bekas wudhu, maka lakukanlah.’ ','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(137,137,'Kitab Wudhu','Keutamaan Wudhu, san Orang-Orang yang Putih, Berseri Wajah, Tangan, dan Kakinya Karena Bekas Wudhu. ','Dari Abbad bin Tamim dari Pamannya, bahwasanya ia menanyakan kepada Rasulullah shallallahu \'alaihi wasallam, tentang seseorang yang merasakan sesuatu (ingin kentut) ketika shalatnya. Beliau lalu bersabda: \"Janganlah ia menoleh atau berpaling kecuali ia mendengar suaranya, atau mencium baunya.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(138,138,'Kitab Wudhu','Meringankan dalam Berwudhu ','Dari Ibnu \'Abbas, bahwa Nabi shallallahu \'alaihi wasallam tidur sampai mendengkur kemudian beliu  shalat -barangkali Ibnu Abbas mengatakan-, \'Beliau berbaring sampai mendengkur, kemudian beliau berdiri dan shalat’. <br><br>Dari Ibnu \'Abbas ia berkata, \"Pada suatu malam aku pernah menginap di rumah bibiku, Maimunah (istri Nabi shallallahu \'alaihi wasallam). Pada malamnya, Rasulullah bangun. Setelah lewat tengah malam, Nabi shallallahu \'alaihi wasallam berdiri lalu berwudhu dari tempat air yang idagntungkan dengan wudhu yang ringan -Amr menganggapnya ringan dan sedikit- lalu beliau berdiri dan shalat. Maka aku berwudhu seperti wudhu beliau. Kemudian aku menghampiri beliau dan berdiri shalat disebelah kiri beliau, tetapi beliau memindahkanku ke sebelah kanan beliau. Lalu beliau mengerjakan shalat sebanyak yang dikehendaki Allah.  Kemudian beliau berbaring dan tidur hingga mendengkur. Kemudian muadzin mendatangi untuk memberitahukan beliau bahwa waktu shalat Shubuh telah tiba. Lalu muadzin itu berdiri bersama beliau,  kemudian beliau shalat padahal beliau belum berwudhu lagi. <br><br>Kami berkata kepada Amr (rawi), \'Sesungguhnya orang-orang mengatakan bahwasanya Rasulullah shallallahu \'alaihi wasallam itu tertidur matanya, namun hatinya tetap terjaga.’ Amr berkata, \'Aku mendengar Ubaid bin Umair berkata, \'Mimpinya para nabi itu adalah wahyu.’ Kemudian ia membacakan ayat: \'Sesungguhnya aku (Ibrahim) bermimpi (wahai anakku) bahwa aku menyembelihmu (segala kurban untuk Allah).” (QS ash-Shaaffat :102)','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(139,139,'Kitab Wudhu','Meringankan dalam Berwudhu ','Dari Kuraib pembantu Ibnu \'Abbas, dari Usamah bin Zaid, sesungguhnya ia (Kuraib) mendengarnya (Usamah )berkata, \'Rasulullah shallallahu \'alaihi wasallam kembali dari Arafah, dan ketika sampai di  Syi’b beliau berhenti dan buang air kecil. Kemudian beliau berwudhu dan tidak menyempurnakan wudhunya. Maka aku (Usamah) berkata, \'Apakah waktu telah tiba, wahai Rasulullah?\' Beliau menjawab: \'Waktu shalat sudah didepanmu (sudah dekat).’  Lantas beliau naik kendaraan lagi. Ketika sampai di Muzdalifah, beliau berhenti dan berwudhu. Beliau menyempurnakan wudhunya. Kemudian di iqamahi  shalat, lalu beliau mengerjakan shalat maghrib. Kemudian semua orang menambatkan untanya  ditempat mereka berhenti, lalu diiqamahi shalat isya. Maka kemudian beliau shalat isya`, dan beliau tidak mengerjakan shalat (sunnah) di antara keduanya.’','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(140,140,'Kitab Wudhu','Membasuh Muka dengan Kedua Belah Tangan dengan Seciduk Air','Dari Ibnu \'Abbas, bahwasanya dia berwudhu\'. Ia membasuh mukanya, lalu mengambil seciduk air lalu berkumur-kumur dan menghirup air ke dalam hidungnya. Kemudian ia mengambil seciduk lagi dan menjadikannya seperti itu. IA menuangkannnya ketangannya yang lain lalu membasuh mukanya. Kemudian ia mengambil seciduk lagi, lalu membasuh tangan kanannya.  Kemudia ia mengambil seciduk lagi, lalu membasuh tangan kirinya. Kemudian ia mengusap kepalanya. Ia mengambil seciduk lagi, lalu menyiramkannya pada kaki kanannya sambil membasuhnya. Kemudian ia mengambil seciduk lagi, lalu membasuh kaki kirinya. Kemudian ia berkata, \'Beginilah aku melihat Rasulullah shallallahu \'alaihi wasallam berwudhu.’','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(141,141,'Kitab Wudhu','Membaca Basmalah dalam Setiap Keadaan dan Juga Ketika Hendak Bersetubuh ','Dari Ibnu Abbas, ia menyampaikan hal itu dari Nabi shallallahu \'alaihi wasallam, beliau bersabda: \"Seandainya seorang dari kalian ingin mendatangi isterinya (untuk bersetubuh), dengan membaca: \'Bismillahi, Allahumma jannibina asy-syaithaana wa jannibisyi-syaithaana maa razaqtanaa (Dengan menyebut nama Allah, ya Allah, jauhkanlah kami dari syetan dan jauhkanlah syetan dari apa yang Engkau karuniakan kepada kami).’ Lalu mereka dikaruniai anak, maka syetan tidak akan mencelakakannnya.’','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(142,142,'Kitab Wudhu','Apa yang Dibaca Ketika Hendak Masuk WC','Dari Abdul \'Aziz bin Shuhaib berkata, aku mendengar Anas berkata, \" Nabi shallallahu \'alaihi wasallam apabila hendak masuk kamar kecil, beliau membaca, \'Allahumma inni a\'uudzu bika minal khubutsi wal khabaaitsi (Ya allah, sesungguhnya aku berlindung kepada-Mu dari syetan laki-laki dan syetan perempuan).’ <br><br>Riwayat ini diikuti oleh Ibnu \'Ar\'arah dan Syu\'bah. Ghundar meriwayatkan dari Syu\'bah, \'Apabila beliau mendatangi kamar kecil.’ Musa meriwayatkan dari Hammad, \'Apabila beliau masuk.’ Dan Sa\'id bin Zaid berkata, \'Telah bercerita kepada kami Abdul Aziz, ia meriwayatkan \'Apabila hendak mamu masuk’.','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(143,143,'Kitab Wudhu','Menaruh Air di Dekat Kamar Kecil ','Dari Ibnu \'Abbas, bahwa pernah Nabi shallallahu \'alaihi wasallam masuk kedalam kamar kecil, lalu aku menaruh air wudhu untuknya. Beliau bertanya: \"Siapa yang menaruh ini?\" Maka beliau diberitahu, dan kemudian  beliau bersabda: \"Ya Allah pandaikanlah ia dalam agama.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(144,144,'Kitab Wudhu','Tidak Boleh Menghadap Kiblat Ketika Buang Air Besar dan Kecil Kecuali berada dalam Bangunan yang Memiliki Dinding atau yang Sejenisnya. ','Dari Abu Ayyub al-Anshari, ia berkata, \'Rasulullah shallallahi \'alaihi wasallam bersabda, \'Apabila seseorang dari kalian mendatangi tempat buang air besar, maka janganlah ia menghadap kiblat dan membelakanginya, tetapi menghadaplah ke arah timur atau ke arah barat.’','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(145,145,'Kitab Wudhu','Orang yang Buang Air Besar dengan Duduk di Dua Buah Batu. ','Dari Abdullah bin Umar bahwa ia berkata, \"Sesungguhnya orang-orang yang mengatakan, \'Apabila kamu duduk untuk buang air besar, maka janganlah menghadap ke kiblat, dan jangan pula ke Baitul Maqdis.’ Abdullah bin Umar berkata, \'Sungguh pada suatu hari aku pernah naik ke atap rumah kami. Kemudian aku melihat Rasulullah shallallahu \'alaihi wasallam duduk diatas dua buah batu menghadap ke Baitul Maqdis untuk buang air besar. Dia berkata, \'Barangkali kamu termasuk orang-orang yang shalat di atas pangkal paha.’ Aku menjabab, \'Demi Allah, aku tidak tahu’. <br><br>Malik berkata, \'Yakni orang yang shalat tanpa mengangkat tubuhnya dari tanah, dia sujud dengan menempel di tanah.’ ','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(146,146,'Kitab Wudhu','Keluarnya Para Wanita Untuk Buang Hajat ','Dari \'Aisyah, bahwa jika isteri-isteri Nabi shallallahu \'alaihi wasallam ingin buang hajat, mereka keluar pada waktu malam menuju tempat buang hajat yang berupa tanah lapang dan terbuka. Umar pernah berkata kepada Nabi shallallahu \'alaihi wasallam, \"Buatkanlah tirai-tiraia untuk isterimu.\" Akan tetapi, Nabi shallallahu \'alaihi wasallam tidak melakukannya. Mak pada suatu malam di waktu isya Saudah binti Zam\'ah, isteri Nabi shallallahu \'alaihi wasallam, keluar, dan Saudah adalah seorang wanita yang bertubuh tinggi. Kemudian Umar memanggilnya dan berkata, \"Ketahuilah, sesungguhnya kami tetap mengenalimu wahai Saudah!’ Dengan harapan akan turun ayat tentang berhijab. Maka Allah menurunkan ayat tentang hijab.  ','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(147,147,'Kitab Wudhu','Keluarnya Para Wanita Untuk Buang Hajat ','Dari Aisyah rhadiyallahu \'anhu dari Nabi shallallahu \'alaihi wasallam beliau bersabda, “Telah diperbolehkan untuk kalian keluar (pada malam hari) untuk buang hajat.” Hisyam berkata, “Yakni buang air besar.”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(148,148,'Kitab Wudhu','Buang Air Besar di Dalam Rumah ','Dari Abdullah bin Umar berkata, \"Sungguh pada suatu hari aku pernah naik ke atap rumah Hafshah karena untuk suatu keperluan. Kemudian aku melihat Rasulullah shallallahu \'alaihi wasallam sedang buang hajat membelakangi kiblat menghadap ke Syam.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(149,149,'Kitab Wudhu','Buang Air Besar di Dalam Rumah ','Dari Muhammad bin Yahya bin Hibban sesungguhnya pamannya Wasi\' bin Hibban mengabarkan kepadanya bahwa Abdullah bin Umar mengabarkan kepadanya seraya berkata, \"Sungguh pada suatu hari aku pernah naik ke atap rumah kami. Kemudian aku melihat Rasulullah shallallahu \'alaihi wasallam duduk di atas dua batu menghadap Baitul Maqdis.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(150,150,'Kitab Wudhu','Beistinja’ (Bersuci Setelah Buang Hajat) dengan Air. ','Dari Abu Mu\'adz dan -namanya adalah \'Atha bin Abu Maimunah- ia berkata, \"Aku mendengar Anas bin Malik berkata, \"Apabila Nabi shallallahu \'alaihi wasallam keluar untuk buang hajat, maka aku dan seorang anak temanku membawakan tempat air, yakni untuk istinja’ beliau.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(151,151,'Kitab Wudhu','Orang yang Membawa Air untuk Bersuci ','Dari Abu Mu\'adz -namanya adalah \'Atha\' bin Abu Maimunah- ia berkata, \"Aku mendengar Anas berkata, \"Apabila Rasulullah shallallahu \'alaihi wasallam keluar untuk buang hajat, maka aku dan seorang anak kami mengikuti beliau dengan membawakannya tempat air.”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(152,152,'Kitab Wudhu','Membawa Tongkat dan Air pada Waktu Beristinja’','Dari \'Atha\' bin Abu Maimunah ia mendengar Anas bin Malik berkata, \"Rasulullah shallallahu \'alaihi wasallam masuk kamar kecil untuk buang hajat, maka aku dan seorang anak kami membawakan tempat air dan tongkat, lau beliau beristinja’ dengan air.  Riwayat ini diikuti oleh Nadhr dan Syadzan dari Syu\'bah.”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(153,153,'Kitab Wudhu','Larangan Beristinja’ dengan Tangan Kanan ','Dari Abdullah bin Abu Qatadah dari ayahnya ia berkata, \"Rasulullah shallallahu \'alaihi wasallam telah bersabda: \"Jika salah seorang dari kalian minum, maka janganlah ia bernafas dalam gelas. Dan apabila ia mendatangi kamar kecil, maka janganlah dia menyentuh kemaluannya dengan tangan kanannya dan jangan pula mengusapnya (membersihkan) dengan tangan kanannya.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(154,154,'Kitab Wudhu','Tidak Boleh Memegang Kemaluan dengan Tangan Kanan Ketika Kencing ','Dari Abdullah bin Abu Qatadah dari ayahnya dari Nabi shallallahu \'alaihi wasallam, beliau bersabda: \"Apabila seseorang dari kalian kencing, maka janganlah ia memegang kemaluannya dengan tangan kanannya. Jangan pula ia beristinja\' dengan tangan kanannya. Dan janganlah ia bernafas di dalam bejana (ketika minum).”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(155,155,'Kitab Wudhu','Beriistinja dengan Menggunakan Batu ','Dari Abu Hurairah ia berkata, \"Aku mengikuti Nabi shallallahu \'alaihi wasallam saat beliau keluar untuk buang hajat, dan beliau tidak menoleh (ke kanan atau ke kiri) hingga aku pun mendekatinya. Lalu Beliau bersabda: \"Carikan untukku batu untuk aku gunakan beristinja\' dan jangan bawakan tulang atau kotoran hewan.\" Lalu aku datang kepada beliau dengan membawa kerikil di ujung pakainku, batu tersebut aku letakkan di samping beliau dan aku menjauh dari beliau. Setelah selesai beristinja’ beliau gunakan batu-batu tadi, maka aku mengikuti beliau.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(156,156,'Kitab Wudhu','Tidak Boleh Beristinja dengan Menggunakan Kotoran Hewan ','Dari Abu Ishaq ia berkata, “Bukan Abu Ubaidah yang menyebut hadits (ini) tapi Abdurrahman bin al-Aswad, dari ayahnya yang mendengar bahwa Abdullah berkata, “Nabi shallallahu \'alaihi wasallam pergi untuk buang air besar, lalu beliau menyuruhku untuk membawakan kepadnya tiga buah batu. Akan tetapi aku hanya menemukan dua buah batu saja. Aku sudah mencari batu yang ketiga, namun aku tidak menemukannya. Lantas aku mengambil kotoran hewan, lalu aku membawanya kepada beliau. Tapi beliau hanya mengambil dua buah batu ditu dan membuang kotoran hewan tadi, llu beliau bersabda, \'Ini adalah kotoran’”.','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(157,157,'Kitab Wudhu','Berwudhu itu Satu Kali Satu Kali ','Dari Ibnu \'Abbas berkata, \"Nabi shallallahu \'alaihi wasallam berwudhu\' satu kali satu kali.”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(158,158,'Kitab Wudhu','Berwudhu itu Dua kali Dua Kali','Dari Abdullah bin Zaid, bahwa Nabi shallallahu \'alaihi wasallam berwudhu dua kali dua kali.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(159,159,'Kitab Wudhu','Berwudhu itu Tiga Kali Tiga Kali','Dari Ibnu Syihab, sesungguhnya Atha’ bin Zayid mengabarkan kepadanya bahwa Humran, bekas hamba sahaya Utsman, memberitahunya bahwa ia melihat Utsman bbin Affan meminta bejana yang berisi air, lalu ia menuangkannya ke kedua telapak tangannya tiga kali dan mencucinya. Kemudian ia memasukkan tangan kanannya ke dalam bejana, lalu berumur-kumur dan menghirup air kedalam hidungnya. Kemudian ia membasuh mukanya tiga kali, lalu membasuh kedua tangannya sampai sikunya sebanyak tiga kali. Kemudian ia mengusap kepalanya, lalu membasuh kedua kakinya sampai kedu mata kakinya. Lantas ia berkata, \'Rasulullah shallallahu \'alaihi wasallam bersabda, “Barangsiapa yang berwudhu seperti wudhuku ini, lalu shalat dua rakaat dengan khusyu’, maka diampuni dosa-dosanya yang telah lalu.”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(160,160,'Kitab Wudhu','Berwudhu itu Tiga Kali Tiga Kali','Ibnu Syihab berkata, “Tetapi Urwah menceritakan dari Humran, \"Ketika \'Utsman berwudhu, dia berkata, \"Maukah aku ceritakan kepada kalian sebuah hadits yang kalau bukan karena ada satu ayat al-Qur’an, tentu aku tidak akan menceritakannya kepada kalian? Aku mendengar Nabi shallallahu \'alaihi wasallam bersabda: \"Tidaklah seorang laki-laki berwudhu dengan baik kemudian ia mengerjakan suatu shalat, melainkan diampuni dosa-dosanya yang ada diantara  wudhu dan shalatnya sampai ia mengerjakan shalat itu.” Urwah berkata, \"Ayat itu adalah: \'Innalladziina yaktumuuna maa anzalna minal bayyinaati (Sesungguhnya orang-orang yang menyembunyikan apa Kami turunkan berupa keterangan-keterangan yang jelas.” (QS. al-Baqarah: 159)','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(161,161,'Kitab Wudhu','Ber-istinstsar (Menghirup Air ke dalam Hidung dan Mengeluarkannya Kembali) pada saat Berwudhu','Dari Az Zuhri ia berkata, telah mengabarkan kepadaku Abu Idris bahwa dia mendengar Abu Hurairah dari Nabi shallallahu \'alaihi wasallam, bahwa beliau bersabda: \"Barangsiapa berwudhu hendaklah ia menghirup air ke dalam hidung dan mengeluarkannya kembali. Dan barangsiapa yang beristijmar (bersuci dari buang air besar, maka hendaklah ia melakukannya dengan (batu yang berjumlah) ganjil.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(162,162,'Kitab Wudhu','Ber-istinstsar (Menghirup Air ke dalam Hidung dan Mengeluarkannya Kembali) pada saat Berwudhu','Dari Abu Hurairah, bahwa Rasulullah shallallahu \'alaihi wasallam bersabda: \"Jika salah seorang dari kalian berwudhu hendaklah dengan menghirup air ke dalam hidung dan mengeluarkannya kembali. Barangsiapa yang bersuci dari buang air besar dengan batu yang berjumlah ganjil. Dan seseorang dari kalian bangun dari tidurnya, maka hendaklah ia membasuh tangannya sebelum ia memasukkannya dalam air wudhunya, karena sesungguhnya seseorang diantara kalian tidak tahu dimana tangannya bermalam.”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(163,163,'Kitab Wudhu','Membasuh Kedua Kaki, Bukan Mengusapnya','Dari Abdullah bin Amr berkata, \"Nabi shallallahu \'alaihi wasallam tertinggal dari kami dalam suatu perjalanan yang kami tempuh, lalu beliau menyusul kami dan kami terdesak hampir kehabisan waktu shalat Ashar, maka kami berwudhu dan hanya mengusap kaki kami. Lalu beliau berseru dengan suara yang sangat keras, \"Celakalah bagi tumit-tumit karena (siksa) api neraka.” Beliau mengucapkannya dua kali atau tiga kali.”  ','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(164,164,'Kitab Wudhu','Berkumur-Kumur pada Waktu Berwudhu ','Dari Humran mantan budak Utsman bin Affan, bahwasanya ia melihat Utsman bin Affan meminta untuk diambilkan air wudhu. Ia lalu menuangkan air dari bejananya ke kedua tangannya, lalu ia basuh kedua tangannya tersebut hingga tiga kali. Kemudian ia memasukkan tangan kanannya ke dalam air wudhunya, kemudian berkumur, memasukkan air ke dalam hidung dan mengeluarkannya. Kemudian membasuh mukanya tiga kali, membasuh kedua lengannya hingga siku tiga kali, mengusap kepalanya lalu membasuh setiap kakinya tiga kali. Setelah itu ia berkata, \"Aku telah melihat Nabi shallallahu \'alaihi wasallam berwudhu seperti wudhuku ini, beliau lalu bersabda: \"Barangsiapa berwudhu seperti wudhuku ini, kemudian dia shalat dua rakaat dan tidak berbicara antara keduanya, maka Allah mengampuni dosanya yang telah lalu.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(165,165,'Kitab Wudhu','Membasuh Tumit','Dari Muhammad bin Ziyad berkata, \"Aku mendengar Abu Hurairah berkata saat dia lewat di hadapan kami dan saat itu orang-orang sedang berwudhu, \"Sempurnakanlah wudhu kalian! Sesungguhnya Abul Qasim (Nabi shallallahu \'alaihi wasallam) telah bersabda, \"Celakalah bagi tumit-tumit yang tidak terkena air wudhu akan masuk neraka.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(166,166,'Kitab Wudhu','Membasuh Kedua Kaki (dengan Mengenakan) Sandal, Bukan Mengusap Dua Sandalnya. ','Dari Ubaid bin Juraij bahwa dia berkata kepada Abdullah bin Umar, \"Wahai \'Abdurrahman, aku melihat anda mengerjakan empat hal yang tidak aku lihat seorangpun dari sahabatmu melakukannya!\" \'Abdullah bin Umar berkata, \"Apa sajakah itu wahai Ibnu Juraij?\" Ibnu Juraij menjawab, \"Aku melihatmu tidak menyentuh semua rukun-rukun (Ka\'bah) kecuali rukun Yamani, aku melihatmu memakai sandal yang tidak berbulu, aku melihatmu mencelup dengan warna kuning, dan aku melihatmu ketika berada di Mekah sedang orang-orang mulai berihram sedangkan engkau tidak berihram sehingga datang hari Tarwiyah (tanggal delapan Dzulhijjah). Abdullah bin Umar menjawab, \"Adapun tentang rukun-rukun, karena aku tidak pernah melihat Rasulullah shallallahu \'alaihi wasallam menyentuh kecuali rukun Yamani saja. Dan sandal yang tidak berbulu yang dicelup, karena aku melihat Rasulullah shallallahu \'alaihi wasallam memakai sendal yang tidak ada bulunya dan beliau berwudhu sambil memakainya, dan aku juga senang memakainya. Mengenai warna kuning, sungguh aku melihat Rasulullah shallallahu \'alaihi wasallam mencelup dengan warna itu.  Sedangkan memulai berihram bila melihat bulan, karena aku tidak meliht Rasulullah memulai berihram bila melihat bulan hingga kendaraan beliau pergi membawa beliau.','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(167,167,'Kitab Wudhu','Mendahulukan yang Kanan pada Waktu Berwudhu ataupun Mandi ','Dari Ummu Athiyah ia berkata, \"Nabi shallallahu \'alaihi wasallam bersabda kepada mereka saat memandikan puterinya: Dahulukanlah bagian-bagian kanannya dan bagian-bagian wudhu darinya.”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(168,168,'Kitab Wudhu','Mendahulukan yang Kanan pada Waktu Berwudhu ataupun Mandi ','Dari Aisyah berkata, \"Nabi shallallahu \'alaihi wasallam menyukai untuk mendahulukan yang kanan saat memakai sendal, bersisir, bersuci, dam dalam semua urusan beliau.” ','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(169,169,'Kitab Wudhu','Mencari Air Whudu Apabila Waktu Shalat Telah Tiba','Dari Anas bin Malik berkata, \"Ketika waktu shalat Ashar tiba, orang-orang mencari air wudhu namun tidak mendapatkannya. Lalu aku melihat Rasulullah shallallahu \'alaihi wasallam diberi air wudhu, Rasulullah kemudian memasukkan tangannya kedalam bejana (air) itu, lalu beliau menyuruh orang-orang untuk berwudhu dari air bejana itu.\" Anas berkata, \"Aku melihat air itu keluar dari jari-jari beliau sampai semua orang yang terakhir dari mereka selesai berwudhu.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(170,170,'Kitab Wudhu','Air yang Dipakai untuk Membasuh Rambut Manusia ','Dari Ibnu Sirin berkata, \"Aku berkata kepada Abidah, \"Kami memiliki beberapa helai rambut Nabi shallallahu \'alaihi wasallam yang kami dapat dari Anas, atau keluarga Anas.\' Lalu ia (Abidah) berkata, \"Sungguh sekiranya aku memiliki satu helai rambut Rasulullah, maka itu lebih aku sukai daripada dunia dan seisinya.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(171,171,'Kitab Wudhu','Air yang Dipakai untuk Membasuh Rambut Manusia ','Dari Anas, bahwa ketika Rasulullah shallallahu \'alaihi wasallam mencukur rambutnya, maka Abu Thalhah lah orang yang pertama kali mengambil rambut beliau.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(172,172,'Kitab Wudhu','Apabila Seekor Anjing Minum dari Bejana Milik Seseorang dari Kalian, Maka Hendaklah Ia Mencuci Bejananya Itu Tujuh Kali ','Dari Abu Hurairah berkata, \"Sesungguhnya Rasulullah shallallahu \'alaihi wasallam bersabda: \"Jika anjing menjilat bejana seorang dari kalian, maka hendaklah ia cuci hingsga tujuh kali.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(173,173,'Kitab Wudhu','Apabila Seekor Anjing Minum dari Bejana Milik Seseorang dari Kalian, Maka Hendaklah Ia Mencuci Bejananya Itu Tujuh Kali ','Dari Abu Hurairah dari Nabi shallallahu \'alaihi wasallam bahwasanya laki-laki melihat seekor anjing memakan debu karena kehausan. Maka laki-laki itu mengambil sepatunya, kemudian ia mengambilkan air dengannya lalu memberi minum anjing itu hingga ia merasa kenyang. Maka Allah memuji laki-laki itu dan memasukkannya kedalam surga. ','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(174,174,'Kitab Wudhu','Apabila Seekor Anjing Minum dari Bejana Milik Seseorang dari Kalian, Maka Hendaklah Ia Mencuci Bejananya Itu Tujuh Kali ','Dari Ibnu Syihab ia berkata, telah menceritakan kepadaku Hamzah bin \'Abdullah dari ayahnya, bahwa pada masa Rasulullah shallallahu \'alaihi wasallam ada beberapa anjing datang dan pergi ke mesjid, dan anjing-anjing itu terkadang kencing di mesjid, namun para sahabat tidak menyiramkan air ke tempat yang didalui anjing itu.”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(175,175,'Kitab Wudhu','Apabila Seekor Anjing Minum dari Bejana Milik Seseorang dari Kalian, Maka Hendaklah Ia Mencuci Bejananya Itu Tujuh Kali ','Dari Adi bin Hatim berkata, \"Aku bertanya kepada Nabi shallallahu \'alaihi wasallam, beliau lalu menjawab: \"Jika kamu melepaskan anjingmu yang telah terlatih, lalu ia membunuh hewan (yang halal dagingnya), maka makanlah hewan itu. Tapi jika anjingmu itu telah memakannya maka jangankanlah kamu memakan hewan itu, sebab ia menangkap untuk dirinya sendiri.\" Aku lalu bertanya lagi, \"Bagaimanakah jika aku melepaskan anjingku, lalu aku menemukan anjing lain bersamanya?\" Beliau menjawab: \"Jangan kamu makan hewan itu, karena kamu mengucapkan bismillah dengan melepaskan anjingmu, dan kamu tidak mengucpakannya untuk anjing yang lain.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(176,176,'Kitab Wudhu','Orang yang Berpendapat; Tidak Perlu Berwudhu lagi Kecuali Bila Ada Sesuatu yang Keluar dari Dua Jalan Keluar, Yaitu Kemaluan dan Dubur','Dari Abu Hurairah berkata, \"Nabi shallallahu \'alaihi wasallam bersabda: \"Seorang hamba tetaplah mendapatkan pahala shalat, selama ia tetap menunggu datangnya shalat, sebelum ia berhadats.\" Lalu ada seorang laki-laki asing berkata, \"Apa yang dimaksud dengan hadats wahai Abu Hurairah?\" Abu Hurairah menjawab adanya suara (yakni kentut).”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(177,177,'Kitab Wudhu','Orang yang Berpendapat; Tidak Perlu Berwudhu lagi Kecuali Bila Ada Sesuatu yang Keluar dari Dua Jalan Keluar, Yaitu Kemaluan dan Dubur','Dari \'Abbad bin Tamim dari Pamannya dari Nabi shallallahu \'alaihi wasallam, beliau bersabda: \"Tidaklah seseorang keluar dari shalat, kecuali ia mendengar suara (kentut) atau mencium baunya.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(178,178,'Kitab Wudhu','Orang yang Berpendapat; Tidak Perlu Berwudhu lagi Kecuali Bila Ada Sesuatu yang Keluar dari Dua Jalan Keluar, Yaitu Kemaluan dan Dubur','Dari Muhammad bin Al Hanafiyah ia berkata, Ali berkata, \"Aku adalah seorang laki-laki yang mudah mengeluarkan madzi, karena malu untuk bertanya kepada Rasulullah shallallahu \'alaihi wasallam, maka aku suruh Miqdad bin Al Aswad untuk bertanya. Lalu ia pun bertanya, beliau kemudian menjawab: \"Dalam hal itu, ia hanya wajib berwudhu saja.\" Syu\'bah juga meriwayatkan dari Al A\'masy.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(179,179,'Kitab Wudhu','Orang yang Berpendapat; Tidak Perlu Berwudhu lagi Kecuali Bila Ada Sesuatu yang Keluar dari Dua Jalan Keluar, Yaitu Kemaluan dan Dubur','Dari Abu Salamah, sesungguhnya \'Atha bin Yasar mengabarkan kepadanya, bahwa Zaid bin Khalid mengabarkan kepadanya, bahwa ia pernah bertanya Utsman bin \'Affan radliallahu \'anhu, Aku bertanya, \"Apa pendapatmu jika seorang laki-laki berhubungan badan dengan isterinya namun tidak keluar air mani?\" \'Utsman menjawab, \"Hendaknya ia berwudhu seperti wudhunya untuk shalat, lalu membasuh kemaluannya.\" Utsman melanjutkan, \"Aku mendengarnya dari Rasulullah shallallahu \'alaihi wasallam, aku menanyakan hal itu kepada \'Ali, az-Zubair, Thalhah, dan Ubay bin Ka\'ab? radliallahu \'anhum, dan merekapun menyuruhku untuk melakukan hal yang sama.”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(180,180,'Kitab Wudhu','Orang yang Berpendapat; Tidak Perlu Berwudhu lagi Kecuali Bila Ada Sesuatu yang Keluar dari Dua Jalan Keluar, Yaitu Kemaluan dan Dubur','Dari Abu Sa\'id Al Khudri, bahwa Rasulullah shallallahu \'alaihi wasallam mengirim seorang utusan kepada seorang laki-laki Anshar. Maka laki-laki Anshar itu pun datangm sementara kepalanya basah. Lalu Nabi shallallahu \'alaihi wasallam bertanya: \"Sepertinya kami telah membuat kamu tergesa-gesa?\" Laki-laki Anshar itu menjawab, \"Ya.\" Rasulullah shallallahu \'alaihi wasallam lalu bersabda: \"Jika kamu dibuat terburu-buru atau belum sampai keluar mani, maka hanya wajib atasnya wudhu.\" ','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(181,181,'Kitab Wudhu','Seseorang yang Membantu Temannya Berwudhu','Dari Usamah bin Zaid, bahwa ketika Rasulullah shallallahu \'alaihi wasallam ketika beliau berangkat dari \'Arafah beliau menuju ke suatu lembah, lalu beliau membuang hajat.\" Usamah bin Zaid berkata, \"Aku lalu menyiramkan air untuknya hingga beliau pun berwudhu. aku lalu berkata, \"Wahai Rasulullah, apakah kita akan shalat di sini?\" Beliau menjawab: \"Waktu shalat sudah di depanmu.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(182,182,'Kitab Wudhu','Seseorang yang Membantu Temannya Berwudhu','Dari Mughirah bin Syu\'bah, bahwa dia pernah bersama Rasulullah shallallahu \'alaihi wasallam dalam suatu perjalanan. Beliau lalu pergi untuk buang hajat, maka Mughirah menuangkan air untuk beliau hingga beliau pun berwudlu, membasuh muka, mengusap kuff dan (sepatu)nya.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(183,183,'Kitab Wudhu','Membaca Al-Qur’an Setelah Berhadats Lainnya ','Dari Abu Kuraib mantan pembantu Ibnu \'Abbas, bahwa \'Abdullah bin \'Abbas mengabarkan kepadanya, bahwa ia pada suatu malam pernah bermalam di rumah<br>Maimunah, isteri Nabi shallallahu \'alaihi wasallam, dan bibinya dari pihak ibu. Katanya, \"Aku berbaring di sisi bantal sementara Nabi shallallahu \'alaihi wasallam dan isterinya berbaring pada bagian panjang (tengahnya). Rasulullah shallallahu \'alaihi wasallam lalu tidur hingga pada tengah malam, atau kurang sedikit, atau lewat sedikit, beliau bangun dan duduk sambil mengusap sisa-sisa kantuk yang ada di wajahnya dengan tangan. Beliau kemudian membaca sepuluh ayat terakhir dari Surah Ali \'Imran. Kemudian berdiri menuju tempat wudhu, beliau lalu berwudhu dengan memperbagus wudhunya, lalu shalat.\" Ibnu \'Abbas berkata, \"Maka akupun ikut dan melakukan sebagaimana yang beliau lakukan, aku lalu berdiri di sampingnya. Beliau kemudian meletakkan tangan kanannya di kepalaku seraya memegang telingaku hingga menggeserku ke sebelah kanannya. Kemudian beliau shalat dua rakaat, kemudian dua rakaat, kemudian dua rakaat, kemudian dua rakaat, kemudian witir. Setelah itu beliau tidur berbaring hingga tukang adzan mendatanginya, beliau lalu berdiri dan shalat dua rakaat ringan, kemudian keluar untuk menunaikan shalat Subuh.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(184,184,'Kitab Wudhu','Orang yang Tidak Berwudhu Lagi Kecuali Karena Pingsan yang Berat/Lama ','Dari Hisyam bin Urwah dari isterinya Fatimah dari neneknya Asma` binti Abu Bakar bahwa ia berkata, \"Aku pernah menemui \'Aisyah, isteri Nabi shallallahu \'alaihi wasallam, ketika terjadi gerhana matahari. Saat itu orang-orang sedang melaksanakan shalat dan saat itu iapun berdiri shalat. Setelah itu aku katakan kepadanya, \"Apa yang dilakukan orang-orang?\" Aisyah lalu memberi isyarat dengan tangannya ke arah langit seraya berkata, \"Maha suci Allah.\" Aku lalu berkata, \"Satu tanda kekuasaan Allah.\" Lalu dia mengiyakan dengan memberi isyarat. Maka akupun ikut shalat sementara timbul perkara yang membingungkanku, hingga aku siram kepalaku dengan air. Selesai shalat Rasulullah shallallahu \'alaihi wasallam mengucapkan puja dan puji kepada Allah, kemudian beliau bersabda: \"Tidak ada sesuatu yang belum diperlihatkan kepadaku, kecuali aku sudah melihatnya dari tempatku ini hingga surga dan neraka. Dan telah diwahyukan kepadaku bahwa kalian akan terkena fitnah dalam<br>qubur kalian seperti, atau hampir serupa dengan fitnah Dajjal yang aku sendiri tidak tahu fitnah apakah itu.\" Asma` berkata, \"Setiap salah seorang dari kalian akan didatangkan (dalam sidang), lalu dikatakan kepadanya, \'Apa yang kamu ketahui tentang laki-laki ini (Rasulullah)? \' Adapun orang beriman atau orang yang yakin -aku tidak tahu mana yang Asma\' ucapkan-, lalu orang tersebut akan menjawab, \'Dia adalah Muhammad utusan Allah. Ia datang kepada kami membawa penjelasan dan petunjuk. Kami lalu menyambutnya, beriman dan mengikuti seruannya.\' Maka kepada orang itu dikatakan, \'Tidurlah kamu dengan baik, sungguh kami telah mengetahui bahwa kamu adalah orang beriman.\' Adapun Munafik atau pelaku dosa besar -Aku tidak tahu mana yang diucapkan Asma\'- akan menjawab, \'Aku tidak tahu siapa dia, aku mendengar orang-orang mengatakan sesuatu maka aku pun mengikuti ucapan tersebut\'.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(185,185,'Kitab Wudhu','Mengusap Seluruh Kepala, Sebagaimana Allah (berfirman), “Dan usapkanlah kepalamu” (QS al-Maidah : 6)','Dari \'Amr bin Yahya Al Mazini dari ayahnya bahwa ada seorang laki-laki bertanya kepada \'Abdullah bin Zaid -dia adalah kakek \'Amr bin Yahya, \"Dapatkah engkau perlihatkan kepadaku bagaimana Rasulullah shallallahu \'alaihi wasallam berwudlu?\" \'Abdullah bin Zaid lalu menjawab, \"Tentu.\" Abdullah lalu minta diambilkan air wudhu, lalu ia menuangkan air pada kedua tangannya dan membasuhnya dua kali, lalu berkumur dan mengeluarkan air dari dalam hidung sebanyak kali, kemudian membasuh mukanya tiga kali, kemudian membasuh kedua tangan dua kali dua kali sampai ke siku, kemudian mengusap kepalanya dengan tangan, dimulai dari bagian depan dan menariknya hingga sampai pada bagian tengkuk, lalu menariknya kembali ke tempat semula. Setelah itu membasuh kedua kakinya.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(186,186,'Kitab Wudhu','Membasuh Kedua Kaki Sampai Kedua Matakaki','Dari \'Amr dari Ayahnya (ia berkata), \"Aku pernah menyaksikan \'Amr bin Abu Hasan bertanya kepada \'Abdullah bin Zaid tentang wudhunya Nabi shallallahu \'alaihi wasallam. Lalu ia minta diambilkan satu gayung air, kemudian ia memperlihatkan kepada mereka cara wudlu Nabi shallallahu \'alaihi wasallam. Ia menuangkan air dari gayung ke telapak tangannya lalu mencucinya tiga kali, kemudian memasukkan tangannya ke dalam gayung, lalu berkumur-kumur, lalu memasukkan air ke hidung lalu mengeluarkannya kembali dengan tiga kali cidukan, kemudian memasukkan tangannya ke dalam gayung, lalu membasuh mukanya tiga kali, kemudian membasuh kedua tangannya dua kali sampai ke siku. Kemudian memasukkan tangannya ke dalam gayung, lalu mengusap kepalanya dengan tangan; mulai dari bagian depan ke belakang dan menariknya kembali sebanyak satu kali, lalu membasuh kedua kakinya hingga mata kaki.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(187,187,'Kitab Wudhu','Menggunakan Sisa Air Wudhu Orang Lain ','(Dari) al-Hakam ia berkata, aku pernah mendengar Abu Juhaifah berkata, \"Rasulullah shallallahu \'alaihi wasallam pernah keluar mendatangi kami di waktu tengah hari yang panas. Beliau lalu diberi air wudhu hingga beliau pun berwudhu, orang-orang lalu mengambil sisa air wudhu beliau seraya mengusapkannya. Kemudian Nabi shallallahu \'alaihi wasallam shalat zhuhur dua rakaat dan \'ashar dua rakaat sedang di depannya diletakkan dengan sebatang tongkat.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(188,188,'Kitab Wudhu','Menggunakan Sisa Air Wudhu Orang Lain ','Abu Musa berkata, “Nabi shallallahu \'alaihi wasallam meminta semangkuk air, lalu beliau membasuh kedua tangannya dan wajannya didalamnya dan mengeluarkan air dari dalam mulut beliau. Lalu beliau berkata kepada mereka berdua (dua orang yang sedang bersama beliau). \'Minumlah dari air itu dan siramkanlah pada wajah dan leher kalian berdua.”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(189,189,'Kitab Wudhu','Menggunakan Sisa Air Wudhu Orang Lain ','Dari Ibnu Syihab ia berkata, Mahmud bin Ar Rabi\' mengabarkan kepadaku, ia berkata, \"Dialah orang yang diberkahi oleh Rasulullah shallallahu \'alaihi wasallam di wajahnya saat dia masih kecil dari sumur mereka.\" Dan \'Urwah menyebutkan dari Al Miswar, dan Selainnya - setiap dari keduanya saling membenarkan satu sama lain-, bahwa ketika Nabi shallallahu \'alaihi wasallam berwudhu, hampir saja mereka berkelahi memperebutkan bejana bekas wudhu beliau.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(190,190,'Kitab Wudhu','Menggunakan Sisa Air Wudhu Orang Lain ','Dari Ja’ad berkata, aku mendengar Sa\'ib bin Yazid berkata, \"Bibiku pergi bersamaku menemui Nabi shallallahu \'alaihi wasallam, lalu ia berkata, \"Wahai Rasulullah, sesungguhnya putra saudara perempuanku ini sedang sakit.\" Maka Nabi shallallahu \'alaihi wasallam mengusap kepalaku dan memohonkan keberkahan untukku. Kemudian beliau berwudlu, maka aku pun minum dari sisa air wudhunya, kemudian aku berdiri di belakangnya hingga aku melihat ada tanda kenabian sebesar telur burung di pundaknya.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(191,191,'Kitab Wudhu','Orang yang Berkumur-Kumur dan Ber-istinsyaq dari Seciduk Air','Dari Abdullah bin Zaid, bahwa ia menuangkan air dari bejana ke kedua tangannya, lalu membasuh keduanya. Kemudian ia membasuh -atau berkumur-kumurdan ber-istinsyaq- dengan stau telapak tangannya. Ia  melakukan hal itu sebanyak tiga kali. Kemudian membasuh kedua tangannya sampai ke siku dua kali dua kali. Kemudian mengusap kepalanya dengan tangan dan menariknya (ke belakang kepala) lalu mengembalikannya sekali, lalu membasuh kedua kakinya hingga pergelangan kakinya. Setelah itu ia berkata, \"Begitulah wudhunya Rasulullah shallallahu \'alaihi wasallam.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(192,192,'Kitab Wudhu','Mengusap Kepala dengan Sekali Usapan ','Dari Wuhaib, ia berkata, “Telah menceritakan kepadaku Amr bin Yahya dari ayahnya, ia berkata; Aku pernah menyaksikan Amr bin Abu al-Hasan bertanya kepada Abdullah bin Zaid tentang wudhunya Nabi shallallahu \'alaihi wasallam. Abdullah lalu minta diambilkan bejana berisi air, lalu ia memperlihatkan kepada mereka cara wudhu Nabi shallallahu \'alaihi wasallam. Lalu ia memulai dengan menuangkan air dari bejana ke telapak tangannya lalu mencucinya tiga kali. Kemudian memasukkan tangannya ke dalam bejana, lalu berkumur-kumur, lalu memasukkan air ke hidung dan mengeluarkannya kembali dengan tiga kali cidukan. Kemudian memasukkan tangannya ke dalam bejana dan membasuh mukanya tiga kali, kemudian memasukkan tangannya ke dalam bejana dan membasuh kedua tangannya sampai ke siku dua kali dua kali. Kemudian ia memasukkan tangannya ke dalam bejana dan mengusap kepalanya dengan tangan, ia mulai dari bagian depan ke belakang lalu mengembalikannya lagi (ke arah depan), kemudian memasukkan tangannya ke dalam bejana dan membasuh kedua kakinya.\" <br><br>(Rawi berkata), “Telah menceritakan kepada kami Musa berkata, telah menceritakan kepada kami Wuhaib berkata, \"Ia (Amr bin Abu Hasan) mengusap kepalanya satu kali (usapan).\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(193,193,'Kitab Wudhu','Wudhunya Seorang Laki-Laki Bersama Isterinya, dan Menggunakan Sisa Air Wudhu Seorang Wanita, Umar Pernah Berwudhu dengan Air Panas dari Rumah Seorang Perempuan Nashrani','Dari Abdullah bin Umar, bahwasanya ia berkata, \"Kaum laki-laki dan kaum wanita berwudhu secara bersama-sama pada masa Rasulullah.”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(194,194,'Kitab Wudhu','Nabi shallallahu ‘alaihi wasallam Menuangkan Air Wudhunya pada Orang yang Pingsan ','Dari Jabir ia berkata, \"Rasulullah shallallahu \'alaihi wasallam datang menjenguk saat aku sedang sakit tidak sadarkan diri. Nabi shallallahu \'alaihi wasallam lalu berwudhu dan memercikkan air wudhu beliau kepadaku. Kemudian aku berkata: \'Wahai Rasulullah, untuk siapakah warisan itu? Karena sesungguhnya aku tidak mewariskan kalalah (orang yang tidak mempunyai anak dan orang tua)?. Maka turunlah ayat tentang faraidh (waris).\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(195,195,'Kitab Wudhu','Nabi shallallahu ‘alaihi wasallam Menuangkan Air Wudhunya pada Orang yang Pingsan ','Dari Anas berkata, \"Waktu shalat telah masuk, bagi orang-orang yang rumahnya dekat mereka pulang untuk wudlu, sementara yang lain masih di dalam masjid. Lalu diberikan sebuah bejana kecil yang terbuat dari kayu kepada Rasulullah shallallahu \'alaihi wasallam. Namun bejana itu tidak cukup untuk dimasuki oleh telapak tangan beliau, hingga orang-orang pun berwudlu (dari jari tangan beliau) semua.\" Kami lalu bertanya, \"Berapa jumlah kalian saat itu?\" Anas menjawab, \"Delapan puluh orang lebih.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(196,196,'Kitab Wudhu','Nabi shallallahu ‘alaihi wasallam Menuangkan Air Wudhunya pada Orang yang Pingsan ','Dari Abu Musa, bahwa Nabi shallallahu \'alaihi wasallam minta diambilkan mangkuk yang berisi air, beliau lalu mencuci kedua tangan dan wajahnya didalamnya, kemudian mengeluarknnya  dari dalam mulut beliau kedalam mangkok tersebut.”','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(197,197,'Kitab Wudhu','Nabi shallallahu ‘alaihi wasallam Menuangkan Air Wudhunya pada Orang yang Pingsan ','Dari Abdullah bin Zaid berkata, \"Rasulullah shallallahu \'alaihi wasallam datang, lalu kami membawakan kepadanya  air dalam sebuah bejana yang terbuat dari kuningan. Kemudian beliau berwudhu. Lalu membasuh mukanya tiga kali, lalu membasuh tangannya dua kali dua kali. Kemudian beliau mengusap kepalanya dimulai dari bagian depan sampai bagian belakangnya dan menariknya kembali ke depan. Kemudian beliau membasuh kedua kakinya.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(198,198,'Kitab Wudhu','Nabi shallallahu ‘alaihi wasallam Menuangkan Air Wudhunya pada Orang yang Pingsan ','Dari az-Zuhri ia berkata : “Telah mengabarkan kepadaku \'Ubaidullah bin Abdullah bin \'Utbah bahwa Aisyah berkata, \"Tatkala sakit Nabi shallallahu \'alaihi wasallam semakin berat, beliau minta izin kepada isteri-isterinya agar beliau dirawat di rumahku, lalu mereka pun mengizinkannya. Nabi shallallahu \'alaihi wasallam lalu keluar berjalan dengan dipapah oleh dua orang; \'Abbas dan seorang lagi.\" \'Ubaidullah berkata, \"Aku lalu kabarkan hal itu kepada \'Abdullah bin \'Abbas, lalu dia berkata, \"Tahukah kamu, siapakah lelaki yang lain itu?\" Aku jawab, \"Tidak\". Dia lantas berkata, \"Orang itu adalah \'Ali bin Abu Thalib? Radliallahu \'anhu.\" \'Aisyah menceritakan bahwa ketika Nabi shallallahu \'alaihi wasallam sudah berada di rumahnya dan sakitnya makin berat, beliau mengatakan: \"Siramkan air kepadaku dari tujuh geriba yang belun dilepas ikatannya, sehingga aku dapat memberi pesan kepada orang-orang.\" Kemudian Nabi shallallahu \'alaihi wasallam didudukkan untuk mandi dengan ember milik Hafshah, isteri Nabi shallallahu \'alaihi wasallam. Maka kami segera menyiram beliau hingga beliau memberi isyarat sudah cukup. Setelah itu beliau keluar menemui orang-orang (jamaah).\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(199,199,'Kitab Wudhu','Berwudhu dari Wajana Kecil ','(Dari) Amr bin Yahya dari Ayahnya, ia berkata, \"Pamanku selalu memperbanyak dalam berwudhu. Lalu ia berkata kepada Abdullah bin Zaid, \"Beritahukanlah kepadaku bagaimana kamu melihat Nabi shallallahu \'alaihi wasallam wudhu?. Lalu ia \'Abdullah bin Zaid meminta bejana kecil berisi air, lalu ia menuangkan ke telapak tangannya dan mencucinya tiga kali. Kemudian memasukkan tangannya ke dalam bejana tersebut, lalu berkumur dan mengeluarkan air dari dalam hidung sebanyak tiga kali dari satu cidukan tangan. Kemudian memasukkan tangannya ke dalam bejana menciduk air dan membasuh mukanya tiga kali. Kemudian membasuh tangannya sampai siku dua kali-dua kali. Kemudian mengambil air dengan tangannya dan mengusap kepalanya, ia tarik tangannya ke belakang kepala lalu dikembalikan ke depan. Kemudian membasuh kakinya. Setelah itu berkata, \"Begitulah aku melihat Nabi shallallahu \'alaihi wasallam berwudhu\'.\"','0000-00-00 00:00:00','0000-00-00 00:00:00'),
(200,200,'Kitab Wudhu','Berwudhu dari Wajana Kecil ','Dari Anas rhadiyallahu \'anhu bahwasanya Nabi shallallahu \'alaihi wasallam meminta untuk diambilkan bejana berisi air. Kemudian didatangkan kepada beliau sebuah mangkuk besar yang berisi air, lalu beliau memasukkan jemarinya kedalamnya.  Anas berkata, \'Maka aku melihat air keluar dari selah-selah jari beliau.\" Anas menambahkan, \"Maka aku menduga bahwa orang-orang yang berwudhu antara tujuh puluh sampai delapan puluh orang.\"','0000-00-00 00:00:00','0000-00-00 00:00:00');
