(1,1,'alqamah bin waqqash al laits kata dengar umar bin khaththab atas mimbar kata dengar rasulullah shallallahu alaih wasallam sabda sungguh amal amal buat turut niat niat barangsiapa hijrah dunia oleh karema wanita nikah hijrah laku hijrah','2019-02-10 02:24:44','2019-02-10 02:24:44'),
(2,2,'aisyah ummul um muminin al harits bin hisyam ta rasulullah shallallahu alaih wasallam kata rasulullah datang wahyu kepada rasulullah shallallahu alaih wasallam jawab kadang wahyu datang kepada suara gemerincing bunyi lonceng berat turut putus dar sadar kata kadang kadang datang kepada malaikat ubah wujud laki laki bicara kepada hafal kata aisyah kata sungguh lihat beliau wahyu turun hari dingin wahyu selesai sampai dahi beliau nuh keringat','2019-02-10 02:24:47','2019-02-10 02:24:47'),
(3,3,'aisyah ummul mukminin is kata wahyu pertama turun rasullul shallallahu alaih wasallam mimpi benar tidur beliau mimpi mimpi jadi nyata ang benderang cahaya shubuh beliau suka sendiri beliau sendiri gua hira beliau ibadah sana malam beliau rindu keluarga ambil bekal beliau pulang rumah khadijah beliau ambil bekal datang nar beliau gua hira datang sosok malaikat seraya kata baca beliau jawab sungguh baca  ambil dekap rasa lemas lepas kata baca kata sungguh baca ambil dekap dua kali lepas kata baca kata sungguh baca ambil dekap tiga kali lepas baca iqra bismirabbikalladz khalaq khalaqal insaana min alaq iqra warabbukal akram alladzi allama bil qalam allamal insaana maa lam yalam baca sebut nama tuhan cipta cipta gumpal darah baca tuhan purah ajar manusia ketahu brkemudi rasullul shallallahu alaih wa sallam pulang bawa ayat ayat hati debar debar beliau masuk rumah temu khadijah binti khuwailid lantas beliau kata limut limut mudia limut beliau rasa takut beliau hilang beliau kata cerita khadijah sungguh takut atas diri khadijah kata beliau takut allah allah susah sungguh engkau suka sambung tali saudara tanggung beban usaha bantu punya pulia tamu tolong tegak naranbrbrkemudi khadijah ajak beliau pergi temu waraqah bin naufal bin asad bin abdul uzza anak paman khadijah peluk agama nashran zaman jahiliyah tulis tulis ibran tulis injil bahasa ibran tua buta khadijah kata paman dengar cerita putra saudara waraqah kata beliau putra saudara engkau lihat lantas rasulullah shallallaahu alaih wasallam cerita beliau lihat waraqah kata beliau wahyu turun allah musa aduhai andai muda andai hidupketika kaum usir rasulullah shallallahu alaih wasallam ta usir waraqah jawab ya datang seorang engkau bawa kecuali musuh jumpa masa tolong tolong tangguh waraqah tinggal wahyu putus waktu ','2019-02-10 02:25:03','2019-02-10 02:25:03'),
(4,4,'jabir bin abdil al anshar kata  cerita wahyu turun selang putus  beliau shallallahu alaih wasallam sabda hadits jalan tiba tiba dengar suara langit angkat pandang atas nyata malaikat datang gua hira duduk atas kursi letak langit dna bum jadi takut lantas pulang kata limut limut allah turun ayat  yaa ayyuhal muddatstsir qum fa andzir ayat warrujza fahjur hai selimut bangun i ingat ayat  buat dosa tinggal qs al muddatstsir   wahyu tenang us langsung','2019-02-10 02:25:06','2019-02-10 02:25:06'),
(5,5,'ibnu abbas firman allah taala gerak lidah cepat hafal isi wahyu qs al qiyamah   kata rasulullah alami kond berat terima wahyu  beliau gerak gerak dua bibir  ibnu abbas kata gerak gerak dua hadap rasulullah shalallahu alaih wasallam gerak gerak said kata gerak gerak dua lihat ibnu abbas gerak gerak lantas gerak gerak dua bibir  allah turun ayat laa tuharrik bihi lisaanaka litajala bih inna alainaa jamahu wa quraanahu gerak lidah cepat hafal isi wahyu sungguh jadi tanggung umpul dada buat pandai baca qs al qiyamah   kata umpul untuk dada baca  fa idzaa qaranaahu fattab quraanahu baca wahyu ikut baca qs al qiyamah  kata dengar baik baik diam tsumma inna alainaa bayaanahu sungguh atas tanggung jelas qs al qiyamah  baca rasullu shalallahu alaih wasallam jibril datang dengar jibril pergi nabi shallallahu alaih wasallam baca jibril baca ','2019-02-10 02:25:16','2019-02-10 02:25:16'),
(6,6,'ibnu abbas kata rasulull shalallhu alaih wasallam dermawan beliau jadi dermawan bulan ramadh jibril temu temu beliau malam bulan ramadh jibril tadarus al quran beliau rasulullah shalallahu alaih wasallam dermawan bai angin hembus','2019-02-10 02:25:18','2019-02-10 02:25:18'),
(7,7,'cerita abu al yam al hakam bin nafi kata abar syuaib az zuhr abar kepada ubaidul bin abdul bin utbah bin masud abdul bin abbas abar abu sufy bin harb abar heraclius terima rombong dagang quraisy adakan ekspedisi dagang neger syam laku janji nabi shallallahu alaih wasallam abu sufy kafir quraisy singgah iliya temu heraclius atas undang heraclius ajak dialog majelis heraclius besar besar neger romawi heraclius bicara terjemah heraclius kata hubung keluarga a nabi abu sufy kata jawab hubung keluarga heraclius kata dekat dengan sahabat sahabat letak quraisy ada belakang abu sufy heraclius kata terjemah kata ta lelaki a nabi dusta kepada dustakannyadem allah rasa malu akibat tuding dusta lontar kepada niscaya dusta abu sufy kata pertama tanya kepada tentang nabi shallallahu alaih wasallam dudu nasab tengah tengah jawab turun baik baik bangsawan  tanya ata jawab tanya bapak raja jawab ikut pandang rendah jawab ikut rendah ta tambah ikut kurang jawab tambah ta murtad bab dongkolterhadap agama jawab ta dapat dusta sampai kata jawab ta la curang jawab gaul dengan laku brbrberkata abu sufy sampai ucap ta ang jawab iya ta sudah perang jawab perang kadang alah kadang alah ta intah jawab suruh sembah allah kutu apa tinggal kata nenek moyang  intah tegak shalat tunai zakat kata jujur paaf sambung silaturrahim brbrmaka heraclius kata terjemah kata ta kepada turun cerita turun bangsawan laki laki bangkit tengah turun kaum tanya kepada ata kata jawab andai kata yangmengata kuanggap tiru nahmengata tanya kepada bapak turun raja jawab kata andai bapak turun raja tuntut raja bapak tanya kepada dapat dusta sampai kata jawab sungguh paham manusia berani dusta dusta allah ta kepada ikut pandang rendah jawab rendah ikut jadi ikut rasul ta kepada tambah ikut kurang jawab tambah perkara iman jadi sempurna ta kepada murtad bab marah agama jawab iman masuk tumbuh semi hati ta kepada la curang jawab rasul curang ta kepada intah jawab intah sembah allah kutu apa larang sembah hala intah te