(180,180,'abu said al khudr rasulullah shallallahu alaih wasallam irim utus laki laki anshar laki laki anshar datangm kepala basah nabi shallallahu alaih wasallam ta buat gesa gesa laki laki anshar jawab ya rasulullah shallallahu alaih wasallam sabda buat buru buru keluar mani wajib atas wudhu ','2019-02-10 02:52:54','2019-02-10 02:52:54'),
