(182,182,'mughirah bin syubah rasulullah shallallahu alaih wasallam jalan beliau pergi buang hajat mughirah tuang air beliau beliau wudlu basuh muka usap kuff sepatu','2019-02-10 02:52:58','2019-02-10 02:52:58'),
(183,183,'abu kuraib mantan bantu ibnu abbas abdul bin abbas abar malam malam rumahbrmaimunah ister nabi shallallahu alaih wasallam bibi pihak ibu kata baring sisi bantal nabi shallallahu alaih wasallam ister baring bagi panjang tengah rasulullah shallallahu alaih wasallam tidur tengah malam kurang lewat beliau bangun duduk usap sisa sisa kantuk wajah tang beliau baca puluh ayat akhir surah ali imr diri tuju tempat wudhu beliau wudhu bagus wudhu shalat ibnu abbas kata aku ikut laku beliau laku diri samping beliau letak tang kanan kepala seraya pegang telinga geser sebe kanan beliau shalat dua rakaat dua rakaat dua rakaat dua rakaat witir beliau tidur baring tukang adz datang beliau diri shalat dua rakaat ringan keluar tunai shalat subuh','2019-02-10 02:53:06','2019-02-10 02:53:06'),
(184,184,'hisyam bin urwah ister fatimah nenek asma binti abu bakar kata temu aisyah ister nabi shallallahu alaih wasallam jadi gerhana matahari laksana shalat ia diri shalat kata laku aisyah i isyarat tang arah langit seraya kata maha suc allah kata satu tanda kuasa allah iya i isyarat aku ikut shalat timbul perkara bingung siram kepala air selesai shalat rasulullah shallallahu alaih wasallam ucap puja puji allah beliau sabda lihat kepada kecuali lihat tempat surga neraka wahyu kepada kena fitnah dalambrqubur fitnah dajjal tahu fitnah asma kata sa datang sidang kata tahu laki laki rasulullah  iman yakin  tahu asma ucap  jawab muhammad utus allah datang bawa jelas tunjuk sambut iman ikut ru kata tidur baik sungguh ketahu iman munafik pela dosa besar  tahu ucap asma  jawab tahu dengar ata ikut ucap','2019-02-10 02:53:15','2019-02-10 02:53:15'),
(185,185,'amr bin yahya al mazin ayah laki laki ta abdul bin zaid  kakek amr bin yahya dapat engkau lihat kepada rasulullah shallallahu alaih wasallam wudlu abdul bin zaid jawab abdul minta ambil air wudhu tuang air dua tang basuh dua kali kumur keluar air hidung kali basuh muka tiga kali basuh dua tang dua kali dua kali siku usap kepala tang mulai bagi tarik bagi tengkuk tarik kembali tempat basuh dua kaki','2019-02-10 02:53:20','2019-02-10 02:53:20'),
(186,186,'amr ayah kata saksi amr bin abu hasan ta abdul bin zaid wudhu nabi shallallahu alaih wasallam minta ambil satu gayung air lihat cara wudlu nabi shallallahu alaih wasallam tuang air gayung telapak tang cuci tiga kali pasuk tang gayung kumur kumur pasuk air hidung keluar kembali tiga kali cidu pasuk tang gayung basuh muka tiga kali basuh dua tang dua kali siku pasuk tang gayung usap kepala tang mulai bagi belakang tarik kembali satu kali basuh dua kaki mata kaki','2019-02-10 02:53:26','2019-02-10 02:53:26'),
(187,187,'al hakam kata dengar abu juhaifah kata rasulullah shallallahu alaih wasallam keluar datang waktu tengah hari panas beliau i air wudhu beliau wudhu ambil sisa air wudhu beliau seraya usap nabi shallallahu alaih wasallam shalat zhuhur dua rakaat ashar dua rakaat depan letak batang tongkat','2019-02-10 02:53:29','2019-02-10 02:53:29'),
(188,188,'abu musa kata nabi shallallahu alaih wasallam pinta mangkuk air beliau basuh dua tang wajan dalam keluar air mulut beliau beliau kata dua dua beliau minum air siram wajah leher dua','2019-02-10 02:53:31','2019-02-10 02:53:31'),
(189,189,'ibnu syihab kata mahmud bin ar rabi abar kepada kata kah rasulullah shallallahu alaih wasallam wajah sumur urwah but al miswar selain   dua nar satu  nabi shallallahu alaih wasallam wudhu kelahi ebut bejana bekas wudhu beliau','2019-02-10 02:53:34','2019-02-10 02:53:34'),
(190,190,'jaad kata dengar saib bin yazid kata bibi pergi sama temu nabi shallallahu alaih wasallam kata rasulullah sungguh putra saudara perempuan sakit nabi shallallahu alaih wasallam usap kepala pohon kahan untuk beliau wudlu minum sisa air wudhu diri belakang lihat tanda nabi besar telur burung pundak','2019-02-10 02:56:56','2019-02-10 02:56:56'),
(191,191,'abdul bin zaid tuang air bejana dua tang basuh dua basuh  kumur kumurd  istinsyaq  stau telapak tang  laku tiga kali basuh dua tang siku dua kali dua kali usap kepala tang tarik belakang kepala kembali basuh dua kaki gelang kaki kata wudhu rasulullah shallallahu alaih wasallam','2019-02-10 02:57:00','2019-02-10 02:57:00'),
(192,192,'wuhaib kata cerita kepada amr bin yahya ayah kata saksi amr bin abu al hasan ta abdul bin zaid wudhu nabi shallallahu alaih wasallam abdul minta ambil bejana isi air lihat cara wudhu nabi shallallahu alaih wasallam pulai tuang air bejana telapak tang cuci tiga kali pasuk tang bejana kumur kumur pasuk air hidung keluar kembali tiga kali cidu pasuk tang bejana basuh muka tiga kali pasuk tang bejana basuh dua tang siku dua kali dua kali pasuk tang bejana usap kepala tang mulai bagi belakang kembali arah pasuk tang bejana basuh dua kaki brbrraw kata cerita musa kata cerita wuhaib kata amr bin abu hasan usap kepala satu kali usap','2019-02-10 02:57:07','2019-02-10 02:57:07'),
(193,193,'abdul bin umar kata kaum laki laki kaum wanita wudhu cara masa rasulullah','2019-02-10 02:57:08','2019-02-10 02:57:08'),
(194,194,'jabir kata rasulullah shallallahu alaih wasallam datang jenguk sakit sadar nabi shallallahu alaih wasallam wudhu cik air wudhu beliau kepada kata rasulullah waris sungguh waris kala punya anak tua turun ayat faraidh waris','2019-02-10 02:57:11','2019-02-10 02:57:11'),
(195,195,'anas kata waktu shalat masuk rumah pulang wudlu masjid ikan bejana buat kayu rasulullah shallallahu alaih wasallam bejana cukup masuk telapak tang beliau wudlu jari tang beliau ta jumlah anas jawab delapan puluh','2019-02-10 02:57:13','2019-02-10 02:57:13'),
(196,196,'abu musa nabi shallallahu alaih wasallam minta ambil mangkuk isi air beliau cuci dua tang wajah dalam keluarkn  mulut beliau dalam mangkok','2019-02-10 02:57:14','2019-02-10 02:57:14'),
(197,197,'abdul bin zaid kata rasulullah shallallahu alaih wasallam datang bawa  air bejana buat kuning beliau wudhu basuh muka tiga kali basuh tang dua kali dua kali beliau usap kepala mulai bagi bagi belakang tarik kembali beliau basuh dua kaki','2019-02-10 02:57:17','2019-02-10 02:57:17'),
(198,198,'az zuhr kata  abar kepada ubaidul bin abdul bin utbah aisyah kata tatkala sakit nabi shallallahu alaih wasallam berat beliau minta izin ister ister beliau rawat rumah izin nabi shallallahu alaih wasallam keluar jalan papah dua abbas ubaidul kata kabar abdul bin abbas kata tahu lelaki jawab lantas kata ali bin abu thalib radliallahu anhu aisyah cerita nabi shallallahu alaih wasallam ada rumah sakit berat beliau ata siram air kepada tujuh geriba un lepas ikat i pesan nabi shallallahu alaih wasallam duduk mandi ember milik hafshah ister nabi shallallahu alaih wasallam siram beliau beliau i isyarat cukup beliau keluar temu jamaah','2019-02-10 02:57:23','2019-02-10 02:57:23'),
(199,199,'amr bin yahya ayah kata paman banyak wudhu kata abdul bin zaid itahu kepada lihat nabi shallallahu alaih wasallam wudhu abdul bin zaid pinta bejana isi air tuang telapak tang cuci tiga kali pasuk tang bejana kumur keluar air hidung tiga kali satu cidu tang pasuk tang bejana ciduk air basuh muka tiga kali basuh tang siku dua kali dua kali ambil air tang usap kepala tarik tang belakang kepala kembali basuh kaki kata lihat nabi shallallahu alaih wasallam wudhu','2019-02-10 02:57:28','2019-02-10 02:57:28'),
